: 1}, {"source": 885, "target": 152, "width": 1}, {"source": 885, "target": 73, "width": 1}, {"source": 885, "target": 55, "width": 1}, {"source": 885, "target": 79, "width": 1}, {"source": 885, "target": 100, "width": 1}, {"source": 885, "target": 185, "width": 1}, {"source": 885, "target": 102, "width": 1}, {"source": 885, "target": 16, "width": 1}, {"source": 885, "target": 14, "width": 1}, {"source": 885, "target": 111, "width": 1}, {"source": 885, "target": 85, "width": 1}, {"source": 885, "target": 141, "width": 1}, {"source": 885, "target": 140, "width": 1}, {"source": 885, "target": 414, "width": 1}, {"source": 885, "target": 170, "width": 1}, {"source": 886, "target": 161, "width": 1}, {"source": 886, "target": 73, "width": 1}, {"source": 886, "target": 111, "width": 1}, {"source": 886, "target": 76, "width": 1}, {"source": 886, "target": 66, "width": 1}, {"source": 886, "target": 318, "width": 1}, {"source": 886, "target": 887, "width": 3}, {"source": 887, "target": 7, "width": 1}, {"source": 886, "target": 888, "width": 3}, {"source": 888, "target": 7, "width": 1}], "nodes": [{"_id": 0, "body": "\u003cb\u003eAliases:\u003c/b\u003e Night Dragon\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Night Dragon](https://attack.mitre.org/groups/G0014) is a campaign name for activity involving a threat group that has conducted activity originating primarily in China. (Citation: McAfee Night Dragon)", "color": "#fce903", "group": 5, "header": "G0014", "name": "Night Dragon", "width": 10}, {"_id": 1, "body": "\u003cb\u003eTactic:\u003c/b\u003e adversary-opsec\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Night Dragon](https://attack.mitre.org/groups/G0014) used servers in China, the U.S., and the Netherlands in an attempt to hide their operations.(Citation: McAfee Night Dragon)", "header": "T1307", "name": "Acquire and/or use 3rd party infrastructure services"}, {"_id": 2, "body": "\u003cb\u003eTactic:\u003c/b\u003e establish-\u0026-maintain-infrastructure\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Night Dragon](https://attack.mitre.org/groups/G0014) used third party hosting services in the U.S. in an attempt to hide their operations.(Citation: McAfee Night Dragon)", "header": "T1330", "name": "Acquire and/or use 3rd party software services"}, {"_id": 3, "body": "\u003cb\u003eTactic:\u003c/b\u003e build-capabilities\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Night Dragon](https://attack.mitre.org/groups/G0014) used privately developed and customized remote access tools.(Citation: McAfee Night Dragon)", "header": "T1351", "name": "Remote access tool development"}, {"_id": 4, "body": "[gsecdump](https://attack.mitre.org/software/S0008) is a publicly-available credential dumper used to obtain password hashes and LSA secrets from Windows operating systems. (Citation: TrueSec Gsecdump)", "color": "#ff1a8c", "header": "S0008", "name": "gsecdump"}, {"_id": 5, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[gsecdump](https://attack.mitre.org/software/S0008) can dump Windows password hashes from the SAM.(Citation: TrueSec Gsecdump)", "header": "T1003.002", "name": "Security Account Manager"}, {"_id": 6, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[gsecdump](https://attack.mitre.org/software/S0008) can dump LSA secrets.(Citation: TrueSec Gsecdump)", "header": "T1003.004", "name": "LSA Secrets"}, {"_id": 7, "body": "\u003cb\u003eTactic:\u003c/b\u003e initial-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Night Dragon](https://attack.mitre.org/groups/G0014) has performed SQL injection attacks of extranet web servers to gain access.(Citation: McAfee Night Dragon)", "header": "T1190", "name": "Exploit Public-Facing Application"}, {"_id": 8, "body": "[zwShell](https://attack.mitre.org/software/S0350) is a remote access tool (RAT) written in Delphi that has been used by [Night Dragon](https://attack.mitre.org/groups/G0014).(Citation: McAfee Night Dragon)", "color": "#ff3232", "header": "S0350", "name": "zwShell"}, {"_id": 9, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[zwShell](https://attack.mitre.org/software/S0350) can modify the Registry.(Citation: McAfee Night Dragon)", "header": "T1112", "name": "Modify Registry"}, {"_id": 10, "body": "\u003cb\u003eTactics:\u003c/b\u003e execution, persistence, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[zwShell](https://attack.mitre.org/software/S0350) has used SchTasks for execution.(Citation: McAfee Night Dragon)", "header": "T1053.005", "name": "Scheduled Task"}, {"_id": 11, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[zwShell](https://attack.mitre.org/software/S0350) can browse the file system.(Citation: McAfee Night Dragon)", "header": "T1083", "name": "File and Directory Discovery"}, {"_id": 12, "body": "\u003cb\u003eTactic:\u003c/b\u003e lateral-movement\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[zwShell](https://attack.mitre.org/software/S0350) has used RDP for lateral movement.(Citation: McAfee Night Dragon)", "header": "T1021.001", "name": "Remote Desktop Protocol"}, {"_id": 13, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[zwShell](https://attack.mitre.org/software/S0350) can obtain the name of the logged-in user on the victim.(Citation: McAfee Night Dragon)", "header": "T1033", "name": "System Owner/User Discovery"}, {"_id": 14, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[zwShell](https://attack.mitre.org/software/S0350) can obtain the victim PC name and OS version.(Citation: McAfee Night Dragon)", "header": "T1082", "name": "System Information Discovery"}, {"_id": 15, "body": "\u003cb\u003eTactic:\u003c/b\u003e lateral-movement\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[zwShell](https://attack.mitre.org/software/S0350) has been copied over network shares to move laterally.(Citation: McAfee Night Dragon)", "header": "T1021.002", "name": "SMB/Windows Admin Shares"}, {"_id": 16, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[zwShell](https://attack.mitre.org/software/S0350) can obtain the victim IP address.(Citation: McAfee Night Dragon)", "header": "T1016", "name": "System Network Configuration Discovery"}, {"_id": 17, "body": "\u003cb\u003eTactic:\u003c/b\u003e execution\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[zwShell](https://attack.mitre.org/software/S0350) can launch command-line shells.(Citation: McAfee Night Dragon)", "header": "T1059.003", "name": "Windows Command Shell"}, {"_id": 18, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[zwShell](https://attack.mitre.org/software/S0350) has deleted itself after creating a service as well as deleted a temporary file when the system reboots.(Citation: McAfee Night Dragon)", "header": "T1070.004", "name": "File Deletion"}, {"_id": 19, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[zwShell](https://attack.mitre.org/software/S0350) has established persistence by adding itself as a new service.(Citation: McAfee Night Dragon)", "header": "T1543.003", "name": "Windows Service"}, {"_id": 20, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Night Dragon](https://attack.mitre.org/groups/G0014) has disabled anti-virus and anti-spyware tools in some instances on the victim\u2019s machines. The actors have also disabled proxy settings to allow direct communication from victims to the Internet.(Citation: McAfee Night Dragon)", "header": "T1562.001", "name": "Disable or Modify Tools"}, {"_id": 21, "body": "\u003cb\u003eTactic:\u003c/b\u003e initial-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Night Dragon](https://attack.mitre.org/groups/G0014) sent spearphishing emails containing links to compromised websites where malware was downloaded.(Citation: McAfee Night Dragon)", "header": "T1566.002", "name": "Spearphishing Link"}, {"_id": 22, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Night Dragon](https://attack.mitre.org/groups/G0014) has used HTTP for C2.(Citation: McAfee Night Dragon)", "header": "T1071.001", "name": "Web Protocols"}, {"_id": 23, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, persistence, privilege-escalation, initial-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Night Dragon](https://attack.mitre.org/groups/G0014) has used compromised VPN accounts to gain access to victim systems.(Citation: McAfee Night Dragon)", "header": "T1078", "name": "Valid Accounts"}, {"_id": 24, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Night Dragon](https://attack.mitre.org/groups/G0014) has used ports 25 and 80 for C2 communications.(Citation: McAfee Night Dragon)", "header": "T1043", "name": "Commonly Used Port"}, {"_id": 25, "body": "[PsExec](https://attack.mitre.org/software/S0029) is a free Microsoft tool that can be used to execute a program on another computer. It is used by IT administrators and attackers. (Citation: Russinovich Sysinternals) (Citation: SANS PsExec)", "color": "#ff1a8c", "header": "S0029", "name": "PsExec"}, {"_id": 26, "body": "\u003cb\u003eTactic:\u003c/b\u003e execution\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eMicrosoft Sysinternals [PsExec](https://attack.mitre.org/software/S0029) is a popular administration tool that can be used to execute binaries on remote systems using a temporary Windows service.(Citation: Russinovich Sysinternals)", "header": "T1569.002", "name": "Service Execution"}, {"_id": 27, "body": "\u003cb\u003eTactic:\u003c/b\u003e lateral-movement\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[PsExec](https://attack.mitre.org/software/S0029) can be used to download or upload a file over a network share.(Citation: PsExec Russinovich)", "header": "T1570", "name": "Lateral Tool Transfer"}, {"_id": 28, "body": "[ASPXSpy](https://attack.mitre.org/software/S0073) is a Web shell. It has been modified by [Threat Group-3390](https://attack.mitre.org/groups/G0027) actors to create the ASPXTool version. (Citation: Dell TG-3390)", "color": "#ff3232", "header": "S0073", "name": "ASPXSpy"}, {"_id": 29, "body": "\u003cb\u003eTactic:\u003c/b\u003e persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[ASPXSpy](https://attack.mitre.org/software/S0073) is a Web shell. The ASPXTool version used by [Threat Group-3390](https://attack.mitre.org/groups/G0027) has been deployed to accessible servers running Internet Information Services (IIS).(Citation: Dell TG-3390)", "header": "T1505.003", "name": "Web Shell"}, {"_id": 30, "body": "[at](https://attack.mitre.org/software/S0110) is used to schedule tasks on a system to run at a specified date or time. (Citation: TechNet At)", "color": "#ff1a8c", "header": "S0110", "name": "at"}, {"_id": 31, "body": "\u003cb\u003eTactics:\u003c/b\u003e execution, persistence, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[at](https://attack.mitre.org/software/S0110) can be used to schedule a task on a system.(Citation: TechNet At)", "header": "T1053.002", "name": "At (Windows)"}, {"_id": 32, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eA [Night Dragon](https://attack.mitre.org/groups/G0014) DLL included an XOR-encoded section.(Citation: McAfee Night Dragon)", "header": "T1027", "name": "Obfuscated Files or Information"}, {"_id": 33, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, lateral-movement\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Night Dragon](https://attack.mitre.org/groups/G0014) used pass-the-hash tools to gain usernames and passwords.(Citation: McAfee Night Dragon)", "header": "T1550.002", "name": "Pass the Hash"}, {"_id": 34, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Night Dragon](https://attack.mitre.org/groups/G0014) has used several remote administration tools as persistent infiltration channels.(Citation: McAfee Night Dragon)", "header": "T1219", "name": "Remote Access Software"}, {"_id": 35, "body": "\u003cb\u003eTactic:\u003c/b\u003e execution\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Night Dragon](https://attack.mitre.org/groups/G0014) enticed users to click on links in spearphishing emails to download malware.(Citation: McAfee Night Dragon)", "header": "T1204.001", "name": "Malicious Link"}, {"_id": 36, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, initial-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Night Dragon](https://attack.mitre.org/groups/G0014) has used compromised VPN accounts to gain access to victim systems.(Citation: McAfee Night Dragon)", "header": "T1133", "name": "External Remote Services"}, {"_id": 37, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Night Dragon](https://attack.mitre.org/groups/G0014) is known to use software packing in its tools.(Citation: McAfee Night Dragon)", "header": "T1027.002", "name": "Software Packing"}, {"_id": 38, "body": "\u003cb\u003eTactic:\u003c/b\u003e collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Night Dragon](https://attack.mitre.org/groups/G0014) has copied files to company web servers and subsequently downloaded them.(Citation: McAfee Night Dragon)", "header": "T1074.002", "name": "Remote Data Staging"}, {"_id": 39, "body": "\u003cb\u003eTactic:\u003c/b\u003e resource-development\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Night Dragon](https://attack.mitre.org/groups/G0014) used privately developed and customized remote access tools.(Citation: McAfee Night Dragon)", "header": "T1587.001", "name": "Malware"}, {"_id": 40, "body": "\u003cb\u003eAliases:\u003c/b\u003e APT1, Comment Crew, Comment Group, Comment Panda\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [APT1](https://attack.mitre.org/groups/G0006) is a Chinese threat group that has been attributed to the 2nd Bureau of the People\u2019s Liberation Army (PLA) General Staff Department\u2019s (GSD) 3rd Department, commonly known by its Military Unit Cover Designator (MUCD) as Unit 61398. (Citation: Mandiant APT1)", "color": "#fce903", "group": 5, "header": "G0006", "name": "APT1", "width": 10}, {"_id": 41, "body": "\u003cb\u003eTactic:\u003c/b\u003e establish-\u0026-maintain-infrastructure\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT1](https://attack.mitre.org/groups/G0006) hijacked FQDNs associated with legitimate websites hosted by hop points. Mandiant considers them to be \u201chijacked\u201d since they were originally registered for a legitimate reason but are used by APT1 for malicious purposes.(Citation: Mandiant APT1)", "header": "T1326", "name": "Domain registration hijacking"}, {"_id": 42, "body": "\u003cb\u003eTactic:\u003c/b\u003e build-capabilities\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT1](https://attack.mitre.org/groups/G0006) used publicly available privilege escalation tools.(Citation: Mandiant APT1)", "header": "T1346", "name": "Obtain/re-use payloads"}, {"_id": 43, "body": "\u003cb\u003eTactic:\u003c/b\u003e establish-\u0026-maintain-infrastructure\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT1](https://attack.mitre.org/groups/G0006) used dynamic DNS to register hundreds of FQDNs.(Citation: Mandiant APT1)", "header": "T1333", "name": "Dynamic DNS"}, {"_id": 44, "body": "\u003cb\u003eTactic:\u003c/b\u003e adversary-opsec\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT1](https://attack.mitre.org/groups/G0006) compromised a vast set of 3rd party victim hop points as part of their network infrastructure. For example, [APT1](https://attack.mitre.org/groups/G0006) hijacked FQDNs associated with legitimate websites hosted by hop points. Mandiant considers them to be \u201chijacked\u201d since they were originally registered for a legitimate reason but were used by APT1 for malicious purposes.(Citation: Mandiant APT1)", "header": "T1312", "name": "Compromise 3rd party infrastructure to support delivery"}, {"_id": 45, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT1](https://attack.mitre.org/groups/G0006) has been known to use credential dumping using [Mimikatz](https://attack.mitre.org/software/S0002).(Citation: Mandiant APT1)", "header": "T1003.001", "name": "LSASS Memory"}, {"_id": 46, "body": "[CALENDAR](https://attack.mitre.org/software/S0025) is malware used by [APT1](https://attack.mitre.org/groups/G0006) that mimics legitimate Gmail Calendar traffic. (Citation: Mandiant APT1)", "color": "#ff3232", "header": "S0025", "name": "CALENDAR"}, {"_id": 47, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eThe [CALENDAR](https://attack.mitre.org/software/S0025) malware communicates through the use of events in Google Calendar.(Citation: Mandiant APT1)(Citation: Mandiant APT1 Appendix)", "header": "T1102.002", "name": "Bidirectional Communication"}, {"_id": 48, "body": "\u003cb\u003eTactic:\u003c/b\u003e collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT1](https://attack.mitre.org/groups/G0006) has collected files from a local victim.(Citation: Mandiant APT1)", "header": "T1005", "name": "Data from Local System"}, {"_id": 49, "body": "\u003cb\u003eTactic:\u003c/b\u003e collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT1](https://attack.mitre.org/groups/G0006) has used RAR to compress files before moving them outside of the victim network.(Citation: Mandiant APT1)", "header": "T1560.001", "name": "Archive via Utility"}, {"_id": 50, "body": "[pwdump](https://attack.mitre.org/software/S0006) is a credential dumper. (Citation: Wikipedia pwdump)", "color": "#ff1a8c", "header": "S0006", "name": "pwdump"}, {"_id": 51, "body": "[GLOOXMAIL](https://attack.mitre.org/software/S0026) is malware used by [APT1](https://attack.mitre.org/groups/G0006) that mimics legitimate Jabber/XMPP traffic. (Citation: Mandiant APT1)", "color": "#ff3232", "header": "S0026", "name": "GLOOXMAIL"}, {"_id": 52, "body": "The [Tasklist](https://attack.mitre.org/software/S0057) utility displays a list of applications and services with their Process IDs (PID) for all tasks running on either a local or a remote computer. It is packaged with Windows operating systems and can be executed from the command-line interface. (Citation: Microsoft Tasklist)", "color": "#ff1a8c", "header": "S0057", "name": "Tasklist"}, {"_id": 53, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Tasklist](https://attack.mitre.org/software/S0057) can be used to discover services running on a system.(Citation: Microsoft Tasklist)", "header": "T1007", "name": "System Service Discovery"}, {"_id": 54, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Tasklist](https://attack.mitre.org/software/S0057) can be used to enumerate security software currently running on a system by process name of known products.(Citation: Microsoft Tasklist)", "header": "T1518.001", "name": "Security Software Discovery"}, {"_id": 55, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Tasklist](https://attack.mitre.org/software/S0057) can be used to discover processes running on a system.(Citation: Microsoft Tasklist)", "header": "T1057", "name": "Process Discovery"}, {"_id": 56, "body": "[ipconfig](https://attack.mitre.org/software/S0100) is a Windows utility that can be used to find information about a system\u0027s TCP/IP, DNS, DHCP, and adapter configuration. (Citation: TechNet Ipconfig)", "color": "#ff1a8c", "header": "S0100", "name": "ipconfig"}, {"_id": 57, "body": "[Mimikatz](https://attack.mitre.org/software/S0002) is a credential dumper capable of obtaining plaintext Windows account logins and passwords, along with many other features that make it useful for testing the security of networks. (Citation: Deply Mimikatz) (Citation: Adsecurity Mimikatz Guide)", "color": "#ff1a8c", "header": "S0002", "name": "Mimikatz"}, {"_id": 58, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eThe [Mimikatz](https://attack.mitre.org/software/S0002) credential dumper contains an implementation of an SSP.(Citation: Deply Mimikatz)", "header": "T1547.005", "name": "Security Support Provider"}, {"_id": 59, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Mimikatz](https://attack.mitre.org/software/S0002)\u0027s \u003ccode\u003eMISC::AddSid\u003c/code\u003e module can appended any SID or user/group account to a user\u0027s SID-History. [Mimikatz](https://attack.mitre.org/software/S0002) also utilizes [SID-History Injection](https://attack.mitre.org/techniques/T1134/005) to expand the scope of other components such as generated Kerberos Golden Tickets and DCSync beyond a single domain.(Citation: Adsecurity Mimikatz Guide)(Citation: AdSecurity Kerberos GT Aug 2015)", "header": "T1134.005", "name": "SID-History Injection"}, {"_id": 60, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Mimikatz](https://attack.mitre.org/software/S0002)\u2019s \u003ccode\u003eLSADUMP::DCShadow\u003c/code\u003e module can be used to make AD updates by temporarily setting a computer to be a DC.(Citation: Deply Mimikatz)(Citation: Adsecurity Mimikatz Guide)", "header": "T1207", "name": "Rogue Domain Controller"}, {"_id": 61, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Mimikatz](https://attack.mitre.org/software/S0002)\u0027s \u003ccode\u003eCRYPTO::Extract\u003c/code\u003e module can extract keys by interacting with Windows cryptographic application programming interface (API) functions.(Citation: Adsecurity Mimikatz Guide)", "header": "T1552.004", "name": "Private Keys"}, {"_id": 62, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, lateral-movement\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Mimikatz](https://attack.mitre.org/software/S0002)\u2019s \u003ccode\u003eLSADUMP::DCSync\u003c/code\u003e and \u003ccode\u003eKERBEROS::PTT\u003c/code\u003e modules implement the three steps required to extract the krbtgt account hash and create/use Kerberos tickets.(Citation: Adsecurity Mimikatz Guide)(Citation: AdSecurity Kerberos GT Aug 2015)(Citation: Harmj0y DCSync Sept 2015)(Citation: NCSC Joint Report Public Tools)", "header": "T1550.003", "name": "Pass the Ticket"}, {"_id": 63, "body": "\u003cb\u003eTactic:\u003c/b\u003e persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eThe [Mimikatz](https://attack.mitre.org/software/S0002) credential dumper has been extended to include Skeleton Key domain controller authentication bypass functionality. The \u003ccode\u003eLSADUMP::ChangeNTLM\u003c/code\u003e and \u003ccode\u003eLSADUMP::SetNTLM\u003c/code\u003e modules can also manipulate the password hash of an account without knowing the clear text value.(Citation: Adsecurity Mimikatz Guide)(Citation: Metcalf 2015)", "header": "T1098", "name": "Account Manipulation"}, {"_id": 64, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Mimikatz](https://attack.mitre.org/software/S0002)\u0027s kerberos module can create silver tickets.(Citation: GitHub Mimikatz kerberos Module)", "header": "T1558.002", "name": "Silver Ticket"}, {"_id": 65, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Mimikatz](https://attack.mitre.org/software/S0002)\u0027s kerberos module can create golden tickets.(Citation: GitHub Mimikatz kerberos Module)", "header": "T1558.001", "name": "Golden Ticket"}, {"_id": 66, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Mimikatz](https://attack.mitre.org/software/S0002) performs credential dumping to obtain account and password information useful in gaining access to additional systems and enterprise network resources. It contains functionality to acquire information about credentials in many ways, including from DPAPI.(Citation: Deply Mimikatz)(Citation: GitHub Mimikatz lsadump Module)(Citation: Directory Services Internals DPAPI Backup Keys Oct 2015)(Citation: NCSC Joint Report Public Tools)\t", "header": "T1555.003", "name": "Credentials from Web Browsers"}, {"_id": 67, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Mimikatz](https://attack.mitre.org/software/S0002) performs credential dumping to obtain account and password information useful in gaining access to additional systems and enterprise network resources. It contains functionality to acquire information about credentials in many ways, including from the credential vault and DPAPI.(Citation: Deply Mimikatz)(Citation: GitHub Mimikatz lsadump Module)(Citation: Directory Services Internals DPAPI Backup Keys Oct 2015)(Citation: NCSC Joint Report Public Tools)\t", "header": "T1555", "name": "Credentials from Password Stores"}, {"_id": 68, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Mimikatz](https://attack.mitre.org/software/S0002) performs credential dumping to obtain account and password information useful in gaining access to additional systems and enterprise network resources. It contains functionality to acquire information about credentials in many ways, including from DCSync/NetSync.(Citation: Deply Mimikatz)(Citation: GitHub Mimikatz lsadump Module)(Citation: Directory Services Internals DPAPI Backup Keys Oct 2015)(Citation: NCSC Joint Report Public Tools)", "header": "T1003.006", "name": "DCSync"}, {"_id": 69, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Mimikatz](https://attack.mitre.org/software/S0002) contains functionality to acquire credentials from the Windows Credential Manager.(Citation: Delpy Mimikatz Crendential Manager)", "header": "T1555.004", "name": "Windows Credential Manager"}, {"_id": 70, "body": "[Lslsass](https://attack.mitre.org/software/S0121) is a publicly-available tool that can dump active logon session password hashes from the lsass process. (Citation: Mandiant APT1)", "color": "#ff1a8c", "header": "S0121", "name": "Lslsass"}, {"_id": 71, "body": "\u003cb\u003eTactic:\u003c/b\u003e collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT1](https://attack.mitre.org/groups/G0006) uses two utilities, GETMAIL and MAPIGET, to steal email. GETMAIL extracts emails from archived Outlook .pst files.(Citation: Mandiant APT1)", "header": "T1114.001", "name": "Local Email Collection"}, {"_id": 72, "body": "[BISCUIT](https://attack.mitre.org/software/S0017) is a backdoor that has been used by [APT1](https://attack.mitre.org/groups/G0006) since as early as 2007. (Citation: Mandiant APT1)", "color": "#ff3232", "header": "S0017", "name": "BISCUIT"}, {"_id": 73, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[BISCUIT](https://attack.mitre.org/software/S0017) has a command to download a file from the C2 server.(Citation: Mandiant APT1 Appendix)", "header": "T1105", "name": "Ingress Tool Transfer"}, {"_id": 74, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[BISCUIT](https://attack.mitre.org/software/S0017) malware contains a secondary fallback command and control server that is contacted after the primary command and control server.(Citation: Mandiant APT1)(Citation: Mandiant APT1 Appendix)", "header": "T1008", "name": "Fallback Channels"}, {"_id": 75, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[BISCUIT](https://attack.mitre.org/software/S0017) uses SSL for encrypting C2 communications.(Citation: Mandiant APT1 Appendix)", "header": "T1573.002", "name": "Asymmetric Cryptography"}, {"_id": 76, "body": "\u003cb\u003eTactics:\u003c/b\u003e collection, credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[BISCUIT](https://attack.mitre.org/software/S0017) can capture keystrokes.(Citation: Mandiant APT1 Appendix)", "header": "T1056.001", "name": "Keylogging"}, {"_id": 77, "body": "\u003cb\u003eTactic:\u003c/b\u003e collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[BISCUIT](https://attack.mitre.org/software/S0017) has a command to periodically take screenshots of the system.(Citation: Mandiant APT1 Appendix)", "header": "T1113", "name": "Screen Capture"}, {"_id": 78, "body": "[BISCUIT](https://attack.mitre.org/software/S0017) communicates to the C2 server using a custom protocol.(Citation: Mandiant APT1 Appendix)", "header": "T1094", "name": "Custom Command and Control Protocol"}, {"_id": 79, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eThe file name AcroRD32.exe, a legitimate process name for Adobe\u0027s Acrobat Reader, was used by [APT1](https://attack.mitre.org/groups/G0006) as a name for malware.(Citation: Mandiant APT1)(Citation: Mandiant APT1 Appendix)", "header": "T1036.005", "name": "Match Legitimate Name or Location"}, {"_id": 80, "body": "The [Net](https://attack.mitre.org/software/S0039) utility is a component of the Windows operating system. It is used in command-line operations for control of users, groups, services, and network connections. (Citation: Microsoft Net Utility)\n\n[Net](https://attack.mitre.org/software/S0039) has a great deal of functionality, (Citation: Savill 1999) much of which is useful for an adversary, such as gathering system and network information for Discovery, moving laterally through [SMB/Windows Admin Shares](https://attack.mitre.org/techniques/T1021/002) using \u003ccode\u003enet use\u003c/code\u003e commands, and interacting with services. The net1.exe utility is executed for certain functionality when net.exe is run and can be used directly in commands such as \u003ccode\u003enet1 user\u003c/code\u003e.", "color": "#ff1a8c", "header": "S0039", "name": "Net"}, {"_id": 81, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eThe \u003ccode\u003enet view \\\\remotesystem\u003c/code\u003e and \u003ccode\u003enet share\u003c/code\u003e commands in [Net](https://attack.mitre.org/software/S0039) can be used to find shared drives and directories on remote and local systems respectively.(Citation: Savill 1999)", "header": "T1135", "name": "Network Share Discovery"}, {"_id": 82, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eCommands under \u003ccode\u003enet user\u003c/code\u003e can be used in [Net](https://attack.mitre.org/software/S0039) to gather information about and manipulate user accounts.(Citation: Savill 1999)", "header": "T1087.001", "name": "Local Account"}, {"_id": 83, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eCommands such as \u003ccode\u003enet group\u003c/code\u003e and \u003ccode\u003enet localgroup\u003c/code\u003e can be used in [Net](https://attack.mitre.org/software/S0039) to gather information about and manipulate groups.(Citation: Savill 1999)", "header": "T1069.001", "name": "Local Groups"}, {"_id": 84, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eCommands such as \u003ccode\u003enet view\u003c/code\u003e can be used in [Net](https://attack.mitre.org/software/S0039) to gather information about available remote systems.(Citation: Savill 1999)", "header": "T1018", "name": "Remote System Discovery"}, {"_id": 85, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eCommands such as \u003ccode\u003enet use\u003c/code\u003e and \u003ccode\u003enet session\u003c/code\u003e can be used in [Net](https://attack.mitre.org/software/S0039) to gather information about network connections from a particular host.(Citation: Savill 1999)", "header": "T1049", "name": "System Network Connections Discovery"}, {"_id": 86, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eThe \u003ccode\u003enet accounts\u003c/code\u003e and \u003ccode\u003enet accounts /domain\u003c/code\u003e commands with [Net](https://attack.mitre.org/software/S0039) can be used to obtain password policy information.(Citation: Savill 1999)", "header": "T1201", "name": "Password Policy Discovery"}, {"_id": 87, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eThe \u003ccode\u003enet time\u003c/code\u003e command can be used in [Net](https://attack.mitre.org/software/S0039) to determine the local or remote system time.(Citation: TechNet Net Time)", "header": "T1124", "name": "System Time Discovery"}, {"_id": 88, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eThe \u003ccode\u003enet use \\\\system\\share /delete\u003c/code\u003e command can be used in [Net](https://attack.mitre.org/software/S0039) to remove an established connection to a network share.(Citation: Technet Net Use)", "header": "T1070.005", "name": "Network Share Connection Removal"}, {"_id": 89, "body": "\u003cb\u003eTactic:\u003c/b\u003e persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eThe \u003ccode\u003enet user username \\password \\domain\u003c/code\u003e commands in [Net](https://attack.mitre.org/software/S0039) can be used to create a domain account.(Citation: Savill 1999)", "header": "T1136.002", "name": "Domain Account"}, {"_id": 90, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eCommands such as \u003ccode\u003enet group /domain\u003c/code\u003e can be used in [Net](https://attack.mitre.org/software/S0039) to gather information about and manipulate groups.(Citation: Savill 1999)", "header": "T1069.002", "name": "Domain Groups"}, {"_id": 91, "body": "\u003cb\u003eTactic:\u003c/b\u003e collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT1](https://attack.mitre.org/groups/G0006) used a batch script to perform a series of discovery techniques and saves it to a text file.(Citation: Mandiant APT1)", "header": "T1119", "name": "Automated Collection"}, {"_id": 92, "body": "[Pass-The-Hash Toolkit](https://attack.mitre.org/software/S0122) is a toolkit that allows an adversary to \"pass\" a password hash (without knowing the original password) to log in to systems. (Citation: Mandiant APT1)", "color": "#ff1a8c", "header": "S0122", "name": "Pass-The-Hash Toolkit"}, {"_id": 93, "body": "[Cachedump](https://attack.mitre.org/software/S0119) is a publicly-available tool that program extracts cached password hashes from a system\u2019s registry. (Citation: Mandiant APT1)", "color": "#ff1a8c", "header": "S0119", "name": "Cachedump"}, {"_id": 94, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Cachedump](https://attack.mitre.org/software/S0119) can extract cached password hashes from cache entry information.(Citation: Mandiant APT1)", "header": "T1003.005", "name": "Cached Domain Credentials"}, {"_id": 95, "body": "[WEBC2](https://attack.mitre.org/software/S0109) is a family of backdoor malware used by [APT1](https://attack.mitre.org/groups/G0006) as early as July 2006. [WEBC2](https://attack.mitre.org/software/S0109) backdoors are designed to retrieve a webpage, with commands hidden in HTML comments or special tags, from a predetermined C2 server. (Citation: Mandiant APT1 Appendix)(Citation: Mandiant APT1)", "color": "#ff3232", "header": "S0109", "name": "WEBC2"}, {"_id": 96, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation, defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eVariants of [WEBC2](https://attack.mitre.org/software/S0109) achieve persistence by using DLL search order hijacking, usually by copying the DLL file to \u003ccode\u003e%SYSTEMROOT%\u003c/code\u003e (\u003ccode\u003eC:\\WINDOWS\\ntshrui.dll\u003c/code\u003e).(Citation: Mandiant APT1 Appendix)", "header": "T1574.001", "name": "DLL Search Order Hijacking"}, {"_id": 97, "body": "[xCmd](https://attack.mitre.org/software/S0123) is an open source tool that is similar to [PsExec](https://attack.mitre.org/software/S0029) and allows the user to execute applications on remote systems. (Citation: xCmd)", "color": "#ff1a8c", "header": "S0123", "name": "xCmd"}, {"_id": 98, "body": "[PoisonIvy](https://attack.mitre.org/software/S0012) is a popular remote access tool (RAT) that has been used by many groups. (Citation: FireEye Poison Ivy) (Citation: Symantec Elderwood Sept 2012) (Citation: Symantec Darkmoon Aug 2005)", "color": "#ff3232", "header": "S0012", "name": "PoisonIvy"}, {"_id": 99, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[PoisonIvy](https://attack.mitre.org/software/S0012) can inject a malicious DLL into a process.(Citation: FireEye Poison Ivy)(Citation: Symantec Darkmoon Aug 2005)", "header": "T1055.001", "name": "Dynamic-link Library Injection"}, {"_id": 100, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[PoisonIvy](https://attack.mitre.org/software/S0012) creates run key Registry entries pointing to a malicious executable dropped to disk.(Citation: Symantec Darkmoon Aug 2005)", "header": "T1547.001", "name": "Registry Run Keys / Startup Folder"}, {"_id": 101, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[PoisonIvy](https://attack.mitre.org/software/S0012) starts a rootkit from a malicious file dropped to disk.(Citation: Symantec Darkmoon Aug 2005)", "header": "T1014", "name": "Rootkit"}, {"_id": 102, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[PoisonIvy](https://attack.mitre.org/software/S0012) uses the Camellia cipher to encrypt communications.(Citation: FireEye Poison Ivy)", "header": "T1573.001", "name": "Symmetric Cryptography"}, {"_id": 103, "body": "\u003cb\u003eTactic:\u003c/b\u003e collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[PoisonIvy](https://attack.mitre.org/software/S0012) stages collected data in a text file.(Citation: Symantec Darkmoon Aug 2005)", "header": "T1074.001", "name": "Local Data Staging"}, {"_id": 104, "body": "[PoisonIvy](https://attack.mitre.org/software/S0012) opens a backdoor on TCP ports 6868 and 7777.(Citation: Symantec Darkmoon Aug 2005)", "header": "T1065", "name": "Uncommonly Used Port"}, {"_id": 105, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[PoisonIvy](https://attack.mitre.org/software/S0012) captures window titles.(Citation: Symantec Darkmoon Aug 2005)", "header": "T1010", "name": "Application Window Discovery"}, {"_id": 106, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[PoisonIvy](https://attack.mitre.org/software/S0012) creates a Registry key in the Active Setup pointing to a malicious executable.(Citation: Microsoft PoisonIvy 2017)(Citation: paloalto Tropic Trooper 2016)(Citation: FireEye Regsvr32 Targeting Mongolian Gov)", "header": "T1547.014", "name": "Active Setup"}, {"_id": 107, "body": "[Seasalt](https://attack.mitre.org/software/S0345) is malware that has been linked to [APT1](https://attack.mitre.org/groups/G0006)\u0027s 2010 operations. It shares some code similarities with [OceanSalt](https://attack.mitre.org/software/S0346).(Citation: Mandiant APT1 Appendix)(Citation: McAfee Oceansalt Oct 2018)", "color": "#ff3232", "header": "S0345", "name": "Seasalt"}, {"_id": 108, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Seasalt](https://attack.mitre.org/software/S0345) has masqueraded as a service called \"SaSaut\" with a display name of \"System Authorization Service\" in an apparent attempt to masquerade as a legitimate service.(Citation: Mandiant APT1 Appendix)", "header": "T1036.004", "name": "Masquerade Task or Service"}, {"_id": 109, "body": "\u003cb\u003eTactic:\u003c/b\u003e collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT1](https://attack.mitre.org/groups/G0006) uses two utilities, GETMAIL and MAPIGET, to steal email. MAPIGET steals email still on Exchange servers that has not yet been archived.(Citation: Mandiant APT1)", "header": "T1114.002", "name": "Remote Email Collection"}, {"_id": 110, "body": "\u003cb\u003eTactic:\u003c/b\u003e resource-development\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT1](https://attack.mitre.org/groups/G0006) has registered hundreds of domains for use in operations.(Citation: Mandiant APT1)", "header": "T1583.001", "name": "Domains"}, {"_id": 111, "body": "\u003cb\u003eTactic:\u003c/b\u003e initial-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT1](https://attack.mitre.org/groups/G0006) has sent spearphishing emails containing malicious attachments.(Citation: Mandiant APT1)", "header": "T1566.001", "name": "Spearphishing Attachment"}, {"_id": 112, "body": "\u003cb\u003eTactic:\u003c/b\u003e resource-development\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT1](https://attack.mitre.org/groups/G0006) has created email accounts for later use in social engineering, phishing, and when registering domains.(Citation: Mandiant APT1)", "header": "T1585.002", "name": "Email Accounts"}, {"_id": 113, "body": "\u003cb\u003eAliases:\u003c/b\u003e APT16\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [APT16](https://attack.mitre.org/groups/G0023) is a China-based threat group that has launched spearphishing campaigns targeting Japanese and Taiwanese organizations. (Citation: FireEye EPS Awakens Part 2)", "color": "#fce903", "group": 5, "header": "G0023", "name": "APT16", "width": 10}, {"_id": 114, "body": "\u003cb\u003eTactic:\u003c/b\u003e people-information-gathering\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT16](https://attack.mitre.org/groups/G0023) spearphished journalists, apparently targeting those interested in contact information for DPP members or politicians.(Citation: FireEye EPS Awakens Part 2)", "header": "T1272", "name": "Identify business relationships"}, {"_id": 115, "body": "[ELMER](https://attack.mitre.org/software/S0064) is a non-persistent, proxy-aware HTTP backdoor written in Delphi that has been used by [APT16](https://attack.mitre.org/groups/G0023). (Citation: FireEye EPS Awakens Part 2)", "color": "#ff3232", "header": "S0064", "name": "ELMER"}, {"_id": 116, "body": "\u003cb\u003eTactic:\u003c/b\u003e resource-development\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT16](https://attack.mitre.org/groups/G0023) has compromised otherwise legitimate sites as staging servers for second-stage payloads.(Citation: FireEye EPS Awakens Part 2)", "header": "T1584.004", "name": "Server"}, {"_id": 117, "body": "\u003cb\u003eAliases:\u003c/b\u003e Cleaver, Threat Group 2889, TG-2889\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Cleaver](https://attack.mitre.org/groups/G0003) is a threat group that has been attributed to Iranian actors and is responsible for activity tracked as Operation Cleaver. (Citation: Cylance Cleaver) Strong circumstantial evidence suggests Cleaver is linked to Threat Group 2889 (TG-2889). (Citation: Dell Threat Group 2889)", "color": "#fce903", "group": 5, "header": "G0003", "name": "Cleaver", "width": 10}, {"_id": 118, "body": "\u003cb\u003eTactic:\u003c/b\u003e adversary-opsec\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Cleaver](https://attack.mitre.org/groups/G0003) has used zhCat to encrypt traffic or use inline obfuscation to make detection more difficult. zhCat makes message traffic look benign.(Citation: Cylance Cleaver)", "header": "T1313", "name": "Obfuscation or cryptography"}, {"_id": 119, "body": "\u003cb\u003eTactic:\u003c/b\u003e persona-development\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Cleaver](https://attack.mitre.org/groups/G0003) created fake LinkedIn profiles.(Citation: Dell Threat Group 2889)", "header": "T1341", "name": "Build social network persona"}, {"_id": 120, "body": "\u003cb\u003eTactic:\u003c/b\u003e persona-development\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Cleaver](https://attack.mitre.org/groups/G0003) fake personas included profile photos, details, and network connections.(Citation: Dell Threat Group 2889)", "header": "T1342", "name": "Develop social network persona digital footprint"}, {"_id": 121, "body": "\u003cb\u003eTactic:\u003c/b\u003e build-capabilities\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Cleaver](https://attack.mitre.org/groups/G0003) has created customized tools and payloads for functions including ARP poisoning, encryption, credential dumping, ASP.NET shells, web backdoors, process enumeration, WMI querying, HTTP and SMB communications, network interface sniffing, and keystroke logging.(Citation: Cylance Cleaver)", "header": "T1345", "name": "Create custom payloads"}, {"_id": 122, "body": "[TinyZBot](https://attack.mitre.org/software/S0004) is a bot written in C# that was developed by [Cleaver](https://attack.mitre.org/groups/G0003). (Citation: Cylance Cleaver)", "color": "#ff3232", "header": "S0004", "name": "TinyZBot"}, {"_id": 123, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[TinyZBot](https://attack.mitre.org/software/S0004) can create a shortcut in the Windows startup folder for persistence.(Citation: Cylance Cleaver)", "header": "T1547.009", "name": "Shortcut Modification"}, {"_id": 124, "body": "\u003cb\u003eTactic:\u003c/b\u003e collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[TinyZBot](https://attack.mitre.org/software/S0004) contains functionality to collect information from the clipboard.(Citation: Cylance Cleaver)", "header": "T1115", "name": "Clipboard Data"}, {"_id": 125, "body": "[Net Crawler](https://attack.mitre.org/software/S0056) is an intranet worm capable of extracting credentials using credential dumpers and spreading to systems on a network over SMB by brute forcing accounts with recovered passwords and using [PsExec](https://attack.mitre.org/software/S0029) to execute a copy of [Net Crawler](https://attack.mitre.org/software/S0056). (Citation: Cylance Cleaver)", "color": "#ff3232", "header": "S0056", "name": "Net Crawler"}, {"_id": 126, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Net Crawler](https://attack.mitre.org/software/S0056) uses a list of known credentials gathered through credential dumping to guess passwords to accounts as it spreads throughout a network.(Citation: Cylance Cleaver)", "header": "T1110.002", "name": "Password Cracking"}, {"_id": 127, "body": "\u003cb\u003eTactic:\u003c/b\u003e resource-development\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Cleaver](https://attack.mitre.org/groups/G0003) has created fake LinkedIn profiles that included profile photos, details, and connections.(Citation: Dell Threat Group 2889)", "header": "T1585.001", "name": "Social Media Accounts"}, {"_id": 128, "body": "\u003cb\u003eTactics:\u003c/b\u003e credential-access, collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Cleaver](https://attack.mitre.org/groups/G0003) has used custom tools to facilitate ARP cache poisoning.(Citation: Cylance Cleaver)", "header": "T1557.002", "name": "ARP Cache Poisoning"}, {"_id": 129, "body": "\u003cb\u003eAliases:\u003c/b\u003e APT17, Deputy Dog\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [APT17](https://attack.mitre.org/groups/G0025) is a China-based threat group that has conducted network intrusions against U.S. government entities, the defense industry, law firms, information technology companies, mining companies, and non-government organizations. (Citation: FireEye APT17)", "color": "#fce903", "group": 5, "header": "G0025", "name": "APT17", "width": 10}, {"_id": 130, "body": "\u003cb\u003eTactic:\u003c/b\u003e establish-\u0026-maintain-infrastructure\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT17](https://attack.mitre.org/groups/G0025) obfuscated infrastructure using a multi-layered malware beaconing approach. (Citation: FireEye APT17)", "header": "T1331", "name": "Obfuscate infrastructure"}, {"_id": 131, "body": "[BLACKCOFFEE](https://attack.mitre.org/software/S0069) is malware that has been used by several Chinese groups since at least 2013. (Citation: FireEye APT17) (Citation: FireEye Periscope March 2018)", "color": "#ff3232", "header": "S0069", "name": "BLACKCOFFEE"}, {"_id": 132, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[BLACKCOFFEE](https://attack.mitre.org/software/S0069) uses Microsoft\u2019s TechNet Web portal to obtain a dead drop resolver containing an encoded tag with the IP address of a command and control server.(Citation: FireEye APT17)(Citation: FireEye Periscope March 2018)", "header": "T1102.001", "name": "Dead Drop Resolver"}, {"_id": 133, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[BLACKCOFFEE](https://attack.mitre.org/software/S0069) uses Microsoft\u2019s TechNet Web portal to obtain an encoded tag containing the IP address of a command and control server and then communicates separately with that IP address for C2. If the C2 server is discovered or shut down, the threat actors can update the encoded IP address on TechNet to maintain control of the victims\u2019 machines.(Citation: FireEye APT17)", "header": "T1104", "name": "Multi-Stage Channels"}, {"_id": 134, "body": "\u003cb\u003eTactic:\u003c/b\u003e resource-development\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT17](https://attack.mitre.org/groups/G0025) has created profile pages in Microsoft TechNet that were used as C2 infrastructure.(Citation: FireEye APT17)", "header": "T1583.006", "name": "Web Services"}, {"_id": 135, "body": "\u003cb\u003eTactic:\u003c/b\u003e resource-development\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT17](https://attack.mitre.org/groups/G0025) has created and cultivated profile pages in Microsoft TechNet. To make profile pages appear more legitimate, [APT17](https://attack.mitre.org/groups/G0025) has created biographical sections and posted in forum threads.(Citation: FireEye APT17)", "header": "T1585", "name": "Establish Accounts"}, {"_id": 136, "body": "\u003cb\u003eAliases:\u003c/b\u003e APT28, SNAKEMACKEREL, Swallowtail, Group 74, Sednit, Sofacy, Pawn Storm, Fancy Bear, STRONTIUM, Tsar Team, Threat Group-4127, TG-4127\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [APT28](https://attack.mitre.org/groups/G0007) is a threat group that has been attributed to Russia\u0027s General Staff Main Intelligence Directorate (GRU) 85th Main Special Service Center (GTsSS) military unit 26165.(Citation: NSA/FBI Drovorub August 2020) This group has been active since at least 2004.(Citation: DOJ GRU Indictment Jul 2018) (Citation: Ars Technica GRU indictment Jul 2018) (Citation: Crowdstrike DNC June 2016) (Citation: FireEye APT28) (Citation: SecureWorks TG-4127) (Citation: FireEye APT28 January 2017) (Citation: GRIZZLY STEPPE JAR) (Citation: Sofacy DealersChoice) (Citation: Palo Alto Sofacy 06-2018) (Citation: Symantec APT28 Oct 2018) (Citation: ESET Zebrocy May 2019)\n\n[APT28](https://attack.mitre.org/groups/G0007) reportedly compromised the Hillary Clinton campaign, the Democratic National Committee, and the Democratic Congressional Campaign Committee in 2016 in an attempt to interfere with the U.S. presidential election. (Citation: Crowdstrike DNC June 2016) In 2018, the US indicted five GRU Unit 26165 officers associated with [APT28](https://attack.mitre.org/groups/G0007) for cyber operations (including close-access operations) conducted between 2014 and 2018 against the World Anti-Doping Agency (WADA), the US Anti-Doping Agency, a US nuclear facility, the Organization for the Prohibition of Chemical Weapons (OPCW), the Spiez Swiss Chemicals Laboratory, and other organizations.(Citation: US District Court Indictment GRU Oct 2018) Some of these were conducted with the assistance of GRU Unit 74455, which is also referred to as [Sandworm Team](https://attack.mitre.org/groups/G0034). ", "color": "#fce903", "group": 5, "header": "G0007", "name": "APT28", "width": 10}, {"_id": 137, "body": "\u003cb\u003eTactic:\u003c/b\u003e establish-\u0026-maintain-infrastructure\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) registered domains imitating NATO, OSCE security websites, Caucasus information resources and other organizations.(Citation: FireEye APT28) (Citation: US District Court Indictment GRU Oct 2018)", "header": "T1328", "name": "Buy domain name"}, {"_id": 138, "body": "[USBStealer](https://attack.mitre.org/software/S0136) is malware that has used by [APT28](https://attack.mitre.org/groups/G0007) since at least 2005 to extract information from air-gapped networks. It does not have the capability to communicate over the Internet and has been used in conjunction with [ADVSTORESHELL](https://attack.mitre.org/software/S0045). (Citation: ESET Sednit USBStealer 2014) (Citation: Kaspersky Sofacy)", "color": "#ff3232", "header": "S0136", "name": "USBStealer"}, {"_id": 139, "body": "\u003cb\u003eTactic:\u003c/b\u003e collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eOnce a removable media device is inserted back into the first victim, [USBStealer](https://attack.mitre.org/software/S0136) collects data from it that was exfiltrated from a second victim.(Citation: ESET Sednit USBStealer 2014)(Citation: Kaspersky Sofacy)", "header": "T1025", "name": "Data from Removable Media"}, {"_id": 140, "body": "\u003cb\u003eTactics:\u003c/b\u003e lateral-movement, initial-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[USBStealer](https://attack.mitre.org/software/S0136) drops itself onto removable media and relies on Autorun to execute the malicious file when a user opens the removable media on another system.(Citation: ESET Sednit USBStealer 2014)", "header": "T1091", "name": "Replication Through Removable Media"}, {"_id": 141, "body": "\u003cb\u003eTactic:\u003c/b\u003e exfiltration\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[USBStealer](https://attack.mitre.org/software/S0136) exfiltrates collected files via removable media from air-gapped victims.(Citation: ESET Sednit USBStealer 2014)", "header": "T1052.001", "name": "Exfiltration over USB"}, {"_id": 142, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[USBStealer](https://attack.mitre.org/software/S0136) monitors victims for insertion of removable drives. When dropped onto a second victim, it also enumerates drives connected to the system.(Citation: ESET Sednit USBStealer 2014)", "header": "T1120", "name": "Peripheral Device Discovery"}, {"_id": 143, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[USBStealer](https://attack.mitre.org/software/S0136) drops commands for a second victim onto a removable media drive inserted into the first victim, and commands are executed when the drive is inserted into the second victim.(Citation: ESET Sednit USBStealer 2014)", "header": "T1092", "name": "Communication Through Removable Media"}, {"_id": 144, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[USBStealer](https://attack.mitre.org/software/S0136) sets the timestamps of its dropper files to the last-access and last-write timestamps of a standard Windows library chosen on the system.(Citation: ESET Sednit USBStealer 2014)", "header": "T1070.006", "name": "Timestomp"}, {"_id": 145, "body": "\u003cb\u003eTactic:\u003c/b\u003e exfiltration\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[USBStealer](https://attack.mitre.org/software/S0136) automatically exfiltrates collected files via removable media when an infected device is connected to the second victim after receiving commands from the first victim.(Citation: ESET Sednit USBStealer 2014)", "header": "T1020", "name": "Automated Exfiltration"}, {"_id": 146, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) added \"junk data\" to each encoded string, preventing trivial decoding without knowledge of the junk removal algorithm. Each implant was given a \"junk length\" value when created, tracked by the controller software to allow seamless communication but prevent analysis of the command protocol on the wire.(Citation: FireEye APT28)", "header": "T1001.001", "name": "Junk Data"}, {"_id": 147, "body": "[HIDEDRV](https://attack.mitre.org/software/S0135) is a rootkit used by [APT28](https://attack.mitre.org/groups/G0007). It has been deployed along with [Downdelph](https://attack.mitre.org/software/S0134) to execute and hide that malware. (Citation: ESET Sednit Part 3) (Citation: Sekoia HideDRV Oct 2016)", "color": "#ff3232", "header": "S0135", "name": "HIDEDRV"}, {"_id": 148, "body": "Responder is an open source tool used for LLMNR, NBT-NS and MDNS poisoning, with built-in HTTP/SMB/MSSQL/FTP/LDAP rogue authentication server supporting NTLMv1/NTLMv2/LMv2, Extended Security NTLMSSP and Basic HTTP authentication. (Citation: GitHub Responder)", "color": "#ff1a8c", "header": "S0174", "name": "Responder"}, {"_id": 149, "body": "\u003cb\u003eTactics:\u003c/b\u003e credential-access, discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Responder](https://attack.mitre.org/software/S0174) captures hashes and credentials that are sent to the system after the name services have been poisoned.(Citation: GitHub Responder)", "header": "T1040", "name": "Network Sniffing"}, {"_id": 150, "body": "\u003cb\u003eTactics:\u003c/b\u003e credential-access, collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Responder](https://attack.mitre.org/software/S0174) is used to poison name services to gather hashes and credentials from systems within a local network.(Citation: GitHub Responder)", "header": "T1557.001", "name": "LLMNR/NBT-NS Poisoning and SMB Relay"}, {"_id": 151, "body": "\u003cb\u003eTactic:\u003c/b\u003e execution\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) has delivered [JHUHUGIT](https://attack.mitre.org/software/S0044) and [Koadic](https://attack.mitre.org/software/S0250) by executing PowerShell commands through DDE in Word documents.(Citation: McAfee APT28 DDE1 Nov 2017)(Citation: McAfee APT28 DDE2 Nov 2017)(Citation: Palo Alto Sofacy 06-2018)", "header": "T1559.002", "name": "Dynamic Data Exchange"}, {"_id": 152, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) has saved files with hidden file attributes.(Citation: Talos Seduploader Oct 2017)(Citation: Talos Seduploader Oct 2017)", "header": "T1564.001", "name": "Hidden Files and Directories"}, {"_id": 153, "body": "[JHUHUGIT](https://attack.mitre.org/software/S0044) is malware used by [APT28](https://attack.mitre.org/groups/G0007). It is based on Carberp source code and serves as reconnaissance malware. (Citation: Kaspersky Sofacy) (Citation: F-Secure Sofacy 2015) (Citation: ESET Sednit Part 1) (Citation: FireEye APT28 January 2017)", "color": "#ff3232", "header": "S0044", "name": "JHUHUGIT"}, {"_id": 154, "body": "\u003cb\u003eTactics:\u003c/b\u003e privilege-escalation, persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[JHUHUGIT](https://attack.mitre.org/software/S0044) has used COM hijacking to establish persistence by hijacking a class named MMDeviceEnumerator and also by registering the payload as a Shell Icon Overlay handler COM object ({3543619C-D563-43f7-95EA-4DA7E1CC396A}).(Citation: ESET Sednit Part 1)(Citation: Talos Seduploader Oct 2017)", "header": "T1546.015", "name": "Component Object Model Hijacking"}, {"_id": 155, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[JHUHUGIT](https://attack.mitre.org/software/S0044) performs code injection injecting its own functions to browser processes.(Citation: F-Secure Sofacy 2015)(Citation: Unit 42 Sofacy Feb 2018)", "header": "T1055", "name": "Process Injection"}, {"_id": 156, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[JHUHUGIT](https://attack.mitre.org/software/S0044) is executed using rundll32.exe.(Citation: F-Secure Sofacy 2015)(Citation: Talos Seduploader Oct 2017)", "header": "T1218.011", "name": "Rundll32"}, {"_id": 157, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[JHUHUGIT](https://attack.mitre.org/software/S0044) has registered a Windows shell script under the Registry key \u003ccode\u003eHKCU\\Environment\\UserInitMprLogonScript\u003c/code\u003e to establish persistence.(Citation: ESET Sednit Part 1)(Citation: Talos Seduploader Oct 2017)", "header": "T1037.001", "name": "Logon Script (Windows)"}, {"_id": 158, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eA [JHUHUGIT](https://attack.mitre.org/software/S0044) variant encodes C2 POST data base64.(Citation: Unit 42 Playbook Dec 2017)", "header": "T1132.001", "name": "Standard Encoding"}, {"_id": 159, "body": "\u003cb\u003eTactic:\u003c/b\u003e privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[JHUHUGIT](https://attack.mitre.org/software/S0044) has exploited CVE-2015-1701 and CVE-2015-2387 to escalate privileges.(Citation: ESET Sednit Part 1)(Citation: ESET Sednit July 2015)", "header": "T1068", "name": "Exploitation for Privilege Escalation"}, {"_id": 160, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) has cleared event logs, including by using the commands \u003ccode\u003ewevtutil cl System\u003c/code\u003e and \u003ccode\u003ewevtutil cl Security\u003c/code\u003e.(Citation: Crowdstrike DNC June 2016)(Citation: DOJ GRU Indictment Jul 2018)", "header": "T1070.001", "name": "Clear Windows Event Logs"}, {"_id": 161, "body": "\u003cb\u003eTactic:\u003c/b\u003e execution\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) attempted to get users to click on Microsoft Office attachments containing malicious macro scripts.(Citation: Unit 42 Sofacy Feb 2018)(Citation: Accenture SNAKEMACKEREL Nov 2018)", "header": "T1204.002", "name": "Malicious File"}, {"_id": 162, "body": "\u003cb\u003eTactic:\u003c/b\u003e collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) has collected information from Microsoft SharePoint services within target networks.(Citation: RSAC 2015 Abu Dhabi Stefano Maccaglia)", "header": "T1213.002", "name": "Sharepoint"}, {"_id": 163, "body": "[DealersChoice](https://attack.mitre.org/software/S0243) is a Flash exploitation framework used by [APT28](https://attack.mitre.org/groups/G0007). (Citation: Sofacy DealersChoice)", "color": "#ff3232", "header": "S0243", "name": "DealersChoice"}, {"_id": 164, "body": "\u003cb\u003eTactic:\u003c/b\u003e execution\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[DealersChoice](https://attack.mitre.org/software/S0243) leverages vulnerable versions of Flash to perform execution.(Citation: Sofacy DealersChoice)", "header": "T1203", "name": "Exploitation for Client Execution"}, {"_id": 165, "body": "[ADVSTORESHELL](https://attack.mitre.org/software/S0045) is a spying backdoor that has been used by [APT28](https://attack.mitre.org/groups/G0007) from at least 2012 to 2016. It is generally used for long-term espionage and is deployed on targets deemed interesting after a reconnaissance phase. (Citation: Kaspersky Sofacy) (Citation: ESET Sednit Part 2)", "color": "#ff3232", "header": "S0045", "name": "ADVSTORESHELL"}, {"_id": 166, "body": "\u003cb\u003eTactic:\u003c/b\u003e execution\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[ADVSTORESHELL](https://attack.mitre.org/software/S0045) is capable of starting a process using CreateProcess.(Citation: Bitdefender APT28 Dec 2015)", "header": "T1106", "name": "Native API"}, {"_id": 167, "body": "\u003cb\u003eTactic:\u003c/b\u003e exfiltration\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[ADVSTORESHELL](https://attack.mitre.org/software/S0045) collects, compresses, encrypts, and exfiltrates data to the C2 server every 10 minutes.(Citation: ESET Sednit Part 2)", "header": "T1029", "name": "Scheduled Transfer"}, {"_id": 168, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[ADVSTORESHELL](https://attack.mitre.org/software/S0045) can enumerate registry keys.(Citation: ESET Sednit Part 2)(Citation: Bitdefender APT28 Dec 2015)", "header": "T1012", "name": "Query Registry"}, {"_id": 169, "body": "\u003cb\u003eTactic:\u003c/b\u003e exfiltration\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[ADVSTORESHELL](https://attack.mitre.org/software/S0045) exfiltrates data over the same channel used for C2.(Citation: ESET Sednit Part 2)", "header": "T1041", "name": "Exfiltration Over C2 Channel"}, {"_id": 170, "body": "\u003cb\u003eTactic:\u003c/b\u003e collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[ADVSTORESHELL](https://attack.mitre.org/software/S0045) compresses output data generated by command execution with a custom implementation of the Lempel\u2013Ziv\u2013Welch (LZW) algorithm.(Citation: ESET Sednit Part 2)", "header": "T1560.003", "name": "Archive via Custom Method"}, {"_id": 171, "body": "\u003cb\u003eTactic:\u003c/b\u003e collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[ADVSTORESHELL](https://attack.mitre.org/software/S0045) encrypts with the 3DES algorithm and a hardcoded key prior to exfiltration.(Citation: ESET Sednit Part 2)", "header": "T1560", "name": "Archive Collected Data"}, {"_id": 172, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) has deployed a bootkit along with [Downdelph](https://attack.mitre.org/software/S0134) to ensure its persistence on the victim. The bootkit shares code with some variants of [BlackEnergy](https://attack.mitre.org/software/S0089).(Citation: ESET Sednit Part 3)", "header": "T1542.003", "name": "Bootkit"}, {"_id": 173, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) has used CVE-2015-4902 to bypass security features.(Citation: Bitdefender APT28 Dec 2015)(Citation: Microsoft SIR Vol 19)", "header": "T1211", "name": "Exploitation for Defense Evasion"}, {"_id": 174, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) has used CVE-2015-1701 to access the SYSTEM token and copy it into the current process as part of privilege escalation.(Citation: FireEye Op RussianDoll)", "header": "T1134.001", "name": "Token Impersonation/Theft"}, {"_id": 175, "body": "[OLDBAIT](https://attack.mitre.org/software/S0138) is a credential harvester used by [APT28](https://attack.mitre.org/groups/G0007). (Citation: FireEye APT28) (Citation: FireEye APT28 January 2017)", "color": "#ff3232", "header": "S0138", "name": "OLDBAIT"}, {"_id": 176, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[OLDBAIT](https://attack.mitre.org/software/S0138) can use SMTP for C2.(Citation: FireEye APT28)", "header": "T1071.003", "name": "Mail Protocols"}, {"_id": 177, "body": "[certutil](https://attack.mitre.org/software/S0160) is a command-line utility that can be used to obtain certificate authority information and configure Certificate Services. (Citation: TechNet Certutil)", "color": "#ff1a8c", "header": "S0160", "name": "certutil"}, {"_id": 178, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[certutil](https://attack.mitre.org/software/S0160) can be used to install browser root certificates as a precursor to performing man-in-the-middle between connections to banking websites. Example command: \u003ccode\u003ecertutil -addstore -f -user ROOT ProgramData\\cert512121.der\u003c/code\u003e.(Citation: Palo Alto Retefe)", "header": "T1553.004", "name": "Install Root Certificate"}, {"_id": 179, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[certutil](https://attack.mitre.org/software/S0160) has been used to decode binaries hidden inside certificate files as Base64 information.(Citation: Malwarebytes Targeted Attack against Saudi Arabia)", "header": "T1140", "name": "Deobfuscate/Decode Files or Information"}, {"_id": 180, "body": "\u003cb\u003eTactic:\u003c/b\u003e initial-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eOnce [APT28](https://attack.mitre.org/groups/G0007) gained access to the DCCC network, the group then proceeded to use that access to compromise the DNC network.(Citation: DOJ GRU Indictment Jul 2018)", "header": "T1199", "name": "Trusted Relationship"}, {"_id": 181, "body": "[XAgentOSX](https://attack.mitre.org/software/S0161) is a trojan that has been used by [APT28](https://attack.mitre.org/groups/G0007)  on OS X and appears to be a port of their standard [CHOPSTICK](https://attack.mitre.org/software/S0023) or XAgent trojan. (Citation: XAgentOSX 2017)", "color": "#ff3232", "header": "S0161", "name": "XAgentOSX"}, {"_id": 182, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[XAgentOSX](https://attack.mitre.org/software/S0161) contains the ftpUpload function to use the FTPManager:uploadFile method to upload files from the target system.(Citation: XAgentOSX 2017)", "header": "T1071.002", "name": "File Transfer Protocols"}, {"_id": 183, "body": "\u003cb\u003eTactic:\u003c/b\u003e execution\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) downloads and executes PowerShell scripts and performs PowerShell commands.(Citation: Palo Alto Sofacy 06-2018)(Citation: TrendMicro Pawn Storm Dec 2020)", "header": "T1059.001", "name": "PowerShell"}, {"_id": 184, "body": "[XTunnel](https://attack.mitre.org/software/S0117) a VPN-like network proxy tool that can relay traffic between a C2 server and a victim. It was first seen in May 2013 and reportedly used by [APT28](https://attack.mitre.org/groups/G0007) during the compromise of the Democratic National Committee. (Citation: Crowdstrike DNC June 2016) (Citation: Invincea XTunnel) (Citation: ESET Sednit Part 2)", "color": "#ff3232", "header": "S0117", "name": "XTunnel"}, {"_id": 185, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eA version of [XTunnel](https://attack.mitre.org/software/S0117) introduced in July 2015 inserted junk code into the binary in a likely attempt to obfuscate it and bypass security products.(Citation: ESET Sednit Part 2)", "header": "T1027.001", "name": "Binary Padding"}, {"_id": 186, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[XTunnel](https://attack.mitre.org/software/S0117) is capable of accessing locally stored passwords on victims.(Citation: Invincea XTunnel)", "header": "T1552.001", "name": "Credentials In Files"}, {"_id": 187, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[XTunnel](https://attack.mitre.org/software/S0117) is capable of probing the network for open ports.(Citation: Invincea XTunnel)", "header": "T1046", "name": "Network Service Scanning"}, {"_id": 188, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[XTunnel](https://attack.mitre.org/software/S0117) relays traffic between a C2 server and a victim.(Citation: Crowdstrike DNC June 2016)", "header": "T1090", "name": "Proxy"}, {"_id": 189, "body": "[Winexe](https://attack.mitre.org/software/S0191) is a lightweight, open source tool similar to [PsExec](https://attack.mitre.org/software/S0029) designed to allow system administrators to execute commands on remote servers. (Citation: Winexe Github Sept 2013) [Winexe](https://attack.mitre.org/software/S0191) is unique in that it is a GNU/Linux based client. (Citation: \u00dcberwachung APT28 Forfiles June 2015)", "color": "#ff1a8c", "header": "S0191", "name": "Winexe"}, {"_id": 190, "body": "[Koadic](https://attack.mitre.org/software/S0250) is a Windows post-exploitation framework and penetration testing tool. [Koadic](https://attack.mitre.org/software/S0250) is publicly available on GitHub and the tool is executed via the command-line. [Koadic](https://attack.mitre.org/software/S0250) has several options for staging payloads and creating implants. [Koadic](https://attack.mitre.org/software/S0250) performs most of its operations using Windows Script Host. (Citation: Github Koadic) (Citation: Palo Alto Sofacy 06-2018)", "color": "#ff1a8c", "header": "S0250", "name": "Koadic"}, {"_id": 191, "body": "\u003cb\u003eTactic:\u003c/b\u003e execution\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Koadic](https://attack.mitre.org/software/S0250) can use WMI to execute commands.(Citation: Github Koadic)", "header": "T1047", "name": "Windows Management Instrumentation"}, {"_id": 192, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Koadic](https://attack.mitre.org/software/S0250) can use MSHTA to serve additional payloads.(Citation: Github Koadic)", "header": "T1218.005", "name": "Mshta"}, {"_id": 193, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Koadic](https://attack.mitre.org/software/S0250) can use Regsvr32 to execute additional payloads.(Citation: Github Koadic)", "header": "T1218.010", "name": "Regsvr32"}, {"_id": 194, "body": "\u003cb\u003eTactics:\u003c/b\u003e privilege-escalation, defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Koadic](https://attack.mitre.org/software/S0250) has 2 methods for elevating integrity. It can bypass UAC through eventvwr.exe and sdclt.exe.(Citation: Github Koadic)", "header": "T1548.002", "name": "Bypass User Account Control"}, {"_id": 195, "body": "\u003cb\u003eTactic:\u003c/b\u003e execution\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Koadic](https://attack.mitre.org/software/S0250) performs most of its operations using Windows Script Host (VBScript) and runs arbitrary shellcode .(Citation: Github Koadic)", "header": "T1059.005", "name": "Visual Basic"}, {"_id": 196, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Koadic](https://attack.mitre.org/software/S0250) can gather hashed passwords by gathering domain controller hashes from NTDS.(Citation: Github Koadic)", "header": "T1003.003", "name": "NTDS"}, {"_id": 197, "body": "[Zebrocy](https://attack.mitre.org/software/S0251) is a Trojan that has been used by [APT28](https://attack.mitre.org/groups/G
