0007) since at least November 2015. The malware comes in several programming language variants, including C++, Delphi, AutoIt, C#, VB.NET, and Golang. (Citation: Palo Alto Sofacy 06-2018)(Citation: Unit42 Cannon Nov 2018)(Citation: Unit42 Sofacy Dec 2018)(Citation: CISA Zebrocy Oct 2020) ", "color": "#ff3232", "header": "S0251", "name": "Zebrocy"}, {"_id": 198, "body": "\u003cb\u003eTactics:\u003c/b\u003e collection, credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Zebrocy](https://attack.mitre.org/software/S0251) installs an application-defined Windows hook to get notified when a network drive has been attached, so it can then use the hook to call its RecordToFile file stealing method.(Citation: Securelist Sofacy Feb 2018)", "header": "T1056.004", "name": "Credential API Hooking"}, {"_id": 199, "body": "[Forfiles](https://attack.mitre.org/software/S0193) is a Windows utility commonly used in batch jobs to execute commands on one or more selected files or directories (ex: list all directories in a drive, read the first line of all files created yesterday, etc.). Forfiles can be executed from either the command line, Run window, or batch files/scripts. (Citation: Microsoft Forfiles Aug 2016)", "color": "#ff1a8c", "header": "S0193", "name": "Forfiles"}, {"_id": 200, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Forfiles](https://attack.mitre.org/software/S0193) can be used to subvert controls and possibly conceal command execution by not directly invoking [cmd](https://attack.mitre.org/software/S0106).(Citation: VectorSec ForFiles Aug 2017)(Citation: Evi1cg Forfiles Nov 2017)", "header": "T1202", "name": "Indirect Command Execution"}, {"_id": 201, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) used other victims as proxies to relay command traffic, for instance using a compromised Georgian military email server as a hop point to NATO victims. The group has also used a tool that acts as a proxy to allow C2 even if the victim is behind a router. [APT28](https://attack.mitre.org/groups/G0007) has also used a machine to relay and obscure communications between [CHOPSTICK](https://attack.mitre.org/software/S0023) and their server.(Citation: FireEye APT28)(Citation: Bitdefender APT28 Dec 2015)(Citation: DOJ GRU Indictment Jul 2018)", "header": "T1090.002", "name": "External Proxy"}, {"_id": 202, "body": "[CORESHELL](https://attack.mitre.org/software/S0137) is a downloader used by [APT28](https://attack.mitre.org/groups/G0007). The older versions of this malware are known as SOURFACE and newer versions as CORESHELL.(Citation: FireEye APT28) (Citation: FireEye APT28 January 2017)", "color": "#ff3232", "header": "S0137", "name": "CORESHELL"}, {"_id": 203, "body": "[Cannon](https://attack.mitre.org/software/S0351) is a Trojan with variants written in C# and Delphi. It was first observed in April 2018. (Citation: Unit42 Cannon Nov 2018)(Citation: Unit42 Sofacy Dec 2018)", "color": "#ff3232", "header": "S0351", "name": "Cannon"}, {"_id": 204, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Cannon](https://attack.mitre.org/software/S0351) adds the Registry key \u003ccode\u003eHKCU\\Software\\Microsoft\\Windows NT\\CurrentVersion\\Winlogon\u003c/code\u003e to establish persistence.(Citation: Unit42 Cannon Nov 2018)", "header": "T1547.004", "name": "Winlogon Helper DLL"}, {"_id": 205, "body": "[CHOPSTICK](https://attack.mitre.org/software/S0023) is a malware family of modular backdoors used by [APT28](https://attack.mitre.org/groups/G0007). It has been used since at least 2012 and is usually dropped on victims as second-stage malware, though it has been used as first-stage malware in several cases. It has both Windows and Linux variants. (Citation: FireEye APT28) (Citation: ESET Sednit Part 2) (Citation: FireEye APT28 January 2017) (Citation: DOJ GRU Indictment Jul 2018) It is tracked separately from the [X-Agent for Android](https://attack.mitre.org/software/S0314).", "color": "#ff3232", "header": "S0023", "name": "CHOPSTICK"}, {"_id": 206, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[CHOPSTICK](https://attack.mitre.org/software/S0023) used a proxy server between victims and the C2 server.(Citation: ESET Sednit Part 2)", "header": "T1090.001", "name": "Internal Proxy"}, {"_id": 207, "body": "\u003cb\u003eTactic:\u003c/b\u003e execution\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[CHOPSTICK](https://attack.mitre.org/software/S0023) is capable of performing remote command execution.(Citation: Crowdstrike DNC June 2016)(Citation: ESET Sednit Part 2)", "header": "T1059", "name": "Command and Scripting Interpreter"}, {"_id": 208, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[CHOPSTICK](https://attack.mitre.org/software/S0023) can use a DGA for [Fallback Channels](https://attack.mitre.org/techniques/T1008), domains are generated by concatenating words from lists.(Citation: ESET Sednit 2017 Activity)", "header": "T1568.002", "name": "Domain Generation Algorithms"}, {"_id": 209, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[CHOPSTICK](https://attack.mitre.org/software/S0023)  includes runtime checks to identify an analysis environment and prevent execution on it.(Citation: FireEye APT28)", "header": "T1497", "name": "Virtualization/Sandbox Evasion"}, {"_id": 210, "body": "[Komplex](https://attack.mitre.org/software/S0162) is a backdoor that has been used by [APT28](https://attack.mitre.org/groups/G0007) on OS X and appears to be developed in a similar manner to [XAgentOSX](https://attack.mitre.org/software/S0161) (Citation: XAgentOSX 2017) (Citation: Sofacy Komplex Trojan).", "color": "#ff3232", "header": "S0162", "name": "Komplex"}, {"_id": 211, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e The [Komplex](https://attack.mitre.org/software/S0162) trojan creates a persistent launch agent called with \u003ccode\u003e$HOME/Library/LaunchAgents/com.apple.updates.plist\u003c/code\u003e with \u003ccode\u003elaunchctl load -w ~/Library/LaunchAgents/com.apple.updates.plist\u003c/code\u003e.(Citation: Sofacy Komplex Trojan)", "header": "T1543.001", "name": "Launch Agent"}, {"_id": 212, "body": "\u003cb\u003eTactic:\u003c/b\u003e lateral-movement\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) exploited a Windows SMB Remote Code Execution Vulnerability to conduct lateral movement.(Citation: FireEye APT28)(Citation: FireEye APT28 Hospitality Aug 2017)(Citation: MS17-010 March 2017)", "header": "T1210", "name": "Exploitation of Remote Services"}, {"_id": 213, "body": "\u003cb\u003eTactic:\u003c/b\u003e persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) has used the Office Test persistence mechanism within Microsoft Office by adding the Registry key \u003ccode\u003eHKCU\\Software\\Microsoft\\Office test\\Special\\Perf\u003c/code\u003e to execute code.(Citation: Palo Alto Office Test Sofacy)", "header": "T1137.002", "name": "Office Test"}, {"_id": 214, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) used weaponized Microsoft Word documents abusing the remote template function to retrieve a malicious macro. (Citation: Unit42 Sofacy Dec 2018)", "header": "T1221", "name": "Template Injection"}, {"_id": 215, "body": "[LoJax](https://attack.mitre.org/software/S0397) is a UEFI rootkit used by [APT28](https://attack.mitre.org/groups/G0007) to persist remote access software on targeted systems.(Citation: ESET LoJax Sept 2018)", "color": "#ff3232", "header": "S0397", "name": "LoJax"}, {"_id": 216, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[LoJax](https://attack.mitre.org/software/S0397) has loaded an embedded NTFS DXE driver to be able to access and write to NTFS partitions.(Citation: ESET LoJax Sept 2018)", "header": "T1564.004", "name": "NTFS File Attributes"}, {"_id": 217, "body": "[LoJax](https://attack.mitre.org/software/S0397) is a UEFI BIOS rootkit deployed to persist remote access software on some targeted systems.(Citation: ESET LoJax Sept 2018)", "header": "T1019", "name": "System Firmware"}, {"_id": 218, "body": "[Downdelph](https://attack.mitre.org/software/S0134) is a first-stage downloader written in Delphi that has been used by [APT28](https://attack.mitre.org/groups/G0007) in rare instances between 2013 and 2015. (Citation: ESET Sednit Part 3)", "color": "#ff3232", "header": "S0134", "name": "Downdelph"}, {"_id": 219, "body": "[Fysbis](https://attack.mitre.org/software/S0410) is a Linux-based backdoor used by [APT28](https://attack.mitre.org/groups/G0007) that dates back to at least 2014.(Citation: Fysbis Palo Alto Analysis)", "color": "#ff3232", "header": "S0410", "name": "Fysbis"}, {"_id": 220, "body": "\u003cb\u003eTactic:\u003c/b\u003e execution\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Fysbis](https://attack.mitre.org/software/S0410) has the ability to create and execute commands in a remote shell for CLI.(Citation: Fysbis Palo Alto Analysis)", "header": "T1059.004", "name": "Unix Shell"}, {"_id": 221, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Fysbis](https://attack.mitre.org/software/S0410) has established persistence using a systemd service.(Citation: Fysbis Dr Web Analysis)", "header": "T1543.002", "name": "Systemd Service"}, {"_id": 222, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Fysbis](https://attack.mitre.org/software/S0410) has installed itself as an autostart entry under \u003ccode\u003e~/.config/autostart/dbus-inotifier.desktop\u003c/code\u003e to establish persistence.(Citation: Fysbis Dr Web Analysis)", "header": "T1547.013", "name": "XDG Autostart Entries"}, {"_id": 223, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, lateral-movement\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) has used several malicious applications that abused OAuth access tokens to gain access to target email accounts, including Gmail and Yahoo Mail.(Citation: Trend Micro Pawn Storm OAuth 2017)", "header": "T1550.001", "name": "Application Access Token"}, {"_id": 224, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) has used several malicious applications to steal user OAuth access tokens including applications masquerading as \"Google Defender\" \"Google Email Protection,\" and \"Google Scanner\" for Gmail users. They also targeted Yahoo users with applications masquerading as \"Delivery Service\" and \"McAfee Email Protection\".(Citation: Trend Micro Pawn Storm OAuth 2017)", "header": "T1528", "name": "Steal Application Access Token"}, {"_id": 225, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) has used the WindowStyle parameter to conceal [PowerShell](https://attack.mitre.org/techniques/T1059/001) windows.(Citation: Palo Alto Sofacy 06-2018) (Citation: McAfee APT28 DDE1 Nov 2017)", "header": "T1564.003", "name": "Hidden Window"}, {"_id": 226, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) regularly deploys both publicly available (ex: [Mimikatz](https://attack.mitre.org/software/S0002)) and custom password retrieval tools on victims.(Citation: ESET Sednit Part 2)(Citation: DOJ GRU Indictment Jul 2018)(Citation: US District Court Indictment GRU Oct 2018)\t", "header": "T1003", "name": "OS Credential Dumping"}, {"_id": 227, "body": "[Drovorub](https://attack.mitre.org/software/S0502) is a Linux malware toolset comprised of an agent, client, server, and kernel modules, that has been used by [APT28](https://attack.mitre.org/groups/G0007).(Citation: NSA/FBI Drovorub August 2020)", "color": "#ff3232", "header": "S0502", "name": "Drovorub"}, {"_id": 228, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Drovorub](https://attack.mitre.org/software/S0502) can use kernel modules to establish persistence.(Citation: NSA/FBI Drovorub August 2020)", "header": "T1547.006", "name": "Kernel Modules and Extensions"}, {"_id": 229, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Drovorub](https://attack.mitre.org/software/S0502) can use TCP to communicate between its agent and client modules.(Citation: NSA/FBI Drovorub August 2020)", "header": "T1095", "name": "Non-Application Layer Protocol"}, {"_id": 230, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) has used a brute-force/password-spray tooling that operated in two modes: in password-spraying mode it conducted approximately four authentication attempts per hour per targeted account over the course of several days or weeks.(Citation: Microsoft STRONTIUM New Patterns Cred Harvesting Sept 2020)(Citation: Microsoft Targeting Elections September 2020)", "header": "T1110.003", "name": "Password Spraying"}, {"_id": 231, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) has used a brute-force/password-spray tooling that operated in two modes: in brute-force mode it typically sent over 300 authentication attempts per hour per targeted account over the course of several hours or days.(Citation: Microsoft STRONTIUM New Patterns Cred Harvesting Sept 2020) ", "header": "T1110.001", "name": "Password Guessing"}, {"_id": 232, "body": "\u003cb\u003eTactic:\u003c/b\u003e impact\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eIn 2016, [APT28](https://attack.mitre.org/groups/G0007) conducted a distributed denial of service (DDoS) attack against the World Anti-Doping Agency.(Citation: US District Court Indictment GRU Oct 2018)", "header": "T1498", "name": "Network Denial of Service"}, {"_id": 233, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) can perform brute force attacks to obtain credentials.(Citation: TrendMicro Pawn Storm 2019)(Citation: TrendMicro Pawn Storm Dec 2020)(Citation: Microsoft Targeting Elections September 2020)", "header": "T1110", "name": "Brute Force"}, {"_id": 234, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) has routed traffic over [Tor](https://attack.mitre.org/software/S0183) and VPN servers to obfuscate their activities.(Citation: TrendMicro Pawn Storm Dec 2020)", "header": "T1090.003", "name": "Multi-hop Proxy"}, {"_id": 235, "body": "\u003cb\u003eTactic:\u003c/b\u003e reconnaissance\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) has performed large-scale scans in an attempt to find vulnerable servers.(Citation: TrendMicro Pawn Storm 2019)", "header": "T1595.002", "name": "Vulnerability Scanning"}, {"_id": 236, "body": "\u003cb\u003eTactic:\u003c/b\u003e exfiltration\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) can exfiltrate data over Google Drive.(Citation: TrendMicro Pawn Storm Dec 2020) ", "header": "T1567", "name": "Exfiltration Over Web Service"}, {"_id": 237, "body": "\u003cb\u003eTactic:\u003c/b\u003e reconnaissance\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) has used spearphishing to compromise credentials.(Citation: Microsoft Targeting Elections September 2020)", "header": "T1598", "name": "Phishing for Information"}, {"_id": 238, "body": "\u003cb\u003eTactic:\u003c/b\u003e reconnaissance\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT28](https://attack.mitre.org/groups/G0007) has harvested user\u0027s login credentials.(Citation: Microsoft Targeting Elections September 2020)", "header": "T1589.001", "name": "Credentials"}, {"_id": 239, "body": "\u003cb\u003eAliases:\u003c/b\u003e TEMP.Veles, XENOTIME\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [TEMP.Veles](https://attack.mitre.org/groups/G0088) is a Russia-based threat group that has targeted critical infrastructure. The group has been observed utilizing TRITON, a malware framework designed to manipulate industrial safety systems.(Citation: FireEye TRITON 2019)(Citation: FireEye TEMP.Veles 2018)(Citation: FireEye TEMP.Veles JSON April 2019)", "color": "#fce903", "group": 5, "header": "G0088", "name": "TEMP.Veles", "width": 10}, {"_id": 240, "body": "\u003cb\u003eTactics:\u003c/b\u003e privilege-escalation, persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[TEMP.Veles](https://attack.mitre.org/groups/G0088) has modified and added entries within \u003ccode\u003eHKEY_LOCAL_MACHINE\\SOFTWARE\\Microsoft\\Windows NT\\CurrentVersion\\Image File Execution Options\u003c/code\u003e to maintain persistence.(Citation: FireEye TRITON 2019)\t\n", "header": "T1546.012", "name": "Image File Execution Options Injection"}, {"_id": 241, "body": "\u003cb\u003eTactic:\u003c/b\u003e lateral-movement\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[TEMP.Veles](https://attack.mitre.org/groups/G0088) has relied on encrypted SSH-based tunnels to transfer tools and for remote command/program execution.(Citation: FireEye TRITON 2019)", "header": "T1021.004", "name": "SSH"}, {"_id": 242, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[TEMP.Veles](https://attack.mitre.org/groups/G0088) has modified files based on the open-source project cryptcat in an apparent attempt to decrease AV detection rates.(Citation: FireEye TEMP.Veles 2018)", "header": "T1027.005", "name": "Indicator Removal from Tools"}, {"_id": 243, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[TEMP.Veles](https://attack.mitre.org/groups/G0088) has used port-protocol mismatches on ports such as 443, 4444, 8531, and 50501 during C2.(Citation: FireEye TRITON 2019)", "header": "T1571", "name": "Non-Standard Port"}, {"_id": 244, "body": "\u003cb\u003eTactic:\u003c/b\u003e resource-development\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[TEMP.Veles](https://attack.mitre.org/groups/G0088) has used Virtual Private Server (VPS) infrastructure.(Citation: FireEye TRITON 2019)", "header": "T1583.003", "name": "Virtual Private Server"}, {"_id": 245, "body": "\u003cb\u003eAliases:\u003c/b\u003e APT3, Gothic Panda, Pirpi, UPS Team, Buckeye, Threat Group-0110, TG-0110\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [APT3](https://attack.mitre.org/groups/G0022) is a China-based threat group that researchers have attributed to China\u0027s Ministry of State Security. (Citation: FireEye Clandestine Wolf) (Citation: Recorded Future APT3 May 2017) This group is responsible for the campaigns known as Operation Clandestine Fox, Operation Clandestine Wolf, and Operation Double Tap. (Citation: FireEye Clandestine Wolf) (Citation: FireEye Operation Double Tap) As of June 2015, the group appears to have shifted from targeting primarily US victims to primarily political organizations in Hong Kong. (Citation: Symantec Buckeye)\n\nMITRE has also developed an APT3 Adversary Emulation Plan.(Citation: APT3 Adversary Emulation Plan)", "color": "#fce903", "group": 5, "header": "G0022", "name": "APT3", "width": 10}, {"_id": 246, "body": "[RemoteCMD](https://attack.mitre.org/software/S0166) is a custom tool used by [APT3](https://attack.mitre.org/groups/G0022) to execute commands on a remote system similar to SysInternal\u0027s PSEXEC functionality. (Citation: Symantec Buckeye)", "color": "#ff3232", "header": "S0166", "name": "RemoteCMD"}, {"_id": 247, "body": "\u003cb\u003eTactics:\u003c/b\u003e privilege-escalation, persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT3](https://attack.mitre.org/groups/G0022) replaces the Sticky Keys binary \u003ccode\u003eC:\\Windows\\System32\\sethc.exe\u003c/code\u003e for persistence.(Citation: aptsim)", "header": "T1546.008", "name": "Accessibility Features"}, {"_id": 248, "body": "[schtasks](https://attack.mitre.org/software/S0111) is used to schedule execution of programs or scripts on a Windows system to run at a specific date and time. (Citation: TechNet Schtasks)", "color": "#ff1a8c", "header": "S0111", "name": "schtasks"}, {"_id": 249, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, persistence, privilege-escalation, initial-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT3](https://attack.mitre.org/groups/G0022) leverages valid accounts after gaining credentials for use within the victim domain.(Citation: Symantec Buckeye)", "header": "T1078.002", "name": "Domain Accounts"}, {"_id": 250, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT3](https://attack.mitre.org/groups/G0022) has a tool that can enumerate the permissions associated with Windows groups.(Citation: Symantec Buckeye)", "header": "T1069", "name": "Permission Groups Discovery"}, {"_id": 251, "body": "[PlugX](https://attack.mitre.org/software/S0013) is a remote access tool (RAT) that uses modular plugins. It has been used by multiple threat groups. (Citation: Lastline PlugX Analysis) (Citation: FireEye Clandestine Fox Part 2) (Citation: New DragonOK) (Citation: Dell TG-3390)", "color": "#ff3232", "header": "S0013", "name": "PlugX"}, {"_id": 252, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation, defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[PlugX](https://attack.mitre.org/software/S0013) has used DLL side-loading to evade anti-virus.(Citation: FireEye Clandestine Fox Part 2)(Citation: Dell TG-3390)(Citation: Stewart 2014)(Citation: PWC Cloud Hopper Technical Annex April 2017)(Citation: Palo Alto PlugX June 2017)", "header": "T1574.002", "name": "DLL Side-Loading"}, {"_id": 253, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[PlugX](https://attack.mitre.org/software/S0013) can be configured to use multiple network protocols to avoid network-based detection.(Citation: Dell TG-3390)", "header": "T1026", "name": "Multiband Communication"}, {"_id": 254, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[PlugX](https://attack.mitre.org/software/S0013) checks if VMware tools is running in the background by searching for any process named \"vmtoolsd\". (Citation: Unit42 PlugX June 2017)", "header": "T1497.001", "name": "System Checks"}, {"_id": 255, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[PlugX](https://attack.mitre.org/software/S0013) can be configured to use DNS for command and control.(Citation: Dell TG-3390)", "header": "T1071.004", "name": "DNS"}, {"_id": 256, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eA version of [PlugX](https://attack.mitre.org/software/S0013) loads as shellcode within a .NET Framework project using msbuild.exe, presumably to bypass application control techniques.(Citation: Palo Alto PlugX June 2017)", "header": "T1127.001", "name": "MSBuild"}, {"_id": 257, "body": "[OSInfo](https://attack.mitre.org/software/S0165) is a custom tool used by [APT3](https://attack.mitre.org/groups/G0022) to do internal discovery on a victim\u0027s computer and network. (Citation: Symantec Buckeye)", "color": "#ff3232", "header": "S0165", "name": "OSInfo"}, {"_id": 258, "body": "[SHOTPUT](https://attack.mitre.org/software/S0063) is a custom backdoor used by [APT3](https://attack.mitre.org/groups/G0022). (Citation: FireEye Clandestine Wolf)", "color": "#ff3232", "header": "S0063", "name": "SHOTPUT"}, {"_id": 259, "body": "[LaZagne](https://attack.mitre.org/software/S0349) is a post-exploitation, open-source tool used to recover stored passwords on a system. It has modules for Windows, Linux, and OSX, but is mainly focused on Windows systems. [LaZagne](https://attack.mitre.org/software/S0349) is publicly available on GitHub.(Citation: GitHub LaZagne Dec 2018)", "color": "#ff1a8c", "header": "S0349", "name": "LaZagne"}, {"_id": 260, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[LaZagne](https://attack.mitre.org/software/S0349) can obtain credentials from macOS Keychains.(Citation: GitHub LaZagne Dec 2018)\t", "header": "T1555.001", "name": "Keychain"}, {"_id": 261, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[LaZagne](https://attack.mitre.org/software/S0349) can obtain credential information running Linux processes.(Citation: GitHub LaZagne Dec 2018)", "header": "T1003.007", "name": "Proc Filesystem"}, {"_id": 262, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[LaZagne](https://attack.mitre.org/software/S0349) can obtain credential information from /etc/shadow using the shadow.py module.(Citation: GitHub LaZagne Dec 2018)", "header": "T1003.008", "name": "/etc/passwd and /etc/shadow"}, {"_id": 263, "body": "\u003cb\u003eAliases:\u003c/b\u003e APT37, ScarCruft, Reaper, Group123, TEMP.Reaper\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [APT37](https://attack.mitre.org/groups/G0067) is a suspected North Korean cyber espionage group that has been active since at least 2012. The group has targeted victims primarily in South Korea, but also in Japan, Vietnam, Russia, Nepal, China, India, Romania, Kuwait, and other parts of the Middle East. [APT37](https://attack.mitre.org/groups/G0067) has also been linked to following campaigns between 2016-2018: Operation Daybreak, Operation Erebus, Golden Time, Evil New Year, Are you Happy?, FreeMilk, Northern Korean Human Rights, and Evil New Year 2018. (Citation: FireEye APT37 Feb 2018) (Citation: Securelist ScarCruft Jun 2016) (Citation: Talos Group123)\n\nNorth Korean group definitions are known to have significant overlap, and the name [Lazarus Group](https://attack.mitre.org/groups/G0032) is known to encompass a broad range of activity. Some organizations use the name Lazarus Group to refer to any activity attributed to North Korea.(Citation: US-CERT HIDDEN COBRA June 2017) Some organizations track North Korean clusters or groups such as Bluenoroff,(Citation: Kaspersky Lazarus Under The Hood Blog 2017) [APT37](https://attack.mitre.org/groups/G0067), and [APT38](https://attack.mitre.org/groups/G0082) separately, while other organizations may track some activity associated with those group names by the name Lazarus Group.", "color": "#fce903", "group": 5, "header": "G0067", "name": "APT37", "width": 10}, {"_id": 264, "body": "[ROKRAT](https://attack.mitre.org/software/S0240) is a cloud-based remote access tool (RAT) used by [APT37](https://attack.mitre.org/groups/G0067). This software has been used to target victims in South Korea. [APT37](https://attack.mitre.org/groups/G0067) used ROKRAT during several campaigns in 2016 through 2018. (Citation: Talos ROKRAT) (Citation: Talos Group123)", "color": "#ff3232", "header": "S0240", "name": "ROKRAT"}, {"_id": 265, "body": "\u003cb\u003eTactic:\u003c/b\u003e collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[ROKRAT](https://attack.mitre.org/software/S0240) has a audio capture and eavesdropping module.(Citation: Securelist ScarCruft May 2019)", "header": "T1123", "name": "Audio Capture"}, {"_id": 266, "body": "[KARAE](https://attack.mitre.org/software/S0215) is a backdoor typically used by [APT37](https://attack.mitre.org/groups/G0067) as first-stage malware. (Citation: FireEye APT37 Feb 2018)", "color": "#ff3232", "header": "S0215", "name": "KARAE"}, {"_id": 267, "body": "\u003cb\u003eTactic:\u003c/b\u003e initial-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[KARAE](https://attack.mitre.org/software/S0215) was distributed through torrent file-sharing websites to South Korean victims, using a YouTube video downloader application as a lure.(Citation: FireEye APT37 Feb 2018)", "header": "T1189", "name": "Drive-by Compromise"}, {"_id": 268, "body": "[POORAIM](https://attack.mitre.org/software/S0216) is a backdoor used by [APT37](https://attack.mitre.org/groups/G0067) in campaigns since at least 2014. (Citation: FireEye APT37 Feb 2018)", "color": "#ff3232", "header": "S0216", "name": "POORAIM"}, {"_id": 269, "body": "[NavRAT](https://attack.mitre.org/software/S0247) is a remote access tool designed to upload, download, and execute files. It has been observed in attacks targeting South Korea. (Citation: Talos NavRAT May 2018)", "color": "#ff3232", "header": "S0247", "name": "NavRAT"}, {"_id": 270, "body": "[CORALDECK](https://attack.mitre.org/software/S0212) is an exfiltration tool used by [APT37](https://attack.mitre.org/groups/G0067). (Citation: FireEye APT37 Feb 2018)", "color": "#ff3232", "header": "S0212", "name": "CORALDECK"}, {"_id": 271, "body": "\u003cb\u003eTactic:\u003c/b\u003e exfiltration\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[CORALDECK](https://attack.mitre.org/software/S0212) has exfiltrated data in HTTP POST headers.(Citation: FireEye APT37 Feb 2018)", "header": "T1048.003", "name": "Exfiltration Over Unencrypted/Obfuscated Non-C2 Protocol"}, {"_id": 272, "body": "[Final1stspy](https://attack.mitre.org/software/S0355) is a dropper family that has been used to deliver [DOGCALL](https://attack.mitre.org/software/S0213).(Citation: Unit 42 Nokki Oct 2018)", "color": "#ff3232", "header": "S0355", "name": "Final1stspy"}, {"_id": 273, "body": "[SLOWDRIFT](https://attack.mitre.org/software/S0218) is a backdoor used by [APT37](https://attack.mitre.org/groups/G0067) against academic and strategic victims in South Korea. (Citation: FireEye APT37 Feb 2018)", "color": "#ff3232", "header": "S0218", "name": "SLOWDRIFT"}, {"_id": 274, "body": "[WINERACK](https://attack.mitre.org/software/S0219) is a backdoor used by [APT37](https://attack.mitre.org/groups/G0067). (Citation: FireEye APT37 Feb 2018)", "color": "#ff3232", "header": "S0219", "name": "WINERACK"}, {"_id": 275, "body": "\u003cb\u003eTactic:\u003c/b\u003e impact\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT37](https://attack.mitre.org/groups/G0067) has access to destructive malware that is capable of overwriting a machine\u0027s Master Boot Record (MBR).(Citation: FireEye APT37 Feb 2018)(Citation: Talos Group123)", "header": "T1561.002", "name": "Disk Structure Wipe"}, {"_id": 276, "body": "[SHUTTERSPEED](https://attack.mitre.org/software/S0217) is a backdoor used by [APT37](https://attack.mitre.org/groups/G0067). (Citation: FireEye APT37 Feb 2018)", "color": "#ff3232", "header": "S0217", "name": "SHUTTERSPEED"}, {"_id": 277, "body": "[DOGCALL](https://attack.mitre.org/software/S0213) is a backdoor used by [APT37](https://attack.mitre.org/groups/G0067) that has been used to target South Korean government and military organizations in 2017. It is typically dropped using a Hangul Word Processor (HWP) exploit. (Citation: FireEye APT37 Feb 2018)", "color": "#ff3232", "header": "S0213", "name": "DOGCALL"}, {"_id": 278, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT37](https://attack.mitre.org/groups/G0067) has signed its malware with an invalid digital certificates listed as \u201cTencent Technology (Shenzhen) Company Limited.\u201d(Citation: Securelist ScarCruft Jun 2016)", "header": "T1036.001", "name": "Invalid Code Signature"}, {"_id": 279, "body": "[HAPPYWORK](https://attack.mitre.org/software/S0214) is a downloader used by [APT37](https://attack.mitre.org/groups/G0067) to target South Korean government and financial victims in November 2016. (Citation: FireEye APT37 Feb 2018)", "color": "#ff3232", "header": "S0214", "name": "HAPPYWORK"}, {"_id": 280, "body": "\u003cb\u003eTactic:\u003c/b\u003e impact\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT37](https://attack.mitre.org/groups/G0067) has used malware that will issue the command \u003ccode\u003eshutdown /r /t 1\u003c/code\u003e to reboot a system after wiping its MBR.(Citation: Talos Group123)", "header": "T1529", "name": "System Shutdown/Reboot"}, {"_id": 281, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT37](https://attack.mitre.org/groups/G0067) uses steganography to send images to users that are embedded with shellcode.(Citation: Talos Group123)(Citation: Securelist ScarCruft May 2019)", "header": "T1027.003", "name": "Steganography"}, {"_id": 282, "body": "\u003cb\u003eAliases:\u003c/b\u003e FIN7\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [FIN7](https://attack.mitre.org/groups/G0046) is a financially-motivated threat group that has primarily targeted the U.S. retail, restaurant, and hospitality sectors since mid-2015. They often use point-of-sale malware. A portion of [FIN7](https://attack.mitre.org/groups/G0046) was run out of a front company called Combi Security. [FIN7](https://attack.mitre.org/groups/G0046) is sometimes referred to as [Carbanak](https://attack.mitre.org/groups/G0008) Group, but these appear to be two groups using the same [Carbanak](https://attack.mitre.org/software/S0030) malware and are therefore tracked separately. (Citation: FireEye FIN7 March 2017) (Citation: FireEye FIN7 April 2017) (Citation: FireEye CARBANAK June 2017) (Citation: FireEye FIN7 Aug 2018)", "color": "#fce903", "group": 5, "header": "G0046", "name": "FIN7", "width": 10}, {"_id": 283, "body": "\u003cb\u003eTactic:\u003c/b\u003e collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[FIN7](https://attack.mitre.org/groups/G0046) created a custom video recording capability that could be used to monitor operations in the victim\u0027s environment.(Citation: FireEye FIN7 Aug 2018)(Citation: DOJ FIN7 Aug 2018)", "header": "T1125", "name": "Video Capture"}, {"_id": 284, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[FIN7](https://attack.mitre.org/groups/G0046) has signed [Carbanak](https://attack.mitre.org/software/S0030) payloads with legally purchased code signing certificates. [FIN7](https://attack.mitre.org/groups/G0046) has also digitally signed their phishing documents, backdoors and other staging tools to bypass security controls.(Citation: FireEye CARBANAK June 2017)(Citation: FireEye FIN7 Aug 2018)", "header": "T1553.002", "name": "Code Signing"}, {"_id": 285, "body": "\u003cb\u003eTactics:\u003c/b\u003e privilege-escalation, persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[FIN7](https://attack.mitre.org/groups/G0046) has used application shim databases for persistence.(Citation: FireEye FIN7 Shim Databases)", "header": "T1546.011", "name": "Application Shimming"}, {"_id": 286, "body": "[POWERSOURCE](https://attack.mitre.org/software/S0145) is a PowerShell backdoor that is a heavily obfuscated and modified version of the publicly available tool DNS_TXT_Pwnage. It was observed in February 2017 in spearphishing campaigns against personnel involved with United States Securities and Exchange Commission (SEC) filings at various organizations. The malware was delivered when macros were enabled by the victim and a VBS script was dropped. (Citation: FireEye FIN7 March 2017) (Citation: Cisco DNSMessenger March 2017)", "color": "#ff3232", "header": "S0145", "name": "POWERSOURCE"}, {"_id": 287, "body": "[Carbanak](https://attack.mitre.org/software/S0030) is a full-featured, remote backdoor used by a group of the same name ([Carbanak](https://attack.mitre.org/groups/G0008)). It is intended for espionage, data exfiltration, and providing remote access to infected machines. (Citation: Kaspersky Carbanak) (Citation: FireEye CARBANAK June 2017)", "color": "#ff3232", "header": "S0030", "name": "Carbanak"}, {"_id": 288, "body": "\u003cb\u003eTactic:\u003c/b\u003e exfiltration\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Carbanak](https://attack.mitre.org/software/S0030) exfiltrates data in compressed chunks if a message is larger than 4096 bytes .(Citation: FireEye CARBANAK June 2017)", "header": "T1030", "name": "Data Transfer Size Limits"}, {"_id": 289, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Carbanak](https://attack.mitre.org/software/S0030) downloads an executable and injects it directly into a new process.(Citation: FireEye CARBANAK June 2017)", "header": "T1055.002", "name": "Portable Executable Injection"}, {"_id": 290, "body": "[HALFBAKED](https://attack.mitre.org/software/S0151) is a malware family consisting of multiple components intended to establish persistence in victim networks. (Citation: FireEye FIN7 April 2017)", "color": "#ff3232", "header": "S0151", "name": "HALFBAKED"}, {"_id": 291, "body": "[TEXTMATE](https://attack.mitre.org/software/S0146) is a second-stage PowerShell backdoor that is memory-resident. It was observed being used along with [POWERSOURCE](https://attack.mitre.org/software/S0145) in February 2017. (Citation: FireEye FIN7 March 2017)", "color": "#ff3232", "header": "S0146", "name": "TEXTMATE"}, {"_id": 292, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[FIN7](https://attack.mitre.org/groups/G0046) used images embedded into document lures that only activate the payload when a user double clicks to avoid sandboxes.(Citation: FireEye FIN7 April 2017)", "header": "T1497.002", "name": "User Activity Based Checks"}, {"_id": 293, "body": "[SQLRat](https://attack.mitre.org/software/S0390) is malware that executes SQL scripts to avoid leaving traditional host artifacts. [FIN7](https://attack.mitre.org/groups/G0046) has been observed using it.(Citation: Flashpoint FIN 7 March 2019)", "color": "#ff3232", "header": "S0390", "name": "SQLRat"}, {"_id": 294, "body": "[RDFSNIFFER](https://attack.mitre.org/software/S0416) is a module loaded by [BOOSTWRITE](https://attack.mitre.org/software/S0415) which allows an attacker to monitor and tamper with legitimate connections made via an application designed to provide visibility and system management capabilities to remote IT techs.(Citation: FireEye FIN7 Oct 2019)", "color": "#ff3232", "header": "S0416", "name": "RDFSNIFFER"}, {"_id": 295, "body": "[BOOSTWRITE](https://attack.mitre.org/software/S0415) is a loader crafted to be launched via abuse of the DLL search order of applications used by [FIN7](https://attack.mitre.org/groups/G0046).(Citation: FireEye FIN7 Oct 2019)", "color": "#ff3232", "header": "S0415", "name": "BOOSTWRITE"}, {"_id": 296, "body": "\u003cb\u003eTactic:\u003c/b\u003e execution\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[BOOSTWRITE](https://attack.mitre.org/software/S0415) has used the DWriteCreateFactory() function to load additional modules.(Citation: FireEye FIN7 Oct 2019)", "header": "T1129", "name": "Shared Modules"}, {"_id": 297, "body": "[GRIFFON](https://attack.mitre.org/software/S0417) is a JavaScript backdoor used by [FIN7](https://attack.mitre.org/groups/G0046). (Citation: SecureList Griffon May 2019)", "color": "#ff3232", "header": "S0417", "name": "GRIFFON"}, {"_id": 298, "body": "\u003cb\u003eTactic:\u003c/b\u003e execution\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[GRIFFON](https://attack.mitre.org/software/S0417) is written in and executed as [JavaScript](https://attack.mitre.org/techniques/T1059/007).(Citation: SecureList Griffon May 2019)\t", "header": "T1059.007", "name": "JavaScript"}, {"_id": 299, "body": "[Pillowmint](https://attack.mitre.org/software/S0517) is a point-of-sale malware used by [FIN7](https://attack.mitre.org/groups/G0046) designed to capture credit card information.(Citation: Trustwave Pillowmint June 2020)", "color": "#ff3232", "header": "S0517", "name": "Pillowmint"}, {"_id": 300, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Pillowmint](https://attack.mitre.org/software/S0517) has used the NtQueueApcThread syscall to inject code into svchost.exe.(Citation: Trustwave Pillowmint June 2020)", "header": "T1055.004", "name": "Asynchronous Procedure Call"}, {"_id": 301, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Pillowmint](https://attack.mitre.org/software/S0517) can uninstall the malicious service from an infected machine.(Citation: Trustwave Pillowmint June 2020)", "header": "T1070", "name": "Indicator Removal on Host"}, {"_id": 302, "body": "\u003cb\u003eAliases:\u003c/b\u003e OilRig, COBALT GYPSY, IRN2, HELIX KITTEN, APT34\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [OilRig](https://attack.mitre.org/groups/G0049) is a suspected Iranian threat group that has targeted Middle Eastern and international victims since at least 2014. The group has targeted a variety of industries, including financial, government, energy, chemical, and telecommunications, and has largely focused its operations within the Middle East. It appears the group carries out supply chain attacks, leveraging the trust relationship between organizations to attack their primary targets. FireEye assesses that the group works on behalf of the Iranian government based on infrastructure details that contain references to Iran, use of Iranian infrastructure, and targeting that aligns with nation-state interests. (Citation: Palo Alto OilRig April 2017) (Citation: ClearSky OilRig Jan 2017) (Citation: Palo Alto OilRig May 2016) (Citation: Palo Alto OilRig Oct 2016) (Citation: Unit 42 Playbook Dec 2017) (Citation: FireEye APT34 Dec 2017)(Citation: Unit 42 QUADAGENT July 2018) This group was previously tracked under two distinct groups, APT34 and OilRig, but was combined due to additional reporting giving higher confidence about the overlap of the activity.", "color": "#fce903", "group": 5, "header": "G0049", "name": "OilRig", "width": 10}, {"_id": 303, "body": "[RGDoor](https://attack.mitre.org/software/S0258) is a malicious Internet Information Services (IIS) backdoor developed in the C++ language. [RGDoor](https://attack.mitre.org/software/S0258) has been seen deployed on webservers belonging to the Middle East government organizations. [RGDoor](https://attack.mitre.org/software/S0258) provides backdoor access to compromised IIS servers. (Citation: Unit 42 RGDoor Jan 2018)", "color": "#ff3232", "header": "S0258", "name": "RGDoor"}, {"_id": 304, "body": "[netstat](https://attack.mitre.org/software/S0104) is an operating system utility that displays active TCP connections, listening ports, and network statistics. (Citation: TechNet Netstat)", "color": "#ff1a8c", "header": "S0104", "name": "netstat"}, {"_id": 305, "body": "[SEASHARPEE](https://attack.mitre.org/software/S0185) is a Web shell that has been used by [OilRig](https://attack.mitre.org/groups/G0049). (Citation: FireEye APT34 Webinar Dec 2017)", "color": "#ff3232", "header": "S0185", "name": "SEASHARPEE"}, {"_id": 306, "body": "[Reg](https://attack.mitre.org/software/S0075) is a Windows utility used to interact with the Windows Registry. It can be used at the command-line interface to query, add, modify, and remove information. (Citation: Microsoft Reg)\n\nUtilities such as [Reg](https://attack.mitre.org/software/S0075) are known to be used by persistent threats. (Citation: Windows Commands JPCERT)", "color": "#ff1a8c", "header": "S0075", "name": "Reg"}, {"_id": 307, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Reg](https://attack.mitre.org/software/S0075) may be used to find credentials in the Windows Registry.(Citation: Pentestlab Stored Credentials)", "header": "T1552.002", "name": "Credentials in Registry"}, {"_id": 308, "body": "[OopsIE](https://attack.mitre.org/software/S0264) is a Trojan used by [OilRig](https://attack.mitre.org/groups/G0049) to remotely execute commands as well as upload/download files to/from victims. (Citation: Unit 42 OopsIE! Feb 2018)", "color": "#ff3232", "header": "S0264", "name": "OopsIE"}, {"_id": 309, "body": "[POWRUNER](https://attack.mitre.org/software/S0184) is a PowerShell script that sends and receives commands to and from the C2 server. (Citation: FireEye APT34 Dec 2017)", "color": "#ff3232", "header": "S0184", "name": "POWRUNER"}, {"_id": 310, "body": "[Helminth](https://attack.mitre.org/software/S0170) is a backdoor that has at least two variants - one written in VBScript and PowerShell that is delivered via a macros in Excel spreadsheets, and one that is a standalone Windows executable. (Citation: Palo Alto OilRig May 2016)", "color": "#ff3232", "header": "S0170", "name": "Helminth"}, {"_id": 311, "body": "[ISMInjector](https://attack.mitre.org/software/S0189) is a Trojan used to install another [OilRig](https://attack.mitre.org/groups/G0049) backdoor, ISMAgent. (Citation: OilRig New Delivery Oct 2017)", "color": "#ff3232", "header": "S0189", "name": "ISMInjector"}, {"_id": 312, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[ISMInjector](https://attack.mitre.org/software/S0189) hollows out a newly created process RegASM.exe and injects its payload into the hollowed process.(Citation: OilRig New Delivery Oct 2017)", "header": "T1055.012", "name": "Process Hollowing"}, {"_id": 313, "body": "[Systeminfo](https://attack.mitre.org/software/S0096) is a Windows utility that can be used to gather detailed information about a computer. (Citation: TechNet Systeminfo)", "color": "#ff1a8c", "header": "S0096", "name": "Systeminfo"}, {"_id": 314, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[OilRig](https://attack.mitre.org/groups/G0049) has used a CHM payload to load and execute another malicious file once delivered to a victim.(Citation: Palo Alto OilRig May 2016)", "header": "T1218.001", "name": "Compiled HTML File"}, {"_id": 315, "body": "[FTP](https://attack.mitre.org/software/S0095) is a utility commonly available with operating systems to transfer information over the File Transfer Protocol (FTP). Adversaries can use it to transfer other tools onto a system or to exfiltrate data. (Citation: Wikipedia FTP)", "color": "#ff1a8c", "header": "S0095", "name": "FTP"}, {"_id": 316, "body": "[QUADAGENT](https://attack.mitre.org/software/S0269) is a PowerShell backdoor used by [OilRig](https://attack.mitre.org/groups/G0049). (Citation: Unit 42 QUADAGENT July 2018)", "color": "#ff3232", "header": "S0269", "name": "QUADAGENT"}, {"_id": 317, "body": "[BONDUPDATER](https://attack.mitre.org/software/S0360) is a PowerShell backdoor used by [OilRig](https://attack.mitre.org/groups/G0049). It was first observed in November 2017 during targeting of a Middle Eastern government organization, and an updated version was observed in August 2018 being used to target a government organization with spearphishing emails.(Citation: FireEye APT34 Dec 2017)(Citation: Palo Alto OilRig Sep 2018)", "color": "#ff3232", "header": "S0360", "name": "BONDUPDATER"}, {"_id": 318, "body": "\u003cb\u003eTactic:\u003c/b\u003e initial-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[OilRig](https://attack.mitre.org/groups/G0049) has used LinkedIn to send spearphishing links.(Citation: FireEye APT34 July 2019)", "header": "T1566.003", "name": "Spearphishing via Service"}, {"_id": 319, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[OilRig](https://attack.mitre.org/groups/G0049) has used the Plink utility and other tools to create tunnels to C2 servers.(Citation: Unit 42 Playbook Dec 2017)(Citation: FireEye APT34 Webinar Dec 2017)(Citation: FireEye APT34 July 2019)", "header": "T1572", "name": "Protocol Tunneling"}, {"_id": 320, "body": "\u003cb\u003eTactic:\u003c/b\u003e persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[OilRig](https://attack.mitre.org/groups/G0049) has abused the Outlook Home Page feature for persistence. [OilRig](https://attack.mitre.org/groups/G0049) has also used CVE-2017-11774 to roll back the initial patch designed to protect against Home Page abuse.(Citation: FireEye Outlook Dec 2019)", "header": "T1137.004", "name": "Outlook Home Page"}, {"_id": 321, "body": "[RDAT](https://attack.mitre.org/software/S0495) is a backdoor used by the suspected Iranian threat group [OilRig](https://attack.mitre.org/groups/G0049). [RDAT](https://attack.mitre.org/software/S0495) was originally identified in 2017 and targeted companies in the telecommunications sector.(Citation: Unit42 RDAT July 2020)", "color": "#ff3232", "header": "S0495", "name": "RDAT"}, {"_id": 322, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[RDAT](https://attack.mitre.org/software/S0495) has used encoded data within subdomains as AES ciphertext to communicate from the host to the C2.(Citation: Unit42 RDAT July 2020)", "header": "T1001", "name": "Data Obfuscation"}, {"_id": 323, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[RDAT](https://attack.mitre.org/software/S0495) can communicate with the C2 via subdomains that utilize base64 with character substitutions.(Citation: Unit42 RDAT July 2020)\t", "header": "T1132.002", "name": "Non-Standard Encoding"}, {"_id": 324, "body": "\u003cb\u003eAliases:\u003c/b\u003e APT29, Dark Halo, StellarParticle, NOBELIUM, UNC2452, YTTRIUM, The Dukes, Cozy Bear, CozyDuke\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [APT29](https://attack.mitre.org/groups/G0016) is threat group that has been attributed to Russia\u0027s Foreign Intelligence Service (SVR).(Citation: White House Imposing Costs RU Gov April 2021)(Citation: UK Gov Malign RIS Activity April 2021) They have operated since at least 2008, often targeting government networks in Europe and NATO member countries, research institutes, and think tanks. [APT29](https://attack.mitre.org/groups/G0016) reportedly compromised the Democratic National Committee starting in the summer of 2015.(Citation: F-Secure The Dukes)(Citation: GRIZZLY STEPPE JAR)(Citation: Crowdstrike DNC June 2016)(Citation: UK Gov UK Exposes Russia SolarWinds April 2021)\n\nIn April 2021, the US and UK governments attributed the SolarWinds supply chain compromise cyber operation to the SVR; public statements included citations to [APT29](https://attack.mitre.org/groups/G0016), Cozy Bear, and The Dukes.(Citation: NSA Joint Advisory SVR SolarWinds April 2021)(Citation: UK NSCS Russia SolarWinds April 2021) Victims of this campaign included government, consulting, technology, telecom, and other organizations in North America, Europe, Asia, and the Middle East. Industry reporting referred to the actors involved in this campaign as UNC2452, NOBELIUM, StellarParticle, and Dark Halo.(Citation: FireEye SUNBURST Backdoor December 2020)(Citation: MSTIC NOBELIUM Mar 2021)(Citation: CrowdStrike SUNSPOT Implant January 2021)(Citation: Volexity SolarWinds)", "color": "#fce903", "group": 5, "header": "G0016", "name": "APT29", "width": 10}, {"_id": 325, "body": "\u003cb\u003eTactics:\u003c/b\u003e privilege-escalation, persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT29](https://attack.mitre.org/groups/G0016) has used WMI event subscriptions for persistence.(Citation: Mandiant No Easy Breach)(Citation: ESET Dukes October 2019)(Citation: Microsoft 365 Defender Solorigate)(Citation: Microsoft Deep Dive Solorigate January 2021)", "header": "T1546.003", "name": "Windows Management Instrumentation Event Subscription"}, {"_id": 326, "body": "[meek](https://attack.mitre.org/software/S0175) is an open-source Tor plugin that tunnels Tor traffic through HTTPS connections.", "color": "#ff1a8c", "header": "S0175", "name": "meek"}, {"_id": 327, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[meek](https://attack.mitre.org/software/S0175) uses Domain Fronting to disguise the destination of network traffic as another server that is hosted in the same Content Delivery Network (CDN) as the intended destination.", "header": "T1090.004", "name": "Domain Fronting"}, {"_id": 328, "body": "[PinchDuke](https://attack.mitre.org/software/S0048) is malware that was used by [APT29](https://attack.mitre.org/groups/G0016) from 2008 to 2010. (Citation: F-Secure The Dukes)", "color": "#ff3232", "header": "S0048", "name": "PinchDuke"}, {"_id": 329, "body": "[Tor](https://attack.mitre.org/software/S0183) is a software suite and network that provides increased anonymity on the Internet. It creates a multi-hop proxy network and utilizes multilayer encryption to protect both the message and routing information. [Tor](https://attack.mitre.org/software/S0183) utilizes \"Onion Routing,\" in which messages are encrypted with multiple layers of encryption; at each step in the proxy network, the topmost layer is decrypted and the contents forwarded on to the next node until it reaches its destination. (Citation: Dingledine Tor The Second-Generation Onion Router)", "color": "#ff1a8c", "header": "S0183", "name": "Tor"}, {"_id": 330, "body": "[CozyCar](https://attack.mitre.org/software/S0046) is malware that was used by [APT29](https://attack.mitre.org/groups/G0016) from 2010 to 2015. It is a modular malware platform, and its backdoor component can be instructed to download and execute a variety of modules with different functionality. (Citation: F-Secure The Dukes)", "color": "#ff3232", "header": "S0046", "name": "CozyCar"}, {"_id": 331, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eThe [CozyCar](https://attack.mitre.org/software/S0046) dropper has masqueraded a copy of the infected system\u0027s rundll32.exe executable that was moved to the malware\u0027s install directory and renamed according to a predefined configuration file.(Citation: F-Secure CozyDuke)", "header": "T1036.003", "name": "Rename System Utilities"}, {"_id": 332, "body": "[CloudDuke](https://attack.mitre.org/software/S0054) is malware that was used by [APT29](https://attack.mitre.org/groups/G0016) in 2015. (Citation: F-Secure The Dukes) (Citation: Securelist Minidionis July 2015)", "color": "#ff3232", "header": "S0054", "name": "CloudDuke"}, {"_id": 333, "body": "[PowerDuke](https://attack.mitre.org/software/S0139) is a backdoor that was used by [APT29](https://attack.mitre.org/groups/G0016) in 2016. It has primarily been delivered through Microsoft Word or Excel attachments containing malicious macros. (Citation: Volexity PowerDuke November 2016)", "color": "#ff3232", "header": "S0139", "name": "PowerDuke"}, {"_id": 334, "body": "\u003cb\u003eTactic:\u003c/b\u003e impact\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[PowerDuke](https://attack.mitre.org/software/S0139) has a command to write random data across a file and delete it.(Citation: Volexity PowerDuke November 2016)", "header": "T1485", "name": "Data Destruction"}, {"_id": 335, "body": "[SDelete](https://attack.mitre.org/software/S0195) is an application that securely deletes data in a way that makes it unrecoverable. It is part of the Microsoft Sysinternals suite of tools. (Citation: Microsoft SDelete July 2016)", "color": "#ff1a8c", "header": "S0195", "name": "SDelete"}, {"_id": 336, "body": "[GeminiDuke](https://attack.mitre.org/software/S0049) is malware that was used by [APT29](https://attack.mitre.org/groups/G0016) from 2009 to 2012. (Citation: F-Secure The Dukes)", "color": "#ff3232", "header": "S0049", "name": "GeminiDuke"}, {"_id": 337, "body": "[CosmicDuke](https://attack.mitre.org/software/S0050) is malware that was used by [APT29](https://attack.mitre.org/groups/G0016) from 2010 to 2015. (Citation: F-Secure The Dukes)", "color": "#ff3232", "header": "S0050", "name": "CosmicDuke"}, {"_id": 338, "body": "\u003cb\u003eTactic:\u003c/b\u003e collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[CosmicDuke](https://attack.mitre.org/software/S0050) steals user files from network shared drives with file extensions and keywords that match a predefined list.(Citation: F-Secure Cosmicduke)", "header": "T1039", "name": "Data from Network Shared Drive"}, {"_id": 339, "body": "[MiniDuke](https://attack.mitre.org/software/S0051) is malware that was used by [APT29](https://attack.mitre.org/groups/G0016) from 2010 to 2015. The [MiniDuke](https://attack.mitre.org/software/S0051) toolset consists of multiple downloader and backdoor components. The loader has been used with other [MiniDuke](https://attack.mitre.org/software/S0051) components as well as in conjunction with [CosmicDuke](https://attack.mitre.org/software/S0050) and [PinchDuke](https://attack.mitre.org/software/S0048). (Citation: F-Secure The Dukes)", "color": "#ff3232", "header": "S0051", "name": "MiniDuke"}, {"_id": 340, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[MiniDuke](https://attack.mitre.org/software/S0051) can create a process on a compromised host.(Citation: ESET Dukes October 2019)", "header": "T1543", "name": "Create or Modify System Process"}, {"_id": 341, "body": "[HAMMERTOSS](https://attack.mitre.org/software/S0037) is a backdoor that was used by [APT29](https://attack.mitre.org/groups/G0016) in 2015. (Citation: FireEye APT29) (Citation: F-Secure The Dukes)", "color": "#ff3232", "header": "S0037", "name": "HAMMERTOSS"}, {"_id": 342, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eThe \"tDiscoverer\" variant of [HAMMERTOSS](https://attack.mitre.org/software/S0037) establishes a C2 channel by downloading resources from Web services like Twitter and GitHub. [HAMMERTOSS](https://attack.mitre.org/software/S0037) binaries contain an algorithm that generates a different Twitter handle for the malware to check for instructions every day.(Citation: FireEye APT29)", "header": "T1102.003", "name": "One-Way Communication"}, {"_id": 343, "body": "\u003cb\u003eTactic:\u003c/b\u003e exfiltration\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[HAMMERTOSS](https://attack.mitre.org/software/S0037) exfiltrates data by uploading it to accounts created by the actors on Web cloud storage providers for the adversaries to retrieve later.(Citation: FireEye APT29)", "header": "T1567.002", "name": "Exfiltration to Cloud Storage"}, {"_id": 344, "body": "[POSHSPY](https://attack.mitre.org/software/S0150) is a backdoor that has been used by [APT29](https://attack.mitre.org/groups/G0016) since at least 2015. It appears to be used as a secondary backdoor used if the actors lost access to their primary backdoors. (Citation: FireEye POSHSPY April 2017)", "color": "#ff3232", "header": "S0150", "name": "POSHSPY"}, {"_id": 345, "body": "[OnionDuke](https://attack.mitre.org/software/S0052) is malware that was used by [APT29](https://attack.mitre.org/groups/G0016) from 2013 to 2015. (Citation: F-Secure The Dukes)", "color": "#ff3232", "header": "S0052", "name": "OnionDuke"}, {"_id": 346, "body": "\u003cb\u003eTactic:\u003c/b\u003e impact\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[OnionDuke](https://attack.mitre.org/software/S0052) has the capability to use a Denial of Service module.(Citation: ESET Dukes October 2019)", "header": "T1499", "name": "Endpoint Denial of Service"}, {"_id": 347, "body": "[SeaDuke](https://attack.mitre.org/software/S0053) is malware that was used by [APT29](https://attack.mitre.org/groups/G0016) from 2014 to 2015. It was used primarily as a secondary backdoor for victims that were already compromised with [CozyCar](https://attack.mitre.org/software/S0046). (Citation: F-Secure The Dukes)", "color": "#ff3232", "header": "S0053", "name": "SeaDuke"}, {"_id": 348, "body": "\u003cb\u003eTactic:\u003c/b\u003e collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[SeaDuke](https://attack.mitre.org/software/S0053) compressed data with zlib prior to sending it over C2.(Citation: Mandiant No Easy Breach)", "header": "T1560.002", "name": "Archive via Library"}, {"_id": 349, "body": "\u003cb\u003eTactic:\u003c/b\u003e execution\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT29](https://attack.mitre.org/groups/G0016) has developed malware variants written in Python.(Citation: ESET Dukes October 2019)", "header": "T1059.006", "name": "Python"}, {"_id": 350, "body": "[PolyglotDuke](https://attack.mitre.org/software/S0518) is a downloader that has been used by [APT29](https://attack.mitre.org/groups/G0016) since at least 2013. [PolyglotDuke](https://attack.mitre.org/software/S0518) has been used to drop [MiniDuke](https://attack.mitre.org/software/S0051).(Citation: ESET Dukes October 2019)", "color": "#ff3232", "header": "S0518", "name": "PolyglotDuke"}, {"_id": 351, "body": "[RegDuke](https://attack.mitre.org/software/S0511) is a first stage implant written in .NET and used by [APT29](https://attack.mitre.org/groups/G0016) since at least 2017. [RegDuke](https://attack.mitre.org/software/S0511) has been used to control a compromised machine when control of other implants on the machine was lost.(Citation: ESET Dukes October 2019)", "color": "#ff3232", "header": "S0511", "name": "RegDuke"}, {"_id": 352, "body": "[WellMess](https://attack.mitre.org/software/S0514) is lightweight malware family with variants written in .NET and Golang that has been in use since at least 2018 by [APT29](https://attack.mitre.org/groups/G0016).(Citation: CISA WellMess July 2020)(Citation: PWC WellMess July 2020)(Citation: NCSC APT29 July 2020)", "color": "#ff3232", "header": "S0514", "name": "WellMess"}, {"_id": 353, "body": "[WellMail](https://attack.mitre.org/software/S0515) is a lightweight malware written in Golang used by [APT29](https://attack.mitre.org/groups/G0016), similar in design and structure to [WellMess](https://attack.mitre.org/software/S0514).(Citation: CISA WellMail July 2020)(Citation: NCSC APT29 July 2020)", "color": "#ff3232", "header": "S0515", "name": "WellMail"}, {"_id": 354, "body": "[SoreFang](https://attack.mitre.org/software/S0516) is first stage downloader used by [APT29](https://attack.mitre.org/groups/G0016) for exfiltration and to load other malware.(Citation: NCSC APT29 July 2020)(Citation: CISA SoreFang July 2016)", "color": "#ff3232", "header": "S0516", "name": "SoreFang"}, {"_id": 355, "body": "\u003cb\u003eTactic:\u003c/b\u003e resource-development\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT29](https://attack.mitre.org/groups/G0016) has created self-signed digital certificates to enable mutual TLS authentication for malware.(Citation: PWC WellMess July 2020)(Citation: PWC WellMess C2 August 2020)", "header": "T1587.003", "name": "Digital Certificates"}, {"_id": 356, "body": "[Cobalt Strike](https://attack.mitre.org/software/S0154) is a commercial, full-featured, remote access tool that bills itself as \u201cadversary simulation software designed to execute targeted attacks and emulate the post-exploitation actions of advanced threat actors\u201d. Cobalt Strike\u2019s interactive post-exploit capabilities cover the full range of ATT\u0026CK tactics, all executed within a single, integrated system.(Citation: cobaltstrike manual)\n\nIn addition to its own capabilities, [Cobalt Strike](https://attack.mitre.org/software/S0154) leverages the capabilities of other well-known tools such as Metasploit and [Mimikatz](https://attack.mitre.org/software/S0002).(Citation: cobaltstrike manual)", "color": "#ff3232", "header": "S0154", "name": "Cobalt Strike"}, {"_id": 357, "body": "\u003cb\u003eTactic:\u003c/b\u003e lateral-movement\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Cobalt Strike](https://attack.mitre.org/software/S0154) can use \u003ccode\u003eWinRM\u003c/code\u003e to execute a payload on a remote host.(Citation: cobaltstrike manual)", "header": "T1021.006", "name": "Windows Remote Management"}, {"_id": 358, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, persistence, privilege-escalation, initial-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Cobalt Strike](https://attack.mitre.org/software/S0154) can use known credentials to run commands and spawn processes as a local user account.(Citation: cobaltstrike manual)(Citation: CobaltStrike Daddy May 2017)", "header": "T1078.003", "name": "Local Accounts"}, {"_id": 359, "body": "\u003cb\u003eTactic:\u003c/b\u003e collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Cobalt Strike](https://attack.mitre.org/software/S0154) can perform browser pivoting and inject into a user\u0027s browser to inherit cookies, authenticated HTTP sessions, and client SSL certificates.(Citation: cobaltstrike manual)", "header": "T1185", "name": "Man in the Browser"}, {"_id": 360, "body": "\u003cb\u003eTactic:\u003c/b\u003e lateral-movement\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Cobalt Strike](https://attack.mitre.org/software/S0154) can deliver \"beacon\" payloads for lateral movement by leveraging remote COM execution.(Citation: Cobalt Strike DCOM Jan 2017)", "header": "T1021.003", "name": "Distributed Component Object Model"}, {"_id": 361, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Cobalt Strike](https://attack.mitre.org/software/S0154) can conduct peer-to-peer communication over Windows named pipes encapsulated in the SMB protocol. All protocols use their standard assigned ports.(Citation: cobaltstrike manual)(Citation: Talos Cobalt Strike September 2020)", "header": "T1071", "name": "Application Layer Protocol"}, {"_id": 362, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Cobalt Strike](https://attack.mitre.org/software/S0154) can download a hosted \"beacon\" payload using [BITSAdmin](https://attack.mitre.org/software/S0190).(Citation: CobaltStrike Scripted Web Delivery)(Citation: Talos Cobalt Strike September 2020)", "header": "T1197", "name": "BITS Jobs"}, {"_id": 363, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Cobalt Strike](https://attack.mitre.org/software/S0154) can spawn processes with alternate PPIDs.(Citation: CobaltStrike Daddy May 2017)", "header": "T1134.004", "name": "Parent PID Spoofing"}, {"_id": 364, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Cobalt Strike](https://attack.mitre.org/software/S0154) can make tokens from known credentials.(Citation: cobaltstrike manual)", "header": "T1134.003", "name": "Make and Impersonate Token"}, {"_id": 365, "body": "\u003cb\u003eTactic:\u003c/b\u003e persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Cobalt Strike](https://attack.mitre.org/software/S0154) has the ability to use an Excel Workbook to execute additional code by enabling Office to trust macros and execute code without user permission.(Citation: Talos Cobalt Strike September 2020)", "header": "T1137.001", "name": "Office Template Macros"}, {"_id": 366, "body": "[SUNSPOT](https://attack.mitre.org/software/S0562) is an implant that injected the [SUNBURST](https://attack.mitre.org/software/S0559) backdoor into the SolarWinds Orion software update framework. It was used by [APT29](https://attack.mitre.org/groups/G0016) since at least February 2020.(Citation: CrowdStrike SUNSPOT Implant January 2021) ", "color": "#ff3232", "header": "S0562", "name": "SUNSPOT"}, {"_id": 367, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[SUNSPOT](https://attack.mitre.org/software/S0562) only replaces SolarWinds Orion source code if the MD5 checksums of both the original source code file and backdoored replacement source code match hardcoded values.(Citation: CrowdStrike SUNSPOT Implant January 2021) ", "header": "T1480", "name": "Execution Guardrails"}, {"_id": 368, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[SUNSPOT](https://attack.mitre.org/software/S0562) modified its security token to grants itself debugging privileges by adding \u003ccode\u003eSeDebugPrivilege\u003c/code\u003e.(Citation: CrowdStrike SUNSPOT Implant January 2021)", "header": "T1134", "name": "Access Token Manipulation"}, {"_id": 369, "body": "\u003cb\u003eTactic:\u003c/b\u003e impact\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[SUNSPOT](https://attack.mitre.org/software/S0562) created a copy of the SolarWinds Orion software source file with a \u003ccode\u003e.bk\u003c/code\u003e extension to backup the original content, wrote [SUNBURST](https://attack.mitre.org/software/S0559) using the same filename but with a \u003ccode\u003e.tmp\u003c/code\u003e extension, and then moved [SUNBURST](https://attack.mitre.org/software/S0559) using \u003ccode\u003eMoveFileEx\u003c/code\u003e to the original filename with a \u003ccode\u003e.cs\u003c/code\u003e extension so it could be compiled within Orion software.(Citation: CrowdStrike SUNSPOT Implant January 2021)", "header": "T1565.001", "name": "Stored Data Manipulation"}, {"_id": 370, "body": "\u003cb\u003eTactic:\u003c/b\u003e initial-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[SUNSPOT](https://attack.mitre.org/software/S0562) malware was designed and used to insert [SUNBURST](https://attack.mitre.org/software/S0559) into software builds of the SolarWinds Orion IT management product.(Citation: CrowdStrike SUNSPOT Implant January 2021)", "header": "T1195.002", "name": "Compromise Software Supply Chain"}, {"_id": 371, "body": "[Sibot](https://attack.mitre.org/software/S0589) is dual-purpose malware written in VBScript designed to achieve persistence on a compromised system as well as download and execute additional payloads. Microsoft discovered three [Sibot](https://attack.mitre.org/software/S0589) variants in early 2021 during its investigation of [APT29](https://attack.mitre.org/groups/G0016) and the SolarWinds cyber intrusion campaign.(Citation: MSTIC NOBELIUM Mar 2021)", "color": "#ff3232", "header": "S0589", "name": "Sibot"}, {"_id": 372, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Sibot](https://attack.mitre.org/software/S0589) has used a legitimate compromised website to download DLLs to the victim\u0027s machine.(Citation: MSTIC NOBELIUM Mar 2021)", "header": "T1102", "name": "Web Service"}, {"_id": 373, "body": "[TEARDROP](https://attack.mitre.org/software/S0560) is a memory-only dropper that was discovered on some victim machines during investigations related to the 2020 SolarWinds cyber intrusion. It was likely used by [APT29](https://attack.mitre.org/groups/G0016) since at least May 2020.(Citation: FireEye SUNBURST Backdoor December 2020)(Citation: Microsoft Deep Dive Solorigate January 2021)", "color": "#ff3232", "header": "S0560", "name": "TEARDROP"}, {"_id": 374, "body": "[Raindrop](https://attack.mitre.org/software/S0565) is a loader used by [APT29](https://attack.mitre.org/groups/G0016) that was discovered on some victim machines during investigations related to the 2020 SolarWinds cyber intrusion. It was discovered in January 2021 and was likely used since at least May 2020.(Citation: Symantec RAINDROP January 2021)(Citation: Microsoft Deep Dive Solorigate January 2021)", "color": "#ff3232", "header": "S0565", "name": "Raindrop"}, {"_id": 375, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eAfter initial installation, [Raindrop](https://attack.mitre.org/software/S0565) runs a computation to delay execution.(Citation: Symantec RAINDROP January 2021)", "header": "T1497.003", "name": "Time Based Evasion"}, {"_id": 376, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Raindrop](https://attack.mitre.org/software/S0565) was built to include a modified version of 7-Zip source code (including associated export names) and Far Manager source code.(Citation: Symantec RAINDROP January 2021)(Citation: Microsoft Deep Dive Solorigate January 2021)", "header": "T1036", "name": "Masquerading"}, {"_id": 377, "body": "[GoldFinder](https://attack.mitre.org/software/S0597) is a custom HTTP tracer tool written in Go that logs the route a packet takes between a compromised network and a C2 server. It can be used to inform  threat actors of potential points of discovery or logging of their actions, including C2 related to other malware. [GoldFinder](https://attack.mitre.org/software/S0597) was discovered in early 2021 during an investigation into the SolarWinds cyber intrusion by [APT29](https://attack.mitre.org/groups/G0016).(Citation: MSTIC NOBELIUM Mar 2021)", "color": "#ff3232", "header": "S0597", "name": "GoldFinder"}, {"_id": 378, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[GoldFinder](https://attack.mitre.org/software/S0597) performed HTTP GET requests to check internet connectivity and identify HTTP proxy servers and other redirectors that an HTTP request traveled through.(Citation: MSTIC NOBELIUM Mar 2021)", "header": "T1016.001", "name": "Internet Connection Discovery"}, {"_id": 379, "body": "[AdFind](https://attack.mitre.org/software/S0552) is a free command-line query tool that can be used for gathering information from Active Directory.(Citation: Red Canary Hospital Thwarted Ryuk October 2020)(Citation: FireEye FIN6 Apr 2019)(Citation: FireEye Ryuk and Trickbot January 2019)", "color": "#ff1a8c", "header": "S0552", "name": "AdFind"}, {"_id": 380, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[AdFind](https://attack.mitre.org/software/S0552) can gather information about organizational units (OUs) and domain trusts from Active Directory.(Citation: Red Canary Hospital Thwarted Ryuk October 2020)(Citation: FireEye FIN6 Apr 2019)(Citation: FireEye Ryuk and Trickbot January 2019)", "header": "T1482", "name": "Domain Trust Discovery"}, {"_id": 381, "body": "[GoldMax](https://attack.mitre.org/software/S0588) is a second-stage C2 backdoor written in Go that was used by [APT29](https://attack.mitre.org/groups/G0016) and discovered in early 2021 during the investigation into breaches related to the SolarWinds intrusion. [GoldMax](https://attack.mitre.org/software/S0588) uses multiple defense evasion techniques, including avoiding virtualization execution and masking malicious traffic.(Citation: MSTIC NOBELIUM Mar 2021)(Citation: FireEye SUNSHUTTLE Mar 2021)", "color": "#ff3232", "header": "S0588", "name": "GoldMax"}, {"_id": 382, "body": "[SUNBURST](https://attack.mitre.org/software/S0559) is a trojanized DLL designed to fit within the SolarWinds Orion software update framework. It was used by [APT29](https://attack.mitre.org/groups/G0016) since at least February 2020.(Citation: SolarWinds Sunburst Sunspot Update January 2021)(Citation: Microsoft Deep Dive Solorigate January 2021)", "color": "#ff3232", "header": "S0559", "name": "SUNBURST"}, {"_id": 383, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[SUNBURST](https://attack.mitre.org/software/S0559) masqueraded its network traffic as the Orion Improvement Program (OIP) protocol.(Citation: FireEye SUNBURST Backdoor December 2020)", "header": "T1001.003", "name": "Protocol Impersonation"}, {"_id": 384, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[SUNBURST](https://attack.mitre.org/software/S0559) dynamically resolved C2 infrastructure for randomly-generated subdomains within a parent domain.(Citation: FireEye SUNBURST Backdoor December 2020)", "header": "T1568", "name": "Dynamic Resolution"}, {"_id": 385, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT29](https://attack.mitre.org/groups/G0016) used \u003ccode\u003eAUDITPOL\u003c/code\u003e to prevent the collection of audit logs.(Citation: Microsoft Deep Dive Solorigate January 2021)", "header": "T1562.002", "name": "Disable Windows Event Logging"}, {"_id": 386, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003
