e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT29](https://attack.mitre.org/groups/G0016) used \u003ccode\u003enetsh\u003c/code\u003e to configure firewall rules that limited certain UDP outbound packets.(Citation: Microsoft Deep Dive Solorigate January 2021)", "header": "T1562.004", "name": "Disable or Modify System Firewall"}, {"_id": 387, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT29](https://attack.mitre.org/groups/G0016) obtained Ticket Granting Service (TGS) tickets for Active Directory Service Principle Names to crack offline.(Citation: Microsoft Deep Dive Solorigate January 2021)", "header": "T1558.003", "name": "Kerberoasting"}, {"_id": 388, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, lateral-movement\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT29](https://attack.mitre.org/groups/G0016) used a forged \u003ccode\u003eduo-sid\u003c/code\u003e cookie to bypass MFA set on an email account.(Citation: Volexity SolarWinds)", "header": "T1550.004", "name": "Web Session Cookie"}, {"_id": 389, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT29](https://attack.mitre.org/groups/G0016) changed domain federation trust settings using Azure AD administrative permissions to configure the domain to accept authorization tokens signed by their own SAML signing certificate.(Citation: Microsoft 365 Defender Solorigate)", "header": "T1484.002", "name": "Domain Trust Modification"}, {"_id": 390, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, lateral-movement\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT29](https://attack.mitre.org/groups/G0016) used forged SAML tokens that allowed the actors to impersonate users and bypass MFA, enabling [APT29](https://attack.mitre.org/groups/G0016) to access enterprise cloud applications and services.(Citation: Microsoft 365 Defender Solorigate)", "header": "T1550", "name": "Use Alternate Authentication Material"}, {"_id": 391, "body": "\u003cb\u003eTactic:\u003c/b\u003e persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT29](https://attack.mitre.org/groups/G0016) added their own devices as allowed IDs for active sync using \u003ccode\u003eSet-CASMailbox\u003c/code\u003e, allowing it to obtain copies of victim mailboxes. It also added additional permissions (such as Mail.Read and Mail.ReadWrite) to compromised Application or Service Principals.(Citation: Volexity SolarWinds)(Citation: Microsoft - Customer Guidance on Recent Nation-State Cyber Attacks)", "header": "T1098.002", "name": "Exchange Email Delegate Permissions"}, {"_id": 392, "body": "\u003cb\u003eTactic:\u003c/b\u003e exfiltration\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT29](https://attack.mitre.org/groups/G0016) has exfiltrated collected data over a simple HTTPS request to a password-protected archive staged on a victim\u0027s OWA servers.(Citation: Volexity SolarWinds)", "header": "T1048.002", "name": "Exfiltration Over Asymmetric Encrypted Non-C2 Protocol"}, {"_id": 393, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT29](https://attack.mitre.org/groups/G0016) created tokens using compromised SAML signing certificates.(Citation: Microsoft - Customer Guidance on Recent Nation-State Cyber Attacks)", "header": "T1606.002", "name": "SAML Tokens"}, {"_id": 394, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT29](https://attack.mitre.org/groups/G0016) has bypassed MFA set on OWA accounts by generating a cookie value from a previously stolen secret key.(Citation: Volexity SolarWinds)", "header": "T1606.001", "name": "Web Cookies"}, {"_id": 395, "body": "\u003cb\u003eTactic:\u003c/b\u003e persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT29](https://attack.mitre.org/groups/G0016) has added credentials to OAuth Applications and Service Principals.(Citation: Microsoft - Customer Guidance on Recent Nation-State Cyber Attacks) ", "header": "T1098.001", "name": "Additional Cloud Credentials"}, {"_id": 396, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT29](https://attack.mitre.org/groups/G0016) obtained a list of users and their roles from an Exchange server using \u003ccode\u003eGet-ManagementRoleAssignment\u003c/code\u003e.(Citation: Volexity SolarWinds)", "header": "T1087", "name": "Account Discovery"}, {"_id": 397, "body": "\u003cb\u003eAliases:\u003c/b\u003e menuPass, Cicada, POTASSIUM, Stone Panda, APT10, Red Apollo, CVNX, HOGFISH\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [menuPass](https://attack.mitre.org/groups/G0045) is a threat group that has been active since at least 2006. Individual members of [menuPass](https://attack.mitre.org/groups/G0045) are known to have acted in association with the Chinese Ministry of State Security\u0027s (MSS) Tianjin State Security Bureau and worked for the Huaying Haitai Science and Technology Development Company.(Citation: DOJ APT10 Dec 2018)(Citation: District Court of NY APT10 Indictment December 2018)\n\n[menuPass](https://attack.mitre.org/groups/G0045) has targeted healthcare, defense, aerospace, finance, maritime, biotechnology, energy, and government sectors globally, with an emphasis on Japanese organizations. In 2016 and 2017, the group is known to have targeted managed IT service providers (MSPs), manufacturing and mining companies, and a university.(Citation: Palo Alto menuPass Feb 2017)(Citation: Crowdstrike CrowdCast Oct 2013)(Citation: FireEye Poison Ivy)(Citation: PWC Cloud Hopper April 2017)(Citation: FireEye APT10 April 2017)(Citation: DOJ APT10 Dec 2018)(Citation: District Court of NY APT10 Indictment December 2018)", "color": "#fce903", "group": 5, "header": "G0045", "name": "menuPass", "width": 10}, {"_id": 398, "body": "[PowerSploit](https://attack.mitre.org/software/S0194) is an open source, offensive security framework comprised of [PowerShell](https://attack.mitre.org/techniques/T1059/001) modules and scripts that perform a wide range of tasks related to penetration testing such as code execution, persistence, bypassing anti-virus, recon, and exfiltration. (Citation: GitHub PowerSploit May 2012) (Citation: PowerShellMagazine PowerSploit July 2014) (Citation: PowerSploit Documentation)", "color": "#ff1a8c", "header": "S0194", "name": "PowerSploit"}, {"_id": 399, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[PowerSploit](https://attack.mitre.org/software/S0194) contains a collection of Exfiltration modules that can harvest credentials from Group Policy Preferences.(Citation: GitHub PowerSploit May 2012)(Citation: PowerSploit Documentation)", "header": "T1552.006", "name": "Group Policy Preferences"}, {"_id": 400, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[PowerSploit](https://attack.mitre.org/software/S0194) contains a collection of Privesc-PowerUp modules that can discover and exploit various path interception opportunities in services, processes, and variables.(Citation: GitHub PowerSploit May 2012)(Citation: PowerSploit Documentation)", "header": "T1034", "name": "Path Interception"}, {"_id": 401, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation, defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[PowerSploit](https://attack.mitre.org/software/S0194) contains a collection of Privesc-PowerUp modules that can discover and exploit path interception opportunities in the PATH environment variable.(Citation: GitHub PowerSploit May 2012)(Citation: PowerSploit Documentation)", "header": "T1574.007", "name": "Path Interception by PATH Environment Variable"}, {"_id": 402, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation, defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[PowerSploit](https://attack.mitre.org/software/S0194) contains a collection of Privesc-PowerUp modules that can discover and exploit search order hijacking vulnerabilities.(Citation: GitHub PowerSploit May 2012)(Citation: PowerSploit Documentation)", "header": "T1574.008", "name": "Path Interception by Search Order Hijacking"}, {"_id": 403, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation, defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[PowerSploit](https://attack.mitre.org/software/S0194) contains a collection of Privesc-PowerUp modules that can discover and exploit unquoted path vulnerabilities.(Citation: GitHub PowerSploit May 2012)(Citation: PowerSploit Documentation)", "header": "T1574.009", "name": "Path Interception by Unquoted Path"}, {"_id": 404, "body": "[SNUGRIDE](https://attack.mitre.org/software/S0159) is a backdoor that has been used by [menuPass](https://attack.mitre.org/groups/G0045) as first stage malware. (Citation: FireEye APT10 April 2017)", "color": "#ff3232", "header": "S0159", "name": "SNUGRIDE"}, {"_id": 405, "body": "[UPPERCUT](https://attack.mitre.org/software/S0275) is a backdoor that has been used by [menuPass](https://attack.mitre.org/groups/G0045). (Citation: FireEye APT10 Sept 2018)", "color": "#ff3232", "header": "S0275", "name": "UPPERCUT"}, {"_id": 406, "body": "[Ping](https://attack.mitre.org/software/S0097) is an operating system utility commonly used to troubleshoot and verify network connections. (Citation: TechNet Ping)", "color": "#ff1a8c", "header": "S0097", "name": "Ping"}, {"_id": 407, "body": "[cmd](https://attack.mitre.org/software/S0106) is the Windows command-line interpreter that can be used to interact with systems and execute other processes and utilities. (Citation: TechNet Cmd)\n\nCmd.exe contains native functionality to perform many operations to interact with the system, including listing files in a directory (e.g., \u003ccode\u003edir\u003c/code\u003e (Citation: TechNet Dir)), deleting files (e.g., \u003ccode\u003edel\u003c/code\u003e (Citation: TechNet Del)), and copying files (e.g., \u003ccode\u003ecopy\u003c/code\u003e (Citation: TechNet Copy)).", "color": "#ff1a8c", "header": "S0106", "name": "cmd"}, {"_id": 408, "body": "[Impacket](https://attack.mitre.org/software/S0357) is an open source collection of modules written in Python for programmatically constructing and manipulating network protocols. [Impacket](https://attack.mitre.org/software/S0357) contains several tools for remote service execution, Kerberos manipulation, Windows credential dumping, packet sniffing, and relay attacks.(Citation: Impacket Tools)", "color": "#ff1a8c", "header": "S0357", "name": "Impacket"}, {"_id": 409, "body": "[ChChes](https://attack.mitre.org/software/S0144) is a Trojan that appears to be used exclusively by [menuPass](https://attack.mitre.org/groups/G0045). It was used to target Japanese organizations in 2016. Its lack of persistence methods suggests it may be intended as a first-stage tool. (Citation: Palo Alto menuPass Feb 2017) (Citation: JPCERT ChChes Feb 2017) (Citation: PWC Cloud Hopper Technical Annex April 2017)", "color": "#ff3232", "header": "S0144", "name": "ChChes"}, {"_id": 410, "body": "[RedLeaves](https://attack.mitre.org/software/S0153) is a malware family used by [menuPass](https://attack.mitre.org/groups/G0045). The code overlaps with [PlugX](https://attack.mitre.org/software/S0013) and may be based upon the open source tool Trochilus. (Citation: PWC Cloud Hopper Technical Annex April 2017) (Citation: FireEye APT10 April 2017)", "color": "#ff3232", "header": "S0153", "name": "RedLeaves"}, {"_id": 411, "body": "[EvilGrab](https://attack.mitre.org/software/S0152) is a malware family with common reconnaissance capabilities. It has been deployed by [menuPass](https://attack.mitre.org/groups/G0045) via malicious Microsoft Office documents as part of spearphishing campaigns. (Citation: PWC Cloud Hopper Technical Annex April 2017)", "color": "#ff3232", "header": "S0152", "name": "EvilGrab"}, {"_id": 412, "body": "[QuasarRAT](https://attack.mitre.org/software/S0262) is an open-source, remote access tool that is publicly available on GitHub. [QuasarRAT](https://attack.mitre.org/software/S0262) is developed in the C# language. (Citation: GitHub QuasarRAT) (Citation: Volexity Patchwork June 2018)", "color": "#ff1a8c", "header": "S0262", "name": "QuasarRAT"}, {"_id": 413, "body": "[esentutl](https://attack.mitre.org/software/S0404) is a command-line tool that provides database utilities for the Windows Extensible Storage Engine.(Citation: Microsoft Esentutl)", "color": "#ff1a8c", "header": "S0404", "name": "esentutl"}, {"_id": 414, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[menuPass](https://attack.mitre.org/groups/G0045) has used \u003ccode\u003eInstallUtil.exe\u003c/code\u003e to execute malicious software.(Citation: PWC Cloud Hopper Technical Annex April 2017)", "header": "T1218.004", "name": "InstallUtil"}, {"_id": 415, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[menuPass](https://attack.mitre.org/groups/G0045) has used dynamic DNS service providers to host malicious domains.(Citation: District Court of NY APT10 Indictment December 2018)", "header": "T1568.001", "name": "Fast Flux DNS"}, {"_id": 416, "body": "\u003cb\u003eAliases:\u003c/b\u003e Ke3chang, APT15, Mirage, Vixen Panda, GREF, Playful Dragon, RoyalAPT\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Ke3chang](https://attack.mitre.org/groups/G0004) is a threat group attributed to actors operating out of China. [Ke3chang](https://attack.mitre.org/groups/G0004) has targeted several industries, including oil, government, military, and more. (Citation: Villeneuve et al 2014) (Citation: NCC Group APT15 Alive and Strong) (Citation: APT15 Intezer June 2018)", "color": "#fce903", "group": 5, "header": "G0004", "name": "Ke3chang", "width": 10}, {"_id": 417, "body": "[MirageFox](https://attack.mitre.org/software/S0280) is a remote access tool used against Windows systems. It appears to be an upgraded version of a tool known as Mirage, which is a RAT believed to originate in 2012. (Citation: APT15 Intezer June 2018)", "color": "#ff3232", "header": "S0280", "name": "MirageFox"}, {"_id": 418, "body": "[spwebmember](https://attack.mitre.org/software/S0227) is a Microsoft SharePoint enumeration and data dumping tool written in .NET. (Citation: NCC Group APT15 Alive and Strong)", "color": "#ff1a8c", "header": "S0227", "name": "spwebmember"}, {"_id": 419, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Ke3chang](https://attack.mitre.org/groups/G0004) has used the right-to-left override character in spearphishing attachment names to trick targets into executing .scr and .exe files.(Citation: Villeneuve et al 2014)", "header": "T1036.002", "name": "Right-to-Left Override"}, {"_id": 420, "body": "[Okrum](https://attack.mitre.org/software/S0439) is a Windows backdoor that has been seen in use since December 2016 with strong links to [Ke3chang](https://attack.mitre.org/groups/G0004).(Citation: ESET Okrum July 2019)", "color": "#ff3232", "header": "S0439", "name": "Okrum"}, {"_id": 421, "body": "\u003cb\u003eAliases:\u003c/b\u003e Patchwork, Hangover Group, Dropping Elephant, Chinastrats, MONSOON, Operation Hangover\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Patchwork](https://attack.mitre.org/groups/G0040) is a cyberespionage group that was first observed in December 2015. While the group has not been definitively attributed, circumstantial evidence suggests the group may be a pro-Indian or Indian entity. [Patchwork](https://attack.mitre.org/groups/G0040) has been seen targeting industries related to diplomatic and government agencies. Much of the code used by this group was copied and pasted from online forums. [Patchwork](https://attack.mitre.org/groups/G0040) was also seen operating spearphishing campaigns targeting U.S. think tank groups in March and April of 2018. (Citation: Cymmetria Patchwork) (Citation: Symantec Patchwork) (Citation: TrendMicro Patchwork Dec 2017) (Citation: Volexity Patchwork June 2018)", "color": "#fce903", "group": 5, "header": "G0040", "name": "Patchwork", "width": 10}, {"_id": 422, "body": "[NDiskMonitor](https://attack.mitre.org/software/S0272) is a custom backdoor written in .NET that appears to be unique to [Patchwork](https://attack.mitre.org/groups/G0040). (Citation: TrendMicro Patchwork Dec 2017)", "color": "#ff3232", "header": "S0272", "name": "NDiskMonitor"}, {"_id": 423, "body": "[Unknown Logger](https://attack.mitre.org/software/S0130) is a publicly released, free backdoor. Version 1.5 of the backdoor has been used by the actors responsible for the MONSOON campaign. (Citation: Forcepoint Monsoon)", "color": "#ff3232", "header": "S0130", "name": "Unknown Logger"}, {"_id": 424, "body": "[BADNEWS](https://attack.mitre.org/software/S0128) is malware that has been used by the actors responsible for the [Patchwork](https://attack.mitre.org/groups/G0040) campaign. Its name was given due to its use of RSS feeds, forums, and blogs for command and control. (Citation: Forcepoint Monsoon) (Citation: TrendMicro Patchwork Dec 2017)", "color": "#ff3232", "header": "S0128", "name": "BADNEWS"}, {"_id": 425, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eAfter encrypting C2 data, [BADNEWS](https://attack.mitre.org/software/S0128) converts it into a hexadecimal representation and then encodes it into base64.(Citation: Forcepoint Monsoon)", "header": "T1132", "name": "Data Encoding"}, {"_id": 426, "body": "[AutoIt backdoor](https://attack.mitre.org/software/S0129) is malware that has been used by the actors responsible for the MONSOON campaign. The actors frequently used it in weaponized .pps files exploiting CVE-2014-6352. (Citation: Forcepoint Monsoon) This malware makes use of the legitimate scripting language for Windows GUI automation with the same name.", "color": "#ff3232", "header": "S0129", "name": "AutoIt backdoor"}, {"_id": 427, "body": "[TINYTYPHON](https://attack.mitre.org/software/S0131) is a backdoor  that has been used by the actors responsible for the MONSOON campaign. The majority of its code was reportedly taken from the MyDoom worm. (Citation: Forcepoint Monsoon)", "color": "#ff3232", "header": "S0131", "name": "TINYTYPHON"}, {"_id": 428, "body": "[BackConfig](https://attack.mitre.org/software/S0475) is a custom Trojan with a flexible plugin architecture that has been used by [Patchwork](https://attack.mitre.org/groups/G0040).(Citation: Unit 42 BackConfig May 2020)", "color": "#ff3232", "header": "S0475", "name": "BackConfig"}, {"_id": 429, "body": "\u003cb\u003eTactic:\u003c/b\u003e resource-development\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Patchwork](https://attack.mitre.org/groups/G0040) has created self-signed certificates from fictitious and spoofed legitimate software companies that were later used to sign malware.(Citation: Unit 42 BackConfig May 2020)", "header": "T1587.002", "name": "Code Signing Certificates"}, {"_id": 430, "body": "\u003cb\u003eAliases:\u003c/b\u003e Gorgon Group\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Gorgon Group](https://attack.mitre.org/groups/G0078) is a threat group consisting of members who are suspected to be Pakistan-based or have other connections to Pakistan. The group has performed a mix of criminal and targeted attacks, including campaigns against government organizations in the United Kingdom, Spain, Russia, and the United States. (Citation: Unit 42 Gorgon Group Aug 2018)", "color": "#fce903", "group": 5, "header": "G0078", "name": "Gorgon Group", "width": 10}, {"_id": 431, "body": "[Remcos](https://attack.mitre.org/software/S0332) is a closed-source tool that is marketed as a remote control and surveillance software by a company called Breaking Security. [Remcos](https://attack.mitre.org/software/S0332) has been observed being used in malware campaigns.(Citation: Riskiq Remcos Jan 2018)(Citation: Talos Remcos Aug 2018)", "color": "#ff1a8c", "header": "S0332", "name": "Remcos"}, {"_id": 432, "body": "[NanoCore](https://attack.mitre.org/software/S0336) is a modular remote access tool developed in .NET that can be used to spy on victims and steal information. It has been used by threat actors since 2013.(Citation: DigiTrust NanoCore Jan 2017)(Citation: Cofense NanoCore Mar 2018)(Citation: PaloAlto NanoCore Feb 2016)(Citation: Unit 42 Gorgon Group Aug 2018)", "color": "#ff3232", "header": "S0336", "name": "NanoCore"}, {"_id": 433, "body": "[njRAT](https://attack.mitre.org/software/S0385) is a remote access tool (RAT) that was first observed in 2012. It has been used by threat actors in the Middle East.(Citation: Fidelis njRAT June 2013)", "color": "#ff3232", "header": "S0385", "name": "njRAT"}, {"_id": 434, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[njRAT](https://attack.mitre.org/software/S0385) has used AutoIt to compile the payload and main script into a single executable after delivery.(Citation: Trend Micro njRAT 2018)", "header": "T1027.004", "name": "Compile After Delivery"}, {"_id": 435, "body": "\u003cb\u003eAliases:\u003c/b\u003e Dragonfly 2.0, IRON LIBERTY, DYMALLOY, Berserk Bear\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Dragonfly 2.0](https://attack.mitre.org/groups/G0074) is a suspected Russian group that has targeted government entities and multiple U.S. critical infrastructure sectors since at least December 2015. (Citation: US-CERT TA18-074A) (Citation: Symantec Dragonfly Sept 2017) There is debate over the extent of overlap between [Dragonfly 2.0](https://attack.mitre.org/groups/G0074) and [Dragonfly](https://attack.mitre.org/groups/G0035), but there is sufficient evidence to lead to these being tracked as two separate groups. (Citation: Fortune Dragonfly 2.0 Sept 2017)(Citation: Dragos DYMALLOY )", "color": "#fce903", "group": 5, "header": "G0074", "name": "Dragonfly 2.0", "width": 10}, {"_id": 436, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Dragonfly 2.0](https://attack.mitre.org/groups/G0074) has gathered hashed user credentials over SMB using spearphishing attachments with external resource links and by modifying .LNK file icon resources to collect credentials from virtualized systems.(Citation: US-CERT TA18-074A)(Citation: US-CERT APT Energy Oct 2017)", "header": "T1187", "name": "Forced Authentication"}, {"_id": 437, "body": "[netsh](https://attack.mitre.org/software/S0108) is a scripting utility used to interact with networking components on local or remote systems. (Citation: TechNet Netsh)", "color": "#ff1a8c", "header": "S0108", "name": "netsh"}, {"_id": 438, "body": "\u003cb\u003eTactics:\u003c/b\u003e privilege-escalation, persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[netsh](https://attack.mitre.org/software/S0108) can be used as a persistence proxy technique to execute a helper DLL when netsh.exe is executed.(Citation: Demaske Netsh Persistence)", "header": "T1546.007", "name": "Netsh Helper DLL"}, {"_id": 439, "body": "[CrackMapExec](https://attack.mitre.org/software/S0488), or CME, is a post-exploitation tool developed in Python and designed for penetration testing against networks. [CrackMapExec](https://attack.mitre.org/software/S0488) collects Active Directory information to conduct lateral movement through targeted networks.(Citation: CME Github September 2018)", "color": "#ff1a8c", "header": "S0488", "name": "CrackMapExec"}, {"_id": 440, "body": "[Trojan.Karagany](https://attack.mitre.org/software/S0094) is a modular remote access tool used for recon and linked to [Dragonfly](https://attack.mitre.org/groups/G0035) and [Dragonfly 2.0](https://attack.mitre.org/groups/G0074). The source code for [Trojan.Karagany](https://attack.mitre.org/software/S0094) originated from Dream Loader malware which was leaked in 2010 and sold on underground forums. (Citation: Symantec Dragonfly)(Citation: Secureworks Karagany July 2019)(Citation: Dragos DYMALLOY )", "color": "#ff3232", "header": "S0094", "name": "Trojan.Karagany"}, {"_id": 441, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Trojan.Karagany](https://attack.mitre.org/software/S0094) can inject a suspended thread of its own process into a new process and initiate via the \u003ccode\u003eResumeThread\u003c/code\u003e API.(Citation: Secureworks Karagany July 2019)", "header": "T1055.003", "name": "Thread Execution Hijacking"}, {"_id": 442, "body": "[MCMD](https://attack.mitre.org/software/S0500) is a remote access tool that provides remote command shell capability used by [Dragonfly 2.0](https://attack.mitre.org/groups/G0074).(Citation: Secureworks MCMD July 2019)", "color": "#ff1a8c", "header": "S0500", "name": "MCMD"}, {"_id": 443, "body": "\u003cb\u003eAliases:\u003c/b\u003e BRONZE BUTLER, REDBALDKNIGHT, Tick\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [BRONZE BUTLER](https://attack.mitre.org/groups/G0060) is a cyber espionage group with likely Chinese origins that has been active since at least 2008. The group primarily targets Japanese organizations, particularly those in government, biotechnology, electronics manufacturing, and industrial chemistry.(Citation: Trend Micro Daserf Nov 2017)(Citation: Secureworks BRONZE BUTLER Oct 2017)(Citation: Trend Micro Tick November 2019)", "color": "#fce903", "group": 5, "header": "G0060", "name": "BRONZE BUTLER", "width": 10}, {"_id": 444, "body": "[Daserf](https://attack.mitre.org/software/S0187) is a backdoor that has been used to spy on and steal from Japanese, South Korean, Russian, Singaporean, and Chinese victims. Researchers have identified versions written in both Visual C and Delphi. (Citation: Trend Micro Daserf Nov 2017) (Citation: Secureworks BRONZE BUTLER Oct 2017)", "color": "#ff3232", "header": "S0187", "name": "Daserf"}, {"_id": 445, "body": "[Windows Credential Editor](https://attack.mitre.org/software/S0005) is a password dumping tool. (Citation: Amplia WCE)", "color": "#ff1a8c", "header": "S0005", "name": "Windows Credential Editor"}, {"_id": 446, "body": "\u003cb\u003eTactic:\u003c/b\u003e lateral-movement\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[BRONZE BUTLER](https://attack.mitre.org/groups/G0060) has placed malware on file shares and given it the same name as legitimate documents on the share.(Citation: Secureworks BRONZE BUTLER Oct 2017)", "header": "T1080", "name": "Taint Shared Content"}, {"_id": 447, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[BRONZE BUTLER](https://attack.mitre.org/groups/G0060) has used tools to enumerate software installed on an infected host.(Citation: Trend Micro Tick November 2019)", "header": "T1518", "name": "Software Discovery"}, {"_id": 448, "body": "[ABK](https://attack.mitre.org/software/S0469) is a downloader that has been used by [BRONZE BUTLER](https://attack.mitre.org/groups/G0060) since at least 2019.(Citation: Trend Micro Tick November 2019)", "color": "#ff3232", "header": "S0469", "name": "ABK"}, {"_id": 449, "body": " [down_new](https://attack.mitre.org/software/S0472) is a downloader that has been used by [BRONZE BUTLER](https://attack.mitre.org/groups/G0060) since at least 2019.(Citation: Trend Micro Tick November 2019)", "color": "#ff3232", "header": "S0472", "name": "down_new"}, {"_id": 450, "body": "[build_downer](https://attack.mitre.org/software/S0471) is a downloader that has been used by [BRONZE BUTLER](https://attack.mitre.org/groups/G0060) since at least 2019.(Citation: Trend Micro Tick November 2019)", "color": "#ff3232", "header": "S0471", "name": "build_downer"}, {"_id": 451, "body": "[BBK](https://attack.mitre.org/software/S0470) is a downloader that has been used by [BRONZE BUTLER](https://attack.mitre.org/groups/G0060) since at least 2019.(Citation: Trend Micro Tick November 2019)", "color": "#ff3232", "header": "S0470", "name": "BBK"}, {"_id": 452, "body": "[Avenger](https://attack.mitre.org/software/S0473) is a downloader that has been used by [BRONZE BUTLER](https://attack.mitre.org/groups/G0060) since at least 2019.(Citation: Trend Micro Tick November 2019)", "color": "#ff3232", "header": "S0473", "name": "Avenger"}, {"_id": 453, "body": "[ShadowPad](https://attack.mitre.org/software/S0596) is a modular backdoor that was first identified in a supply chain compromise of the NetSarang software in mid-July 2017. The malware was originally thought to be exclusively used by [APT41](https://attack.mitre.org/groups/G0096), but has since been observed to be used by various Chinese threat activity groups. (Citation: Recorded Future RedEcho Feb 2021)(Citation: Securelist ShadowPad Aug 2017)(Citation: Kaspersky ShadowPad Aug 2017) ", "color": "#ff3232", "header": "S0596", "name": "ShadowPad"}, {"_id": 454, "body": "\u003cb\u003eAliases:\u003c/b\u003e APT19, Codoso, C0d0so0, Codoso Team, Sunshop Group\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [APT19](https://attack.mitre.org/groups/G0073) is a Chinese-based threat group that has targeted a variety of industries, including defense, finance, energy, pharmaceutical, telecommunications, high tech, education, manufacturing, and legal services. In 2017, a phishing campaign was used to target seven law and investment firms. (Citation: FireEye APT19) Some analysts track [APT19](https://attack.mitre.org/groups/G0073) and [Deep Panda](https://attack.mitre.org/groups/G0009) as the same group, but it is unclear from open source information if the groups are the same. (Citation: ICIT China\u0027s Espionage Jul 2016) (Citation: FireEye APT Groups) (Citation: Unit 42 C0d0so0 Jan 2016)", "color": "#fce903", "group": 5, "header": "G0073", "name": "APT19", "width": 10}, {"_id": 455, "body": "[Empire](https://attack.mitre.org/software/S0363) is an open source, cross-platform remote administration and post-exploitation framework that is publicly available on GitHub. While the tool itself is primarily written in Python, the post-exploitation agents are written in pure [PowerShell](https://attack.mitre.org/techniques/T1059/001) for Windows and Python for Linux/macOS. [Empire](https://attack.mitre.org/software/S0363) was one of five tools singled out by a joint report on public hacking tools being widely used by adversaries.(Citation: NCSC Joint Report Public Tools)(Citation: Github PowerShell Empire)(Citation: GitHub ATTACK Empire)", "color": "#ff1a8c", "header": "S0363", "name": "Empire"}, {"_id": 456, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Empire](https://attack.mitre.org/software/S0363) has the ability to gather browser data such as bookmarks and visited sites.(Citation: Github PowerShell Empire)", "header": "T1217", "name": "Browser Bookmark Discovery"}, {"_id": 457, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Empire](https://attack.mitre.org/software/S0363) can use \u003ccode\u003eInvoke-RunAs\u003c/code\u003e to make tokens.(Citation: Github PowerShell Empire)", "header": "T1134.002", "name": "Create Process with Token"}, {"_id": 458, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Empire](https://attack.mitre.org/software/S0363) can use \u003ccode\u003eNew-GPOImmediateTask\u003c/code\u003e to modify a GPO that will install and execute a malicious [Scheduled Task/Job](https://attack.mitre.org/techniques/T1053).(Citation: Github PowerShell Empire)", "header": "T1484.001", "name": "Group Policy Modification"}, {"_id": 459, "body": "\u003cb\u003eTactic:\u003c/b\u003e exfiltration\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Empire](https://attack.mitre.org/software/S0363) can use GitHub for data exfiltration.(Citation: Github PowerShell Empire)", "header": "T1567.001", "name": "Exfiltration to Code Repository"}, {"_id": 460, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation, defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Empire](https://attack.mitre.org/software/S0363) has a dylib hijacker module that generates a malicious dylib given the path to a legitimate dylib of a vulnerable application.(Citation: Github PowerShell Empire)", "header": "T1574.004", "name": "Dylib Hijacking"}, {"_id": 461, "body": "\u003cb\u003eAliases:\u003c/b\u003e Lazarus Group, HIDDEN COBRA, Guardians of Peace, ZINC, NICKEL ACADEMY\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Lazarus Group](https://attack.mitre.org/groups/G0032) is a threat group that has been attributed to the North Korean government.(Citation: US-CERT HIDDEN COBRA June 2017) The group has been active since at least 2009 and was reportedly responsible for the November 2014 destructive wiper attack against Sony Pictures Entertainment as part of a campaign named Operation Blockbuster by Novetta. Malware used by [Lazarus Group](https://attack.mitre.org/groups/G0032) correlates to other reported campaigns, including Operation Flame, Operation 1Mission, Operation Troy, DarkSeoul, and Ten Days of Rain. (Citation: Novetta Blockbuster) In late 2017, [Lazarus Group](https://attack.mitre.org/groups/G0032) used KillDisk, a disk-wiping tool, in an attack against an online casino based in Central America. (Citation: Lazarus KillDisk)\n\nNorth Korean group definitions are known to have significant overlap, and the name [Lazarus Group](https://attack.mitre.org/groups/G0032) is known to encompass a broad range of activity. Some organizations use the name Lazarus Group to refer to any activity attributed to North Korea.(Citation: US-CERT HIDDEN COBRA June 2017) Some organizations track North Korean clusters or groups such as Bluenoroff,(Citation: Kaspersky Lazarus Under The Hood Blog 2017) [APT37](https://attack.mitre.org/groups/G0067), and [APT38](https://attack.mitre.org/groups/G0082) separately, while other organizations may track some activity associated with those group names by the name Lazarus Group.", "color": "#fce903", "group": 5, "header": "G0032", "name": "Lazarus Group", "width": 10}, {"_id": 462, "body": "[Proxysvc](https://attack.mitre.org/software/S0238) is a malicious DLL used by [Lazarus Group](https://attack.mitre.org/groups/G0032) in a campaign known as Operation GhostSecret. It has appeared to be operating undetected since 2017 and was mostly observed in higher education organizations. The goal of [Proxysvc](https://attack.mitre.org/software/S0238) is to deliver additional payloads to the target and to maintain control for the attacker. It is in the form of a DLL that can also be executed as a standalone process. (Citation: McAfee GhostSecret)", "color": "#ff3232", "header": "S0238", "name": "Proxysvc"}, {"_id": 463, "body": "[KEYMARBLE](https://attack.mitre.org/software/S0271) is a Trojan that has reportedly been used by the North Korean government. (Citation: US-CERT KEYMARBLE Aug 2018)", "color": "#ff3232", "header": "S0271", "name": "KEYMARBLE"}, {"_id": 464, "body": "[Volgmer](https://attack.mitre.org/software/S0180) is a backdoor Trojan designed to provide covert access to a compromised system. It has been used since at least 2013 to target the government, financial, automotive, and media industries. Its primary delivery mechanism is suspected to be spearphishing. (Citation: US-CERT Volgmer Nov 2017)", "color": "#ff3232", "header": "S0180", "name": "Volgmer"}, {"_id": 465, "body": "[BADCALL](https://attack.mitre.org/software/S0245) is a Trojan malware variant used by the group [Lazarus Group](https://attack.mitre.org/groups/G0032). (Citation: US-CERT BADCALL)", "color": "#ff3232", "header": "S0245", "name": "BADCALL"}, {"_id": 466, "body": "[RATANKBA](https://attack.mitre.org/software/S0241) is a remote controller tool used by [Lazarus Group](https://attack.mitre.org/groups/G0032). [RATANKBA](https://attack.mitre.org/software/S0241) has been used in attacks targeting financial institutions in Poland, Mexico, Uruguay, the United Kingdom, and Chile. It was also seen used against organizations related to telecommunications, management consulting, information technology, insurance, aviation, and education. [RATANKBA](https://attack.mitre.org/software/S0241) has a graphical user interface to allow the attacker to issue jobs to perform on the infected machines. (Citation: Lazarus RATANKBA) (Citation: RATANKBA)", "color": "#ff3232", "header": "S0241", "name": "RATANKBA"}, {"_id": 467, "body": "[Bankshot](https://attack.mitre.org/software/S0239) is a remote access tool (RAT) that was first reported by the Department of Homeland Security in December of 2017. In 2018, [Lazarus Group](https://attack.mitre.org/groups/G0032) used the [Bankshot](https://attack.mitre.org/software/S0239) implant in attacks against the Turkish financial sector. (Citation: McAfee Bankshot)", "color": "#ff3232", "header": "S0239", "name": "Bankshot"}, {"_id": 468, "body": "[HARDRAIN](https://attack.mitre.org/software/S0246) is a Trojan malware variant reportedly used by the North Korean government. (Citation: US-CERT HARDRAIN March 2018)", "color": "#ff3232", "header": "S0246", "name": "HARDRAIN"}, {"_id": 469, "body": "[TYPEFRAME](https://attack.mitre.org/software/S0263) is a remote access tool that has been used by [Lazarus Group](https://attack.mitre.org/groups/G0032). (Citation: US-CERT TYPEFRAME June 2018)", "color": "#ff3232", "header": "S0263", "name": "TYPEFRAME"}, {"_id": 470, "body": "[AuditCred](https://attack.mitre.org/software/S0347) is a malicious DLL that has been used by [Lazarus Group](https://attack.mitre.org/groups/G0032) during their 2018 attacks.(Citation: TrendMicro Lazarus Nov 2018)", "color": "#ff3232", "header": "S0347", "name": "AuditCred"}, {"_id": 471, "body": "[FALLCHILL](https://attack.mitre.org/software/S0181) is a RAT that has been used by [Lazarus Group](https://attack.mitre.org/groups/G0032) since at least 2016 to target the aerospace, telecommunications, and finance industries. It is usually dropped by other [Lazarus Group](https://attack.mitre.org/groups/G0032) malware or delivered when a victim unknowingly visits a compromised website. (Citation: US-CERT FALLCHILL Nov 2017)", "color": "#ff3232", "header": "S0181", "name": "FALLCHILL"}, {"_id": 472, "body": "\u003cb\u003eTactic:\u003c/b\u003e impact\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Lazarus Group](https://attack.mitre.org/groups/G0032) has stopped the MSExchangeIS service to render Exchange contents inaccessible to users.(Citation: Novetta Blockbuster Destructive Malware)", "header": "T1489", "name": "Service Stop"}, {"_id": 473, "body": "\u003cb\u003eTactic:\u003c/b\u003e impact\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Lazarus Group](https://attack.mitre.org/groups/G0032) has used malware like WhiskeyAlfa to overwrite the first 64MB of every drive with a mix of static and random buffers. A similar process is then used to wipe content in logical drives and, finally, attempt to wipe every byte of every sector on every drive. WhiskeyBravo can be used to overwrite the first 4.9MB of physical drives. WhiskeyDelta can overwrite the first 132MB or 1.5MB of each drive with random data from heap memory.(Citation: Novetta Blockbuster Destructive Malware)", "header": "T1561.001", "name": "Disk Content Wipe"}, {"_id": 474, "body": "[WannaCry](https://attack.mitre.org/software/S0366) is ransomware that was first seen in a global attack during May 2017, which affected more than 150 countries. It contains worm-like features to spread itself across a computer network using the SMBv1 exploit EternalBlue.(Citation: LogRhythm WannaCry)(Citation: US-CERT WannaCry 2017)(Citation: Washington Post WannaCry 2017)(Citation: FireEye WannaCry 2017)", "color": "#ff3232", "header": "S0366", "name": "WannaCry"}, {"_id": 475, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[WannaCry](https://attack.mitre.org/software/S0366) uses \u003ccode\u003eattrib +h\u003c/code\u003e and \u003ccode\u003eicacls . /grant Everyone:F /T /C /Q\u003c/code\u003e to make some of its files hidden and grant all users full access controls.(Citation: LogRhythm WannaCry)", "header": "T1222.001", "name": "Windows File and Directory Permissions Modification"}, {"_id": 476, "body": "\u003cb\u003eTactic:\u003c/b\u003e lateral-movement\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[WannaCry](https://attack.mitre.org/software/S0366) enumerates current remote desktop sessions and tries to execute the malware on each session.(Citation: LogRhythm WannaCry)", "header": "T1563.002", "name": "RDP Hijacking"}, {"_id": 477, "body": "\u003cb\u003eTactic:\u003c/b\u003e impact\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[WannaCry](https://attack.mitre.org/software/S0366) encrypts user files and demands that a ransom be paid in Bitcoin to decrypt those files.(Citation: LogRhythm WannaCry)(Citation: FireEye WannaCry 2017)(Citation: SecureWorks WannaCry Analysis)", "header": "T1486", "name": "Data Encrypted for Impact"}, {"_id": 478, "body": "\u003cb\u003eTactic:\u003c/b\u003e impact\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[WannaCry](https://attack.mitre.org/software/S0366) uses \u003ccode\u003evssadmin\u003c/code\u003e, \u003ccode\u003ewbadmin\u003c/code\u003e, \u003ccode\u003ebcdedit\u003c/code\u003e, and \u003ccode\u003ewmic\u003c/code\u003e to delete and disable operating system recovery features.(Citation: LogRhythm WannaCry)(Citation: FireEye WannaCry 2017)(Citation: SecureWorks WannaCry Analysis)", "header": "T1490", "name": "Inhibit System Recovery"}, {"_id": 479, "body": "[RawDisk](https://attack.mitre.org/software/S0364) is a legitimate commercial driver from the EldoS Corporation that is used for interacting with files, disks, and partitions. The driver allows for direct modification of data on a local computer\u0027s hard drive. In some cases, the tool can enact these raw disk modifications from user-mode processes, circumventing Windows operating system security features.(Citation: EldoS RawDisk ITpro)(Citation: Novetta Blockbuster Destructive Malware)", "color": "#ff1a8c", "header": "S0364", "name": "RawDisk"}, {"_id": 480, "body": "\u003cb\u003eTactic:\u003c/b\u003e impact\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Lazarus Group](https://attack.mitre.org/groups/G0032) has subset groups like Bluenoroff who have used cryptocurrency mining software on victim machines.(Citation: Kaspersky Lazarus Under The Hood Blog 2017)", "header": "T1496", "name": "Resource Hijacking"}, {"_id": 481, "body": "[HOPLIGHT](https://attack.mitre.org/software/S0376) is a backdoor Trojan that has reportedly been used by the North Korean government.(Citation: US-CERT HOPLIGHT Apr 2019)", "color": "#ff3232", "header": "S0376", "name": "HOPLIGHT"}, {"_id": 482, "body": "\u003cb\u003eTactic:\u003c/b\u003e impact\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Lazarus Group](https://attack.mitre.org/groups/G0032) replaced the background wallpaper of systems with a threatening image after rendering the system unbootable with a [Disk Structure Wipe](https://attack.mitre.org/techniques/T1561/002)(Citation: Kaspersky Lazarus Under The Hood Blog 2017)(Citation: Novetta Blockbuster Destructive Malware)", "header": "T1491.001", "name": "Internal Defacement"}, {"_id": 483, "body": "[HotCroissant](https://attack.mitre.org/software/S0431) is a remote access trojan (RAT) attributed by U.S. government entities to malicious North Korean government cyber activity, tracked collectively as HIDDEN COBRA.(Citation: US-CERT HOTCROISSANT February 2020) [HotCroissant](https://attack.mitre.org/software/S0431) shares numerous code similarities with [Rifdoor](https://attack.mitre.org/software/S0433).(Citation: Carbon Black HotCroissant April 2020)", "color": "#ff3232", "header": "S0431", "name": "HotCroissant"}, {"_id": 484, "body": "[Dacls](https://attack.mitre.org/software/S0497) is a multi-platform remote access tool used by [Lazarus Group](https://attack.mitre.org/groups/G0032) since at least December 2019.(Citation: TrendMicro macOS Dacls May 2020)(Citation: SentinelOne Lazarus macOS July 2020)", "color": "#ff3232", "header": "S0497", "name": "Dacls"}, {"_id": 485, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Dacls](https://attack.mitre.org/software/S0497) can establish persistence via a Launch Daemon.(Citation: SentinelOne Lazarus macOS July 2020)(Citation: TrendMicro macOS Dacls May 2020)", "header": "T1543.004", "name": "Launch Daemon"}, {"_id": 486, "body": "[Cryptoistic](https://attack.mitre.org/software/S0498) is a backdoor, written in Swift, that has been used by [Lazarus Group](https://attack.mitre.org/groups/G0032).(Citation: SentinelOne Lazarus macOS July 2020)", "color": "#ff3232", "header": "S0498", "name": "Cryptoistic"}, {"_id": 487, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Cryptoistic](https://attack.mitre.org/software/S0498) can engage in encrypted communications with C2.(Citation: SentinelOne Lazarus macOS July 2020)", "header": "T1573", "name": "Encrypted Channel"}, {"_id": 488, "body": "[BLINDINGCAN](https://attack.mitre.org/software/S0520) is a remote access Trojan that has been used by the North Korean government since at least early 2020 in cyber operations against defense, engineering, and government organizations in Western Europe and the US.(Citation: US-CERT BLINDINGCAN Aug 2020)(Citation: NHS UK BLINDINGCAN Aug 2020)", "color": "#ff3232", "header": "S0520", "name": "BLINDINGCAN"}, {"_id": 489, "body": "[AppleJeus](https://attack.mitre.org/software/S0584) is a family of downloaders initially discovered in 2018 embedded within trojanized cryptocurrency applications. [AppleJeus](https://attack.mitre.org/software/S0584) has been used by [Lazarus Group](https://attack.mitre.org/groups/G0032), targeting companies in the energy, finance, government, industry, technology, and telecommunications sectors, and several countries including the United States, United Kingdom, South Korea, Australia, Brazil, New Zealand, and Russia. [AppleJeus](https://attack.mitre.org/software/S0584) has been used to distribute the [FALLCHILL](https://attack.mitre.org/software/S0181) RAT.(Citation: CISA AppleJeus Feb 2021)", "color": "#ff3232", "header": "S0584", "name": "AppleJeus"}, {"_id": 490, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[AppleJeus](https://attack.mitre.org/software/S0584) has been installed via MSI installer.(Citation: CISA AppleJeus Feb 2021)", "header": "T1218.007", "name": "Msiexec"}, {"_id": 491, "body": "\u003cb\u003eTactic:\u003c/b\u003e execution\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[AppleJeus](https://attack.mitre.org/software/S0584) has loaded a plist file using the \u003ccode\u003elaunchctl\u003c/code\u003e command.(Citation: CISA AppleJeus Feb 2021)", "header": "T1569.001", "name": "Launchctl"}, {"_id": 492, "body": "[TAINTEDSCRIBE](https://attack.mitre.org/software/S0586) is a fully-featured beaconing implant integrated with command modules used by [Lazarus Group](https://attack.mitre.org/groups/G0032). It was first reported in May 2020.(Citation: CISA MAR-10288834-2.v1  TAINTEDSCRIBE MAY 2020)", "color": "#ff3232", "header": "S0586", "name": "TAINTEDSCRIBE"}, {"_id": 493, "body": "[Dtrack](https://attack.mitre.org/software/S0567) is spyware that was discovered in 2019 and has been used against Indian financial institutions, research facilities, and the Kudankulam Nuclear Power Plant. [Dtrack](https://attack.mitre.org/software/S0567) shares similarities with the DarkSeoul campaign, which was attributed to [Lazarus Group](https://attack.mitre.org/groups/G0032). (Citation: Kaspersky Dtrack)(Citation: Securelist Dtrack)(Citation: Dragos WASSONITE)(Citation: CyberBit Dtrack)(Citation: ZDNet Dtrack)", "color": "#ff3232", "header": "S0567", "name": "Dtrack"}, {"_id": 494, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation, defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eOne of [Dtrack](https://attack.mitre.org/software/S0567) can replace the normal flow of a program execution with malicious code.(Citation: CyberBit Dtrack)", "header": "T1574", "name": "Hijack Execution Flow"}, {"_id": 495, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Dtrack](https://attack.mitre.org/software/S0567)\u2019s RAT makes a persistent target file with auto execution on the host start.(Citation: Securelist Dtrack)", "header": "T1547", "name": "Boot or Logon Autostart Execution"}, {"_id": 496, "body": "[ECCENTRICBANDWAGON](https://attack.mitre.org/software/S0593) is a Remote Access Tool (RAT) used by [Lazarus Group](https://attack.mitre.org/groups/G0032) that was first identified in August 2020. It is a reconnaissance tool--with keylogging and screen capture functionality--used for information gathering on compromised systems.(Citation: CISA EB Aug 2020)", "color": "#ff3232", "header": "S0593", "name": "ECCENTRICBANDWAGON"}, {"_id": 497, "body": "\u003cb\u003eAliases:\u003c/b\u003e APT33, HOLMIUM, Elfin\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [APT33](https://attack.mitre.org/groups/G0064) is a suspected Iranian threat group that has carried out operations since at least 2013. The group has targeted organizations across multiple industries in the United States, Saudi Arabia, and South Korea, with a particular interest in the aviation and energy sectors. (Citation: FireEye APT33 Sept 2017) (Citation: FireEye APT33 Webinar Sept 2017)", "color": "#fce903", "group": 5, "header": "G0064", "name": "APT33", "width": 10}, {"_id": 498, "body": "[NETWIRE](https://attack.mitre.org/software/S0198) is a publicly available, multiplatform remote administration tool (RAT) that has been used by criminal and APT groups since at least 2012.(Citation: FireEye APT33 Sept 2017) (Citation: McAfee Netwire Mar 2015) (Citation: FireEye APT33 Webinar Sept 2017)", "color": "#ff3232", "header": "S0198", "name": "NETWIRE"}, {"_id": 499, "body": "\u003cb\u003eTactics:\u003c/b\u003e execution, persistence, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[NETWIRE](https://attack.mitre.org/software/S0198) can use crontabs to establish persistence.(Citation: Red Canary NETWIRE January 2020)", "header": "T1053.003", "name": "Cron"}, {"_id": 500, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[NETWIRE](https://attack.mitre.org/software/S0198) can persist via startup options for Login items.(Citation: Red Canary NETWIRE January 2020)", "header": "T1547.011", "name": "Plist Modification"}, {"_id": 501, "body": "[TURNEDUP](https://attack.mitre.org/software/S0199) is a non-public backdoor. It has been dropped by [APT33](https://attack.mitre.org/groups/G0064)\u0027s [StoneDrill](https://attack.mitre.org/software/S0380) malware. (Citation: FireEye APT33 Sept 2017) (Citation: FireEye APT33 Webinar Sept 2017)", "color": "#ff3232", "header": "S0199", "name": "TURNEDUP"}, {"_id": 502, "body": "[Ruler](https://attack.mitre.org/software/S0358) is a tool to abuse Microsoft Exchange services. It is publicly available on GitHub and the tool is executed via the command line. The creators of [Ruler](https://attack.mitre.org/software/S0358) have also released a defensive tool, NotRuler, to detect its usage.(Citation: SensePost Ruler GitHub)(Citation: SensePost NotRuler)", "color": "#ff1a8c", "header": "S0358", "name": "Ruler"}, {"_id": 503, "body": "\u003cb\u003eTactic:\u003c/b\u003e discovery\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Ruler](https://attack.mitre.org/software/S0358) can be used to enumerate Exchange users and dump the GAL.(Citation: SensePost Ruler GitHub)", "header": "T1087.003", "name": "Email Account"}, {"_id": 504, "body": "\u003cb\u003eTactic:\u003c/b\u003e persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Ruler](https://attack.mitre.org/software/S0358) can be used to automate the abuse of Outlook Rules to establish persistence.(Citation: SensePost Ruler GitHub) ", "header": "T1137.005", "name": "Outlook Rules"}, {"_id": 505, "body": "\u003cb\u003eTactic:\u003c/b\u003e persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Ruler](https://attack.mitre.org/software/S0358) can be used to automate the abuse of Outlook Forms to establish persistence.(Citation: SensePost Ruler GitHub)", "header": "T1137.003", "name": "Outlook Forms"}, {"_id": 506, "body": "[Pupy](https://attack.mitre.org/software/S0192) is an open source, cross-platform (Windows, Linux, OSX, Android) remote administration and post-exploitation tool. (Citation: GitHub Pupy) It is written in Python and can be generated as a payload in several different ways (Windows exe, Python file, PowerShell oneliner/file, Linux elf, APK, Rubber Ducky, etc.). (Citation: GitHub Pupy) [Pupy](https://attack.mitre.org/software/S0192) is publicly available on GitHub. (Citation: GitHub Pupy)", "color": "#ff1a8c", "header": "S0192", "name": "Pupy"}, {"_id": 507, "body": "[POWERTON](https://attack.mitre.org/software/S0371) is a custom PowerShell backdoor first observed in 2018. It has typically been deployed as a late-stage backdoor by [APT33](https://attack.mitre.org/groups/G0064). At least two variants of the backdoor have been identified, with the later version containing improved functionality.(Citation: FireEye APT33 Guardrail)", "color": "#ff3232", "header": "S0371", "name": "POWERTON"}, {"_id": 508, "body": "[PoshC2](https://attack.mitre.org/software/S0378) is an open source remote administration and post-exploitation framework that is publicly available on GitHub. The server-side components of the tool are primarily written in Python, while the implants are written in [PowerShell](https://attack.mitre.org/techniques/T1059/001). Although [PoshC2](https://attack.mitre.org/software/S0378) is primarily focused on Windows implantation, it does contain a basic Python dropper for Linux/macOS.(Citation: GitHub PoshC2)", "color": "#ff1a8c", "header": "S0378", "name": "PoshC2"}, {"_id": 509, "body": "[StoneDrill](https://attack.mitre.org/software/S0380) is wiper malware discovered in destructive campaigns against both Middle Eastern and European targets in association with [APT33](https://attack.mitre.org/groups/G0064).(Citation: FireEye APT33 Sept 2017)(Citation: Kaspersky StoneDrill 2017)", "color": "#ff3232", "header": "S0380", "name": "StoneDrill"}, {"_id": 510, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, persistence, privilege-escalation, initial-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT33](https://attack.mitre.org/groups/G0064) has used compromised Office 365 accounts in tandem with [Ruler](https://attack.mitre.org/software/S0358) in an attempt to gain control of endpoints.(Citation: Microsoft Holmium June 2020)", "header": "T1078.004", "name": "Cloud Accounts"}, {"_id": 511, "body": "\u003cb\u003eAliases:\u003c/b\u003e Leviathan, TEMP.Jumper, APT40, TEMP.Periscope\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Leviathan](https://attack.mitre.org/groups/G0065) is a cyber espionage group that has been active since at least 2013. The group generally targets defense and government organizations, but has also targeted a range of industries including engineering firms, shipping and transportation, manufacturing, defense, government offices, and research universities in the United States, Western Europe, and along the South China Sea. (Citation: Proofpoint Leviathan Oct 2017) (Citation: FireEye Periscope March 2018)", "color": "#fce903", "group": 5, "header": "G0065", "name": "Leviathan", "width": 10}, {"_id": 512, "body": "[Derusbi](https://attack.mitre.org/software/S0021) is malware used by multiple Chinese APT groups. (Citation: Novetta-Axiom) (Citation: ThreatConnect Anthem) Both Windows and Linux variants have been observed. (Citation: Fidelis Turbo)", "color": "#ff3232", "header": "S0021", "name": "Derusbi"}, {"_id": 513, "body": "[BITSAdmin](https://attack.mitre.org/software/S0190) is a command line tool used to create and manage [BITS Jobs](https://attack.mitre.org/techniques/T1197). (Citation: Microsoft BITSAdmin)", "color": "#ff1a8c", "header": "S0190", "name": "BITSAdmin"}, {"_id": 514, "body": "[HOMEFRY](https://attack.mitre.org/software/S0232) is a 64-bit Windows password dumper/cracker that has previously been used in conjunction with other [Leviathan](https://attack.mitre.org/groups/G0065) backdoors. (Citation: FireEye Periscope March 2018)", "color": "#ff3232", "header": "S0232", "name": "HOMEFRY"}, {"_id": 515, "body": "[NanHaiShu](https://attack.mitre.org/software/S0228) is a remote access tool and JScript backdoor used by [Leviathan](https://attack.mitre.org/groups/G0065). [NanHaiShu](https://attack.mitre.org/software/S0228) has been used to target government and private-sector organizations that have relations to the South China Sea dispute. (Citation: Proofpoint Leviathan Oct 2017) (Citation: fsecure NanHaiShu July 2016)", "color": "#ff3232", "header": "S0228", "name": "NanHaiShu"}, {"_id": 516, "body": "[MURKYTOP](https://attack.mitre.org/software/S0233) is a reconnaissance tool used by [Leviathan](https://attack.mitre.org/groups/G0065). (Citation: FireEye Periscope March 2018)", "color": "#ff3232", "header": "S0233", "name": "MURKYTOP"}, {"_id": 517, "body": "[China Chopper](https://attack.mitre.org/software/S0020) is a [Web Shell](https://attack.mitre.org/techniques/T1505/003) hosted on Web servers to provide access back into an enterprise network that does not rely on an infected system calling back to a remote command and control server. (Citation: Lee 2013) It has been used by several threat groups. (Citation: Dell TG-3390) (Citation: FireEye Periscope March 2018)", "color": "#ff3232", "header": "S0020", "name": "China Chopper"}, {"_id": 518, "body": "[Orz](https://attack.mitre.org/software/S0229) is a custom JavaScript backdoor used by [Leviathan](https://attack.mitre.org/groups/G0065). It was observed being used in 2014 as well as in August 2017 when it was dropped by Microsoft Publisher files. (Citation: Proofpoint Leviathan Oct 2017) (Citation: FireEye Periscope March 2018)", "color": "#ff3232", "header": "S0229", "name": "Orz"}, {"_id": 519, "body": "\u003cb\u003eAliases:\u003c/b\u003e Cobalt Group, Cobalt Gang, Cobalt Spider\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Cobalt Group](https://attack.mitre.org/groups/G0080) is a financially motivated threat group that has primarily targeted financial institutions. The group has conducted intrusions to steal money via targeting ATM systems, card processing, payment systems and SWIFT systems. [Cobalt Group](https://attack.mitre.org/groups/G0080) has mainly targeted banks in Eastern Europe, Central Asia, and Southeast Asia. One of the alleged leaders was arrested in Spain in early 2018, but the group still appears to be active. The group has been known to target organizations in order to use their access to then compromise additional victims. (Citation: Talos Cobalt Group July 2018) (Citation: PTSecurity Cobalt Group Aug 2017) (Citation: PTSecurity Cobalt Dec 2016) (Citation: Group IB Cobalt Aug 2017) (Citation: Proofpoint Cobalt June 2017) (Citation: RiskIQ Cobalt Nov 2017) (Citation: RiskIQ Cobalt Jan 2018) Reporting indicates there may be links between [Cobalt Group](https://attack.mitre.org/groups/G0080) and both the malware [Carbanak](https://attack.mitre.org/software/S0030) and the group [Carbanak](https://attack.mitre.org/groups/G0008). (Citation: Europol Cobalt Mar 2018)", "color": "#fce903", "group": 5, "header": "G0080", "name": "Cobalt Group", "width": 10}, {"_id": 520, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Cobalt Group](https://attack.mitre.org/groups/G0080) has used the command \u003ccode\u003ecmstp.exe /s /ns C:\\Users\\ADMINI~W\\AppData\\Local\\Temp\\XKNqbpzl.txt\u003c/code\u003e to bypass AppLocker and launch a malicious script.(Citation: Talos Cobalt Group July 2018)(Citation: Morphisec Cobalt Gang Oct 2018)(Citation: Unit 42 Cobalt Gang Oct 2018)", "header": "T1218.003", "name": "CMSTP"}, {"_id": 521, "body": "[More_eggs](https://attack.mitre.org/software/S0284) is a JScript backdoor used by [Cobalt Group](https://attack.mitre.org/groups/G0080) and [FIN6](https://attack.mitre.org/groups/G0037). Its name was given based on the variable \"More_eggs\" being present in its code. There are at least two different versions of the backdoor being used, version 2.0 and version 4.4. (Citation: Talos Cobalt Group July 2018)(Citation: Security Intelligence More Eggs Aug 2019)", "color": "#ff3232", "header": "S0284", "name": "More_eggs"}, {"_id": 522, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Cobalt Group](https://attack.mitre.org/groups/G0080) used msxsl.exe to bypass AppLocker and to invoke Jscript code from an XSL file.(Citation: Talos Cobalt Group July 2018)", "header": "T1220", "name": "XSL Script Processing"}, {"_id": 523, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Cobalt Group](https://attack.mitre.org/groups/G0080) has used \u003ccode\u003eodbcconf\u003c/code\u003e to proxy the execution of malicious DLL files.(Citation: TrendMicro Cobalt Group Nov 2017)", "header": "T1218.008", "name": "Odbcconf"}, {"_id": 524, "body": "\u003cb\u003eAliases:\u003c/b\u003e PittyTiger\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [PittyTiger](https://attack.mitre.org/groups/G0011) is a threat group believed to operate out of China that uses multiple different types of malware to maintain command and control. (Citation: Bizeul 2014) (Citation: Villeneuve 2014)", "color": "#fce903", "group": 5, "header": "G0011", "name": "PittyTiger", "width": 10}, {"_id": 525, "body": "[Lurid](https://attack.mitre.org/software/S0010) is a malware family that has been used by several groups, including [PittyTiger](https://attack.mitre.org/groups/G0011), in targeted attacks as far back as 2006. (Citation: Villeneuve 2014) (Citation: Villeneuve 2011)", "color": "#ff3232", "header": "S0010", "name": "Lurid"}, {"_id": 526, "body": "[gh0st RAT](https://attack.mitre.org/software/S0032) is a remote access tool (RAT). The source code is public and it has been used by multiple groups. (Citation: FireEye Hacking Team)(Citation: Arbor Musical Chairs Feb 2018)(Citation: Nccgroup Gh0st April 2018)", "color": "#ff3232", "header": "S0032", "name": "gh0st RAT"}, {"_id": 527, "body": "\u003cb\u003eAliases:\u003c/b\u003e Stealth Falcon\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Stealth Falcon](https://attack.mitre.org/groups/G0038) is a threat group that has conducted targeted spyware attacks against Emirati journalists, activists, and dissidents since at least 2012. Circumstantial evidence suggests there could be a link between this group and the United Arab Emirates (UAE) government, but that has not been confirmed. (Citation: Citizen Lab Stealth Falcon May 2016)", "color": "#fce903", "group": 5, "header": "G0038", "name": "Stealth Falcon", "width": 10}, {"_id": 528, "body": "\u003cb\u003eAliases:\u003c/b\u003e FIN8\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [FIN8](https://attack.mitre.org/groups/G0061) is a financially motivated threat group known to launch tailored spearphishing campaigns targeting the retail, restaurant, and hospitality industries. (Citation: FireEye Obfuscation June 2017) (Citation: FireEye Fin8 May 2016)", "color": "#fce903", "group": 5, "header": "G0061", "name": "FIN8", "width": 10}, {"_id": 529, "body": "[dsquery](https://attack.mitre.org/software/S0105) is a command-line utility that can be used to query Active Directory for information from a system within a domain. (Citation: TechNet Dsquery) It is typically installed only on Windows Server versions but can be installed on non-server variants through the Microsoft-provided Remote Server Administration Tools bundle.", "color": "#ff1a8c", "header": "S0105", "name": "dsquery"}, {"_id": 530, "body": "[PUNCHTRACK](https://attack.mitre.org/software/S0197) is non-persistent point of sale (POS) system malware utilized by [FIN8](https://attack.mitre.org/groups/G0061) to scrape payment card data. (Citation: FireEye Fin8 May 2016) (Citation: FireEye Know Your Enemy FIN8 Aug 2016)", "color": "#ff3232", "header": "S0197", "name": "PUNCHTRACK"}, {"_id": 531, "body": "[PUNCHBUGGY](https://attack.mitre.org/software/S0196) is a backdoor malware used by [FIN8](https://attack.mitre.org/groups/G0061) that has been observed targeting POS networks in the hospitality industry. (Citation: Morphisec ShellTea June 2019)(Citation: FireEye Fin8 May 2016) (Citation: FireEye Know Your Enemy FIN8 Aug 2016)", "color": "#ff3232", "header": "S0196", "name": "PUNCHBUGGY"}, {"_id": 532, "body": "\u003cb\u003eTactics:\u003c/b\u003e privilege-escalation, persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[PUNCHBUGGY](https://attack.mitre.org/software/S0196) can establish using a AppCertDLLs Registry key.(Citation: FireEye Know Your Enemy FIN8 Aug 2016)", "header": "T1546.009", "name": "AppCert DLLs"}, {"_id": 533, "body": "\u003cb\u003eAliases:\u003c/b\u003e APT30\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [APT30](https://attack.mitre.org/groups/G0013) is a threat group suspected to be associated with the Chinese government. While [Naikon](https://attack.mitre.org/groups/G0019) shares some characteristics with [APT30](https://attack.mitre.org/groups/G0013), the two groups do not appear to be exact matches.(Citation: FireEye APT30)(Citation: Baumgartner Golovkin Naikon 2015)", "color": "#fce903", "group": 5, "header": "G0013", "name": "APT30", "width": 10}, {"_id": 534, "body": "[SHIPSHAPE](https://attack.mitre.org/software/S0028) is malware developed by [APT30](https://attack.mitre.org/groups/G0013) that allows propagation and exfiltration of data over removable devices. [APT30](https://attack.mitre.org/groups/G0013) may use this capability to exfiltrate data across air-gaps. (Citation: FireEye APT30)", "color": "#ff3232", "header": "S0028", "name": "SHIPSHAPE"}, {"_id": 535, "body": "[BACKSPACE](https://attack.mitre.org/software/S0031) is a backdoor used by [APT30](https://attack.mitre.org/groups/G0013) that dates back to at least 2005. (Citation: FireEye APT30)", "color": "#ff3232", "header": "S0031", "name": "BACKSPACE"}, {"_id": 536, "body": "[NETEAGLE](https://attack.mitre.org/software/S0034) is a backdoor developed by [APT30](https://attack.mitre.org/groups/G0013) with compile dates as early as 2008. It has two main variants known as \u201cScout\u201d and \u201cNorton.\u201d (Citation: FireEye APT30)", "color": "#ff3232", "header": "S0034", "name": "NETEAGLE"}, {"_id": 537, "body": "[FLASHFLOOD](https://attack.mitre.org/software/S0036) is malware developed by [APT30](https://attack.mitre.org/groups/G0013) that allows propagation and exfiltration of data over removable devices. [APT30](https://attack.mitre.org/groups/G0013) may use this capability to exfiltrate data across air-gaps. (Citation: FireEye APT30)", "color": "#ff3232", "header": "S0036", "name": "FLASHFLOOD"}, {"_id": 538, "body": "[SPACESHIP](https://attack.mitre.org/software/S0035) is malware developed by [APT30](https://attack.mitre.org/groups/G0013) that allows propagation and exfiltration of data over removable devices. [APT30](https://attack.mitre.org/groups/G0013) may use this capability to exfiltrate data across air-gaps. (Citation: FireEye APT30)", "color": "#ff3232", "header": "S0035", "name": "SPACESHIP"}, {"_id": 539, "body": "\u003cb\u003eAliases:\u003c/b\u003e Deep Panda, Shell Crew, WebMasters, KungFu Kittens, PinkPanther, Black Vine\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Deep Panda](https://attack.mitre.org/groups/G0009) is a suspected Chinese threat group known to target many industries, including government, defense, financial, and telecommunications. (Citation: Alperovitch 2014) The intrusion into healthcare company Anthem has been attributed to [Deep Panda](https://attack.mitre.org/groups/G0009). (Citation: ThreatConnect Anthem) This group is also known as Shell Crew, WebMasters, KungFu Kittens, and PinkPanther. (Citation: RSA Shell Crew) [Deep Panda](https://attack.mitre.org/groups/G0009) also appears to be known as Black Vine based on the attribution of both group names to the Anthem intrusion. (Citation: Symantec Black Vine) Some analysts track [Deep Panda](https://attack.mitre.org/groups/G0009) and [APT19](https://attack.mitre.org/groups/G0073) as the same group, but it is unclear from open source information if the groups are the same. (Citation: ICIT China\u0027s Espionage Jul 2016)", "color": "#fce903", "group": 5, "header": "G0009", "name": "Deep Panda", "width": 10}, {"_id": 540, "body": "[Sakula](https://attack.mitre.org/software/S0074) is a remote access tool (RAT) that first surfaced in 2012 and was used in intrusions throughout 2015. (Citation: Dell Sakula)", "color": "#ff3232", "header": "S0074", "name": "Sakula"}, {"_id": 541, "body": "[StreamEx](https://attack.mitre.org/software/S0142) is a malware family that has been used by [Deep Panda](https://attack.mitre.org/groups/G0009) since at least 2015. In 2016, it was distributed via legitimate compromised Korean websites. (Citation: Cylance Shell Crew Feb 2017)", "color": "#ff3232", "header": "S0142", "name": "StreamEx"}, {"_id": 542, "body": "[Mivast](https://attack.mitre.org/software/S0080) is a backdoor that has been used by [Deep Panda](https://attack.mitre.org/groups/G0009). It was reportedly used in the Anthem breach. (Citation: Symantec Black Vine)", "color": "#ff3232", "header": "S0080", "name": "Mivast"}, {"_id": 543, "body": "\u003cb\u003eAliases:\u003c/b\u003e Poseidon Group\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Poseidon Group](https://attack.mitre.org/groups/G0033) is a Portuguese-speaking threat group that has been active since at least 2005. The group has a history of using information exfiltrated from victims to blackmail victim companies into contracting the [Poseidon Group](https://attack.mitre.org/groups/G0033) as a security firm. (Citation: Kaspersky Poseidon Group)", "color": "#fce903", "group": 5, "header": "G0033", "name": "Poseidon Group", "width": 10}, {"_id": 544, "body": "\u003cb\u003eAliases:\u003c/b\u003e Honeybee\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Honeybee](https://attack.mitre.org/groups/G0072) is a campaign led by an unknown actor that targets humanitarian aid organizations and has been active in Vietnam, Singapore, Argentina, Japan, Indonesia, and Canada. It has been an active operation since August of 2017 and as recently as February 2018. (Citation: McAfee Honeybee)", "color": "#fce903", "group": 5, "header": "G0072", "name": "Honeybee", "width": 10}, {"_id": 545, "body": "\u003cb\u003eAliases:\u003c/b\u003e Elderwood, Elderwood Gang, Beijing Group, Sneaky Panda\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Elderwood](https://attack.mitre.org/groups/G0066) is a suspected Chinese cyber espionage group that was reportedly responsible for the 2009 Google intrusion known as Operation Aurora. (Citation: Security Affairs Elderwood Sept 2012) The group has targeted defense organizations, supply chain manufacturers, human rights and nongovernmental organizations (NGOs), and IT service providers. (Citation: Symantec Elderwood Sept 2012) (Citation: CSM Elderwood Sept 2012)", "color": "#fce903", "group": 5, "header": "G0066", "name": "Elderwood", "width": 10}, {"_id": 546, "body": "[Linfo](https://attack.mitre.org/software/S0211) is a rootkit trojan used by [Elderwood](https://attack.mitre.org/groups/G0066) to open a backdoor on compromised hosts. (Citation: Symantec Elderwood Sept 2012) (Citation: Symantec Linfo May 2012)", "color": "#ff3232", "header": "S0211", "name": "Linfo"}, {"_id": 547, "body": "[Briba](https://attack.mitre.org/software/S0204) is a trojan used by [Elderwood](https://attack.mitre.org/groups/G0066) to open a backdoor and download files on to compromised hosts. (Citation: Symantec Elderwood Sept 2012) (Citation: Symantec Briba May 2012)", "color": "#ff3232", "header": "S0204", "name": "Briba"}, {"_id": 548, "body": "[Naid](https://attack.mitre.org/software/S0205) is a trojan used by [Elderwood](https://attack.mitre.org/groups/G0066) to open a backdoor on compromised hosts. (Citation: Symantec Elderwood Sept 2012) (Citation: Symantec Naid June 2012)", "color": "#ff3232", "header": "S0205", "name": "Naid"}, {"_id": 549, "body": "[Hydraq](https://attack.mitre.org/software/S0203) is a data-theft trojan first used by [Elderwood](https://attack.mitre.org/groups/G0066) in the 2009 Google intrusion known as Operation Aurora, though variations of this trojan have been used in more recent campaigns by other Chinese actors, possibly including [APT17](https://attack.mitre.org/groups/G0025). (Citation: MicroFocus 9002 Aug 2016) (Citation: Symantec Elderwood Sept 2012) (Citation: Symantec Trojan.Hydraq Jan 2010) (Citation: ASERT Seven Pointed Dagger Aug 2015) (Citation: FireEye DeputyDog 9002 November 2013) (Citation: ProofPoint GoT 9002 Aug 2017) (Citation: FireEye Sunshop Campaign May 2013) (Citation: PaloAlto 3102 Sept 2015)", "color": "#ff3232", "header": "S0203", "name": "Hydraq"}, {"_id": 550, "body": "\u003cb\u003eTactic:\u003c/b\u003e exfiltration\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Hydraq](https://attack.mitre.org/software/S0203) connects to a predefined domain on port 443 to exfil gathered information.(Citation: Symantec Hydraq Jan 2010)", "header": "T1048", "name": "Exfiltration Over Alternative Protocol"}, {"_id": 551, "body": "[Nerex](https://attack.mitre.org/software/S0210) is a Trojan used by [Elderwood](https://attack.mitre.org/groups/G0066) to open a backdoor on compromised hosts. (Citation: Symantec Elderwood Sept 2012) (Citation: Symantec Nerex May 2012)", "color": "#ff3232", "header": "S0210", "name": "Nerex"}, {"_id": 552, "body": "[Wiarp](https://attack.mitre.org/software/S0206) is a trojan used by [Elderwood](https://attack.mitre.org/groups/G0066) to open a backdoor on compromised hosts. (Citation: Symantec Elderwood Sept 2012) (Citation: Symantec Wiarp May 2012)", "color": "#ff3232", "header": "S0206", "name": "Wiarp"}, {"_id": 553, "body": "[Vasport](https://attack.mitre.org/software/S0207) is a trojan used by [Elderwood](https://attack.mitre.org/groups/G0066) to open a backdoor on compromised hosts. (Citation: Symantec Elderwood Sept 2012) (Citation: Symantec Vasport May 2012)", "color": "#ff3232", "header": "S0207", "name": "Vasport"}, {"_id": 554, "body": "[Pasam](https://attack.mitre.org/software/S0208) is a trojan used by [Elderwood](https://attack.mitre.org/groups/G0066) to open a backdoor on compromised hosts. (Citation: Symantec Elderwood Sept 2012) (Citation: Symantec Pasam May 2012)", "color": "#ff3232", "header": "S0208", "name": "Pasam"}, {"_id": 555, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Pasam](https://attack.mitre.org/software/S0208) establishes by infecting the Security Accounts Manager (SAM) DLL to load a malicious DLL dropped to disk.(Citation: Symantec Pasam May 2012)", "header": "T1547.008", "name": "LSASS Driver"}, {"_id": 556, "body": "\u003cb\u003eAliases:\u003c/b\u003e CopyKittens\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [CopyKittens](https://attack.mitre.org/groups/G0052) is an Iranian cyber espionage group that has been operating since at least 2013. It has targeted countries including Israel, Saudi Arabia, Turkey, the U.S., Jordan, and Germany. The group is responsible for the campaign known as Operation Wilted Tulip. (Citation: ClearSky CopyKittens March 2017) (Citation: ClearSky Wilted Tulip July 2017) (Citation: CopyKittens Nov 2015)", "color": "#fce903", "group": 5, "header": "G0052", "name": "CopyKittens", "width": 10}, {"_id": 557, "body": "[TDTESS](https://attack.mitre.org/software/S0164) is a 64-bit .NET binary backdoor used by [CopyKittens](https://attack.mitre.org/groups/G0052). (Citation: ClearSky Wilted Tulip July 2017)", "color": "#ff3232", "header": "S0164", "name": "TDTESS"}, {"_id": 558, "body": "[Matryoshka](https://attack.mitre.org/software/S0167) is a malware framework used by [CopyKittens](https://attack.mitre.org/groups/G0052) that consists of a dropper, loader, and RAT. It has multiple versions; v1 was seen in the wild from July 2016 until January 2017. v2 has fewer commands and other minor differences. (Citation: ClearSky Wilted Tulip July 2017) (Citation: CopyKittens Nov 2015)", "color": "#ff3232", "header": "S0167", "name": "Matryoshka"}, {"_id": 559, "body": "\u003cb\u003eAliases:\u003c/b\u003e APT18, TG-0416, Dynamite Panda, Threat Group-0416\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [APT18](https://attack.mitre.org/groups/G0026) is a threat group that has operated since at least 2009 and has targeted a range of industries, including technology, manufacturing, human rights groups, government, and medical. (Citation: Dell Lateral Movement)", "color": "#fce903", "group": 5, "header": "G0026", "name": "APT18", "width": 10}, {"_id": 560, "body": "[HTTPBrowser](https://attack.mitre.org/software/S0070) is malware that has been used by several threat groups. (Citation: ThreatStream Evasion Analysis) (Citation: Dell TG-3390) It is believed to be of Chinese origin. (Citation: ThreatConnect Anthem)", "color": "#ff3232", "header": "S0070", "name": "HTTPBrowser"}, {"_id": 561, "body": "[P
