isloader](https://attack.mitre.org/software/S0124) is a malware family that is notable due to its use of DNS as a C2 protocol as well as its use of anti-analysis tactics. It has been used by [APT18](https://attack.mitre.org/groups/G0026) and is similar to another malware family, [HTTPBrowser](https://attack.mitre.org/software/S0070), that has been used by the group. (Citation: Palo Alto DNS Requests)", "color": "#ff3232", "header": "S0124", "name": "Pisloader"}, {"_id": 562, "body": "[hcdLoader](https://attack.mitre.org/software/S0071) is a remote access tool (RAT) that has been used by [APT18](https://attack.mitre.org/groups/G0026). (Citation: Dell Lateral Movement)", "color": "#ff3232", "header": "S0071", "name": "hcdLoader"}, {"_id": 563, "body": "\u003cb\u003eAliases:\u003c/b\u003e Scarlet Mimic\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Scarlet Mimic](https://attack.mitre.org/groups/G0029) is a threat group that has targeted minority rights activists. This group has not been directly linked to a government source, but the group\u0027s motivations appear to overlap with those of the Chinese government. While there is some overlap between IP addresses used by [Scarlet Mimic](https://attack.mitre.org/groups/G0029) and [Putter Panda](https://attack.mitre.org/groups/G0024), it has not been concluded that the groups are the same. (Citation: Scarlet Mimic Jan 2016)", "color": "#fce903", "group": 5, "header": "G0029", "name": "Scarlet Mimic", "width": 10}, {"_id": 564, "body": "[Psylo](https://attack.mitre.org/software/S0078) is a shellcode-based Trojan that has been used by [Scarlet Mimic](https://attack.mitre.org/groups/G0029). It has similar characteristics as [FakeM](https://attack.mitre.org/software/S0076). (Citation: Scarlet Mimic Jan 2016)", "color": "#ff3232", "header": "S0078", "name": "Psylo"}, {"_id": 565, "body": "[CallMe](https://attack.mitre.org/software/S0077) is a Trojan designed to run on Apple OSX. It is based on a publicly available tool called Tiny SHell. (Citation: Scarlet Mimic Jan 2016)", "color": "#ff3232", "header": "S0077", "name": "CallMe"}, {"_id": 566, "body": "[FakeM](https://attack.mitre.org/software/S0076) is a shellcode-based Windows backdoor that has been used by [Scarlet Mimic](https://attack.mitre.org/groups/G0029). (Citation: Scarlet Mimic Jan 2016)", "color": "#ff3232", "header": "S0076", "name": "FakeM"}, {"_id": 567, "body": "[MobileOrder](https://attack.mitre.org/software/S0079) is a Trojan intended to compromise Android mobile devices. It has been used by [Scarlet Mimic](https://attack.mitre.org/groups/G0029). (Citation: Scarlet Mimic Jan 2016)", "color": "#ff3232", "header": "S0079", "name": "MobileOrder"}, {"_id": 568, "body": "[MobileOrder](https://attack.mitre.org/software/S0079) uses AES to encrypt C2 communications.(Citation: Scarlet Mimic Jan 2016)", "header": "T1032", "name": "Standard Cryptographic Protocol"}, {"_id": 569, "body": "\u003cb\u003eAliases:\u003c/b\u003e APT32, SeaLotus, OceanLotus, APT-C-00\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [APT32](https://attack.mitre.org/groups/G0050) is a threat group that has been active since at least 2014. The group has targeted multiple private sector industries as well as with foreign governments, dissidents, and journalists with a strong focus on Southeast Asian countries like Vietnam, the Philippines, Laos, and Cambodia. They have extensively used strategic web compromises to compromise victims. The group is believed to be Vietnam-based.(Citation: FireEye APT32 May 2017)(Citation: Volexity OceanLotus Nov 2017)(Citation: ESET OceanLotus)", "color": "#fce903", "group": 5, "header": "G0050", "name": "APT32", "width": 10}, {"_id": 570, "body": "\u003cb\u003eTactics:\u003c/b\u003e execution, lateral-movement\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT32](https://attack.mitre.org/groups/G0050) compromised McAfee ePO to move laterally by distributing malware as a software deployment task.(Citation: FireEye APT32 May 2017)", "header": "T1072", "name": "Software Deployment Tools"}, {"_id": 571, "body": "[KOMPROGO](https://attack.mitre.org/software/S0156) is a signature backdoor used by [APT32](https://attack.mitre.org/groups/G0050) that is capable of process, file, and registry management. (Citation: FireEye APT32 May 2017)", "color": "#ff3232", "header": "S0156", "name": "KOMPROGO"}, {"_id": 572, "body": "[WINDSHIELD](https://attack.mitre.org/software/S0155) is a signature backdoor used by [APT32](https://attack.mitre.org/groups/G0050). (Citation: FireEye APT32 May 2017)", "color": "#ff3232", "header": "S0155", "name": "WINDSHIELD"}, {"_id": 573, "body": "[Denis](https://attack.mitre.org/software/S0354) is a Windows backdoor and Trojan used by [APT32](https://attack.mitre.org/groups/G0050). [Denis](https://attack.mitre.org/software/S0354) shares several similarities to the [SOUNDBITE](https://attack.mitre.org/software/S0157) backdoor and has been used in conjunction with the [Goopy](https://attack.mitre.org/software/S0477) backdoor.(Citation: Cybereason Oceanlotus May 2017)", "color": "#ff3232", "header": "S0354", "name": "Denis"}, {"_id": 574, "body": "[SOUNDBITE](https://attack.mitre.org/software/S0157) is a signature backdoor used by [APT32](https://attack.mitre.org/groups/G0050). (Citation: FireEye APT32 May 2017)", "color": "#ff3232", "header": "S0157", "name": "SOUNDBITE"}, {"_id": 575, "body": "[PHOREAL](https://attack.mitre.org/software/S0158) is a signature backdoor used by [APT32](https://attack.mitre.org/groups/G0050). (Citation: FireEye APT32 May 2017)", "color": "#ff3232", "header": "S0158", "name": "PHOREAL"}, {"_id": 576, "body": "[Arp](https://attack.mitre.org/software/S0099) displays information about a system\u0027s Address Resolution Protocol (ARP) cache. (Citation: TechNet Arp)", "color": "#ff1a8c", "header": "S0099", "name": "Arp"}, {"_id": 577, "body": "\u003cb\u003eTactic:\u003c/b\u003e persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT32](https://attack.mitre.org/groups/G0050) have replaced Microsoft Outlook\u0027s VbaProject.OTM file to install a backdoor macro for persistence.(Citation: Cybereason Oceanlotus May 2017)(Citation: Cybereason Cobalt Kitty 2017)", "header": "T1137", "name": "Office Application Startup"}, {"_id": 578, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT32](https://attack.mitre.org/groups/G0050) has used PubPrn.vbs within execution scripts to execute malware, possibly bypassing defenses.(Citation: Twitter ItsReallyNick Status Update APT32 PubPrn)", "header": "T1216.001", "name": "PubPrn"}, {"_id": 579, "body": "[OSX_OCEANLOTUS.D](https://attack.mitre.org/software/S0352) is a MacOS backdoor with several variants that has been used by [APT32](https://attack.mitre.org/groups/G0050).(Citation: TrendMicro MacOS April 2018)(Citation: Trend Micro MacOS Backdoor November 2020)", "color": "#ff3232", "header": "S0352", "name": "OSX_OCEANLOTUS.D"}, {"_id": 580, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[OSX_OCEANLOTUS.D](https://attack.mitre.org/software/S0352) can delete the file quarantine attribute.(Citation: Trend Micro MacOS Backdoor November 2020)", "header": "T1553.001", "name": "Gatekeeper Bypass"}, {"_id": 581, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT32](https://attack.mitre.org/groups/G0050)\u0027s macOS backdoor changes the permission of the file it wants to execute to 755.(Citation: ESET OceanLotus macOS April 2019)", "header": "T1222.002", "name": "Linux and Mac File and Directory Permissions Modification"}, {"_id": 582, "body": "[Goopy](https://attack.mitre.org/software/S0477) is a Windows backdoor and Trojan used by [APT32](https://attack.mitre.org/groups/G0050) and shares several similarities to another backdoor used by the group ([Denis](https://attack.mitre.org/software/S0354)). [Goopy](https://attack.mitre.org/software/S0477) is named for its impersonation of the legitimate Google Updater executable.(Citation: Cybereason Cobalt Kitty 2017)", "color": "#ff3232", "header": "S0477", "name": "Goopy"}, {"_id": 583, "body": "\u003cb\u003eTactic:\u003c/b\u003e reconnaissance\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT32](https://attack.mitre.org/groups/G0050) has collected e-mail addresses for activists and bloggers in order to target them with spyware.(Citation: Amnesty Intl. Ocean Lotus February 2021)", "header": "T1589.002", "name": "Email Addresses"}, {"_id": 584, "body": "\u003cb\u003eTactic:\u003c/b\u003e reconnaissance\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT32](https://attack.mitre.org/groups/G0050) has conducted targeted surveillance against activists and bloggers.(Citation: Amnesty Intl. Ocean Lotus February 2021)", "header": "T1589", "name": "Gather Victim Identity Information"}, {"_id": 585, "body": "\u003cb\u003eTactic:\u003c/b\u003e resource-development\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT32](https://attack.mitre.org/groups/G0050) has stood up websites containing numerous articles and content scraped from the Internet to make them appear legitimate, but some of these pages include malicious JavaScript to profile the potential victim or infect them via a fake software update.(Citation: Volexity Ocean Lotus November 2020)", "header": "T1608.004", "name": "Drive-by Target"}, {"_id": 586, "body": "\u003cb\u003eTactic:\u003c/b\u003e resource-development\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT32](https://attack.mitre.org/groups/G0050) has hosted malicious payloads in Dropbox, Amazon S3, and Google Drive for use during targeting.(Citation: Volexity Ocean Lotus November 2020)", "header": "T1608.001", "name": "Upload Malware"}, {"_id": 587, "body": "\u003cb\u003eAliases:\u003c/b\u003e Orangeworm\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Orangeworm](https://attack.mitre.org/groups/G0071) is a group that has targeted organizations in the healthcare sector in the United States, Europe, and Asia since at least 2015, likely for the purpose of corporate espionage. (Citation: Symantec Orangeworm April 2018)", "color": "#fce903", "group": 5, "header": "G0071", "name": "Orangeworm", "width": 10}, {"_id": 588, "body": "[route](https://attack.mitre.org/software/S0103) can be used to find or change information within the local system IP routing table. (Citation: TechNet Route)", "color": "#ff1a8c", "header": "S0103", "name": "route"}, {"_id": 589, "body": "[Kwampirs](https://attack.mitre.org/software/S0236) is a backdoor Trojan used by [Orangeworm](https://attack.mitre.org/groups/G0071). It has been found on machines which had software installed for the use and control of high-tech imaging devices such as X-Ray and MRI machines. (Citation: Symantec Orangeworm April 2018)", "color": "#ff3232", "header": "S0236", "name": "Kwampirs"}, {"_id": 590, "body": "\u003cb\u003eAliases:\u003c/b\u003e Threat Group-3390, TG-3390, Emissary Panda, BRONZE UNION, APT27, Iron Tiger, LuckyMouse\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Threat Group-3390](https://attack.mitre.org/groups/G0027) is a Chinese threat group that has extensively used strategic Web compromises to target victims. (Citation: Dell TG-3390) The group has been active since at least 2010 and has targeted organizations in the aerospace, government, defense, technology, energy, and manufacturing sectors. (Citation: SecureWorks BRONZE UNION June 2017) (Citation: Securelist LuckyMouse June 2018)", "color": "#fce903", "group": 5, "header": "G0027", "name": "Threat Group-3390", "width": 10}, {"_id": 591, "body": "[OwaAuth](https://attack.mitre.org/software/S0072) is a Web shell and credential stealer deployed to Microsoft Exchange servers that appears to be exclusively used by [Threat Group-3390](https://attack.mitre.org/groups/G0027). (Citation: Dell TG-3390)", "color": "#ff3232", "header": "S0072", "name": "OwaAuth"}, {"_id": 592, "body": "[HyperBro](https://attack.mitre.org/software/S0398) is a custom in-memory backdoor used by [Threat Group-3390](https://attack.mitre.org/groups/G0027).(Citation: Unit42 Emissary Panda May 2019)(Citation: Securelist LuckyMouse June 2018)(Citation: Hacker News LuckyMouse June 2018)", "color": "#ff3232", "header": "S0398", "name": "HyperBro"}, {"_id": 593, "body": "[ZxShell](https://attack.mitre.org/software/S0412) is a remote administration tool and backdoor that can be downloaded from the Internet, particularly from Chinese hacker websites. It has been used since at least 2004.(Citation: FireEye APT41 Aug 2019)(Citation: Talos ZxShell Oct 2014 )", "color": "#ff3232", "header": "S0412", "name": "ZxShell"}, {"_id": 594, "body": "\u003cb\u003eTactic:\u003c/b\u003e lateral-movement\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[ZxShell](https://attack.mitre.org/software/S0412) supports functionality for VNC sessions.(Citation: Talos ZxShell Oct 2014 ) ", "header": "T1021.005", "name": "VNC"}, {"_id": 595, "body": "[NBTscan](https://attack.mitre.org/software/S0590) is an open source tool that has been used by state groups to conduct internal reconnaissance within a compromised network.(Citation: Debian nbtscan Nov 2019)(Citation: SecTools nbtscan June 2003)(Citation: Symantec Waterbug Jun 2019)(Citation: FireEye APT39 Jan 2019)", "color": "#ff1a8c", "header": "S0590", "name": "NBTscan"}, {"_id": 596, "body": "\u003cb\u003eTactic:\u003c/b\u003e resource-development\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Threat Group-3390](https://attack.mitre.org/groups/G0027) has staged tools, including [gsecdump](https://attack.mitre.org/software/S0008) and WCE, on previously compromised websites.(Citation: Dell TG-3390)", "header": "T1608.002", "name": "Upload Tool"}, {"_id": 597, "body": "\u003cb\u003eAliases:\u003c/b\u003e FIN5\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [FIN5](https://attack.mitre.org/groups/G0053) is a financially motivated threat group that has targeted personally identifiable information and payment card information. The group has been active since at least 2008 and has targeted the restaurant, gaming, and hotel industries. The group is made up of actors who likely speak Russian. (Citation: FireEye Respond Webinar July 2017) (Citation: Mandiant FIN5 GrrCON Oct 2016) (Citation: DarkReading FireEye FIN5 Oct 2015)", "color": "#fce903", "group": 5, "header": "G0053", "name": "FIN5", "width": 10}, {"_id": 598, "body": "[RawPOS](https://attack.mitre.org/software/S0169) is a point-of-sale (POS) malware family that searches for cardholder data on victims. It has been in use since at least 2008. (Citation: Kroll RawPOS Jan 2017) (Citation: TrendMicro RawPOS April 2015) (Citation: Visa RawPOS March 2015) FireEye divides RawPOS into three components: FIENDCRY, DUEBREW, and DRIFTWOOD. (Citation: Mandiant FIN5 GrrCON Oct 2016) (Citation: DarkReading FireEye FIN5 Oct 2015)", "color": "#ff3232", "header": "S0169", "name": "RawPOS"}, {"_id": 599, "body": "[FLIPSIDE](https://attack.mitre.org/software/S0173) is a simple tool similar to Plink that is used by [FIN5](https://attack.mitre.org/groups/G0053) to maintain access to victims. (Citation: Mandiant FIN5 GrrCON Oct 2016)", "color": "#ff3232", "header": "S0173", "name": "FLIPSIDE"}, {"_id": 600, "body": "\u003cb\u003eAliases:\u003c/b\u003e Magic Hound, COBALT ILLUSION, Charming Kitten, ITG18, Phosphorus, Newscaster, APT35\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Magic Hound](https://attack.mitre.org/groups/G0059) is an Iranian-sponsored threat group that conducts long term, resource-intensive cyber espionage operations, dating back as early as 2014. The group typically targets U.S. and Middle Eastern military organizations, as well as other government personnel, via complex social engineering campaigns.(Citation: FireEye APT35 2018)", "color": "#fce903", "group": 5, "header": "G0059", "name": "Magic Hound", "width": 10}, {"_id": 601, "body": "[DownPaper](https://attack.mitre.org/software/S0186) is a backdoor Trojan; its main functionality is to download and run second stage malware. (Citation: ClearSky Charming Kitten Dec 2017)", "color": "#ff3232", "header": "S0186", "name": "DownPaper"}, {"_id": 602, "body": "\u003cb\u003eAliases:\u003c/b\u003e DarkHydrus\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [DarkHydrus](https://attack.mitre.org/groups/G0079) is a threat group that has targeted government agencies and educational institutions in the Middle East since at least 2016. The group heavily leverages open-source tools and custom payloads for carrying out attacks. (Citation: Unit 42 DarkHydrus July 2018) (Citation: Unit 42 Playbook Dec 2017)", "color": "#fce903", "group": 5, "header": "G0079", "name": "DarkHydrus", "width": 10}, {"_id": 603, "body": "[RogueRobin](https://attack.mitre.org/software/S0270) is a payload used by [DarkHydrus](https://attack.mitre.org/groups/G0079) that has been developed in PowerShell and C#. (Citation: Unit 42 DarkHydrus July 2018)(Citation: Unit42 DarkHydrus Jan 2019)", "color": "#ff3232", "header": "S0270", "name": "RogueRobin"}, {"_id": 604, "body": "\u003cb\u003eAliases:\u003c/b\u003e Dark Caracal\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Dark Caracal](https://attack.mitre.org/groups/G0070) is threat group that has been attributed to the Lebanese General Directorate of General Security (GDGS) and has operated since at least 2012. (Citation: Lookout Dark Caracal Jan 2018)", "color": "#fce903", "group": 5, "header": "G0070", "name": "Dark Caracal", "width": 10}, {"_id": 605, "body": "[FinFisher](https://attack.mitre.org/software/S0182) is a government-grade commercial surveillance spyware reportedly sold exclusively to government agencies for use in targeted and lawful criminal investigations. It is heavily obfuscated and uses multiple anti-analysis techniques. It has other variants including [Wingbird](https://attack.mitre.org/software/S0176). (Citation: FinFisher Citation) (Citation: Microsoft SIR Vol 21) (Citation: FireEye FinSpy Sept 2017) (Citation: Securelist BlackOasis Oct 2017) (Citation: Microsoft FinFisher March 2018)", "color": "#ff3232", "header": "S0182", "name": "FinFisher"}, {"_id": 606, "body": "[Bandook](https://attack.mitre.org/software/S0234) is a commercially available RAT, written in Delphi, which has been available since roughly 2007  (Citation: EFF Manul Aug 2016) (Citation: Lookout Dark Caracal Jan 2018).", "color": "#ff3232", "header": "S0234", "name": "Bandook"}, {"_id": 607, "body": "[CrossRAT](https://attack.mitre.org/software/S0235) is a cross platform RAT.", "color": "#ff3232", "header": "S0235", "name": "CrossRAT"}, {"_id": 608, "body": "\u003cb\u003eAliases:\u003c/b\u003e MuddyWater, Earth Vetala , MERCURY, Static Kitten, Seedworm, TEMP.Zagros\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [MuddyWater](https://attack.mitre.org/groups/G0069) is an Iranian threat group that has primarily targeted Middle Eastern nations, and has also targeted European and North American nations. The group\u0027s victims are mainly in the telecommunications, government (IT services), and oil sectors. Activity from this group was previously linked to [FIN7](https://attack.mitre.org/groups/G0046), but the group is believed to be a distinct group possibly motivated by espionage.(Citation: Unit 42 MuddyWater Nov 2017)(Citation: Symantec MuddyWater Dec 2018)(Citation: ClearSky MuddyWater Nov 2018)(Citation: ClearSky MuddyWater June 2019)(Citation: Reaqta MuddyWater November 2017)", "color": "#fce903", "group": 5, "header": "G0069", "name": "MuddyWater", "width": 10}, {"_id": 609, "body": "[POWERSTATS](https://attack.mitre.org/software/S0223) is a PowerShell-based first stage backdoor used by [MuddyWater](https://attack.mitre.org/groups/G0069). (Citation: Unit 42 MuddyWater Nov 2017)", "color": "#ff3232", "header": "S0223", "name": "POWERSTATS"}, {"_id": 610, "body": "\u003cb\u003eTactic:\u003c/b\u003e execution\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[POWERSTATS](https://attack.mitre.org/software/S0223) can use DCOM (targeting the 127.0.0.1 loopback address) to execute additional payloads on compromised hosts.(Citation: FireEye MuddyWater Mar 2018)", "header": "T1559.001", "name": "Component Object Model"}, {"_id": 611, "body": "[SHARPSTATS](https://attack.mitre.org/software/S0450) is a .NET backdoor used by [MuddyWater](https://attack.mitre.org/groups/G0069) since at least 2019.(Citation: TrendMicro POWERSTATS V3 June 2019)", "color": "#ff3232", "header": "S0450", "name": "SHARPSTATS"}, {"_id": 612, "body": "\u003cb\u003eTactic:\u003c/b\u003e resource-development\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[MuddyWater](https://attack.mitre.org/groups/G0069) has made use of  legitimate tools [ConnectWise](https://attack.mitre.org/software/S0591) and [RemoteUtilities](https://attack.mitre.org/software/S0592) for access to target environments.(Citation: Anomali Static Kitten February 2021)", "header": "T1588.002", "name": "Tool"}, {"_id": 613, "body": "[ConnectWise](https://attack.mitre.org/software/S0591) is a legitimate remote administration tool that has been used since at least 2016 by threat actors including [MuddyWater](https://attack.mitre.org/groups/G0069) and [GOLD SOUTHFIELD](https://attack.mitre.org/groups/G0115) to connect to and conduct lateral movement in target environments.(Citation: Anomali Static Kitten February 2021)(Citation: Trend Micro Muddy Water March 2021)", "color": "#ff1a8c", "header": "S0591", "name": "ConnectWise"}, {"_id": 614, "body": "[RemoteUtilities](https://attack.mitre.org/software/S0592) is a legitimate remote administration tool that has been used by [MuddyWater](https://attack.mitre.org/groups/G0069) since at least 2021 for execution on target machines.(Citation: Trend Micro Muddy Water March 2021)", "color": "#ff1a8c", "header": "S0592", "name": "RemoteUtilities"}, {"_id": 615, "body": "[Out1](https://attack.mitre.org/software/S0594) is a remote access tool written in python and used by [MuddyWater](https://attack.mitre.org/groups/G0069) since at least 2021.(Citation: Trend Micro Muddy Water March 2021)", "color": "#ff1a8c", "header": "S0594", "name": "Out1"}, {"_id": 616, "body": "\u003cb\u003eAliases:\u003c/b\u003e GCMAN\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [GCMAN](https://attack.mitre.org/groups/G0036) is a threat group that focuses on targeting banks for the purpose of transferring money to e-currency services. (Citation: Securelist GCMAN)", "color": "#fce903", "group": 5, "header": "G0036", "name": "GCMAN", "width": 10}, {"_id": 617, "body": "\u003cb\u003eAliases:\u003c/b\u003e APT12, IXESHE, DynCalc, Numbered Panda, DNSCALC\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [APT12](https://attack.mitre.org/groups/G0005) is a threat group that has been attributed to China. The group has targeted a variety of victims including but not limited to media outlets, high-tech companies, and multiple governments.(Citation: Meyers Numbered Panda)", "color": "#fce903", "group": 5, "header": "G0005", "name": "APT12", "width": 10}, {"_id": 618, "body": "[Ixeshe](https://attack.mitre.org/software/S0015) is a malware family that has been used since at least 2009 against targets in East Asia. (Citation: Moran 2013)", "color": "#ff3232", "header": "S0015", "name": "Ixeshe"}, {"_id": 619, "body": "[RIPTIDE](https://attack.mitre.org/software/S0003) is a proxy-aware backdoor used by [APT12](https://attack.mitre.org/groups/G0005). (Citation: Moran 2014)", "color": "#ff3232", "header": "S0003", "name": "RIPTIDE"}, {"_id": 620, "body": "[HTRAN](https://attack.mitre.org/software/S0040) is a tool that proxies connections through intermediate hops and aids users in disguising their true geographical location. It can be used by adversaries to hide their location when interacting with the victim networks. (Citation: Operation Quantum Entanglement)(Citation: NCSC Joint Report Public Tools)", "color": "#ff1a8c", "header": "S0040", "name": "HTRAN"}, {"_id": 621, "body": "\u003cb\u003eTactic:\u003c/b\u003e command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT12](https://attack.mitre.org/groups/G0005) has used multiple variants of [DNS Calculation](https://attack.mitre.org/techniques/T1568/003) including multiplying the first two octets of an IP address and adding the third octet to that value in order to get a resulting command and control port.(Citation: Meyers Numbered Panda)", "header": "T1568.003", "name": "DNS Calculation"}, {"_id": 622, "body": "\u003cb\u003eAliases:\u003c/b\u003e Darkhotel, DUBNIUM\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Darkhotel](https://attack.mitre.org/groups/G0012) is a suspected South Korean threat group that has targeted victims primarily in East Asia since at least 2004. The group\u0027s name is based on cyber espionage operations conducted via hotel Internet networks against traveling executives and other select guests. [Darkhotel](https://attack.mitre.org/groups/G0012) has also conducted spearphishing campaigns and infected victims through peer-to-peer and file sharing networks.(Citation: Kaspersky Darkhotel)(Citation: Securelist Darkhotel Aug 2015)(Citation: Microsoft Digital Defense FY20 Sept 2020)", "color": "#fce903", "group": 5, "header": "G0012", "name": "Darkhotel", "width": 10}, {"_id": 623, "body": "\u003cb\u003eAliases:\u003c/b\u003e Axiom, Group 72\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Axiom](https://attack.mitre.org/groups/G0001) is a cyber espionage group suspected to be associated with the Chinese government. It is responsible for the Operation SMN campaign. (Citation: Novetta-Axiom) Though both this group and [Winnti Group](https://attack.mitre.org/groups/G0044) use the malware [Winnti for Windows](https://attack.mitre.org/software/S0141), the two groups appear to be distinct based on differences in reporting on the groups\u0027 TTPs and targeting. (Citation: Kaspersky Winnti April 2013) (Citation: Kaspersky Winnti June 2015) (Citation: Novetta Winnti April 2015)", "color": "#fce903", "group": 5, "header": "G0001", "name": "Axiom", "width": 10}, {"_id": 624, "body": "[Hikit](https://attack.mitre.org/software/S0009) is malware that has been used by [Axiom](https://attack.mitre.org/groups/G0001) for late-stage persistence and exfiltration after the initial compromise.(Citation: Novetta-Axiom)(Citation: FireEye Hikit Rootkit)", "color": "#ff3232", "header": "S0009", "name": "Hikit"}, {"_id": 625, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Hikit](https://attack.mitre.org/software/S0009) has attempted to disable driver signing verification by tampering with several Registry keys prior to the loading of a rootkit driver component.(Citation: FireEye HIKIT Rootkit Part 2)", "header": "T1553.006", "name": "Code Signing Policy Modification"}, {"_id": 626, "body": "\u003cb\u003eAliases:\u003c/b\u003e RTM\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [RTM](https://attack.mitre.org/groups/G0048) is a cybercriminal group that has been active since at least 2015 and is primarily interested in users of remote banking systems in Russia and neighboring countries. The group uses a Trojan by the same name ([RTM](https://attack.mitre.org/software/S0148)). (Citation: ESET RTM Feb 2017)", "color": "#fce903", "group": 5, "header": "G0048", "name": "RTM", "width": 10}, {"_id": 627, "body": "\u003cb\u003eAliases:\u003c/b\u003e FIN6, Magecart Group 6, SKELETON SPIDER, ITG08\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [FIN6](https://attack.mitre.org/groups/G0037) is a cyber crime group that has stolen payment card data and sold it for profit on underground marketplaces. This group has aggressively targeted and compromised point of sale (PoS) systems in the hospitality and retail sectors.(Citation: FireEye FIN6 April 2016)(Citation: FireEye FIN6 Apr 2019)", "color": "#fce903", "group": 5, "header": "G0037", "name": "FIN6", "width": 10}, {"_id": 628, "body": "[LockerGoga](https://attack.mitre.org/software/S0372) is ransomware that has been tied to various attacks on European companies. It was first reported upon in January 2019.(Citation: Unit42 LockerGoga 2019)(Citation: CarbonBlack LockerGoga 2019)", "color": "#ff3232", "header": "S0372", "name": "LockerGoga"}, {"_id": 629, "body": "\u003cb\u003eTactic:\u003c/b\u003e impact\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[LockerGoga](https://attack.mitre.org/software/S0372) has been observed changing account passwords and logging off current users.(Citation: CarbonBlack LockerGoga 2019)(Citation: Unit42 LockerGoga 2019)", "header": "T1531", "name": "Account Access Removal"}, {"_id": 630, "body": "[Ryuk](https://attack.mitre.org/software/S0446) is a ransomware designed to target enterprise environments that has been used in attacks since at least 2018. [Ryuk](https://attack.mitre.org/software/S0446) shares code similarities with Hermes ransomware.(Citation: CrowdStrike Ryuk January 2019)(Citation: FireEye Ryuk and Trickbot January 2019)(Citation: FireEye FIN6 Apr 2019)", "color": "#ff3232", "header": "S0446", "name": "Ryuk"}, {"_id": 631, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, persistence, command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Ryuk](https://attack.mitre.org/software/S0446) has used Wake-on-Lan to power on turned off systems for lateral movement.(Citation: Bleeping Computer - Ryuk WoL)", "header": "T1205", "name": "Traffic Signaling"}, {"_id": 632, "body": "[FrameworkPOS](https://attack.mitre.org/software/S0503) is a point of sale (POS) malware used by [FIN6](https://attack.mitre.org/groups/G0037) to steal payment card data from sytems that run physical POS devices.(Citation: SentinelOne FrameworkPOS September 2019)", "color": "#ff3232", "header": "S0503", "name": "FrameworkPOS"}, {"_id": 633, "body": "[Maze](https://attack.mitre.org/software/S0449) ransomware, previously known as \"ChaCha\", was discovered in May 2019. In addition to encrypting files on victim machines for impact, [Maze](https://attack.mitre.org/software/S0449) operators conduct information stealing campaigns prior to encryption and post the information online to extort affected companies.(Citation: FireEye Maze May 2020)(Citation: McAfee Maze March 2020)(Citation: Sophos Maze VM September 2020)", "color": "#ff3232", "header": "S0449", "name": "Maze"}, {"_id": 634, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Maze](https://attack.mitre.org/software/S0449) operators have used VirtualBox and a Windows 7 virtual machine to run the ransomware; the virtual machine\u0027s configuration file mapped the shared network drives of the target company, presumably so [Maze](https://attack.mitre.org/software/S0449) can encrypt files on the shared drives as well as the local machine.(Citation: Sophos Maze VM September 2020) ", "header": "T1564.006", "name": "Run Virtual Instance"}, {"_id": 635, "body": "[FlawedAmmyy](https://attack.mitre.org/software/S0381) is a remote access tool (RAT) that was first seen in early 2016. The code for [FlawedAmmyy](https://attack.mitre.org/software/S0381) was based on leaked source code for a version of Ammyy Admin, a remote access software.(Citation: Proofpoint TA505 Mar 2018)", "color": "#ff3232", "header": "S0381", "name": "FlawedAmmyy"}, {"_id": 636, "body": "\u003cb\u003eTactic:\u003c/b\u003e collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[FIN6](https://attack.mitre.org/groups/G0037) has collected schemas and user accounts from systems running SQL Server.(Citation: Visa FIN6 Feb 2019)", "header": "T1213", "name": "Data from Information Repositories"}, {"_id": 637, "body": "\u003cb\u003eAliases:\u003c/b\u003e Group5\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Group5](https://attack.mitre.org/groups/G0043) is a threat group with a suspected Iranian nexus, though this attribution is not definite. The group has targeted individuals connected to the Syrian opposition via spearphishing and watering holes, normally using Syrian and Iranian themes. [Group5](https://attack.mitre.org/groups/G0043) has used two commonly available remote access tools (RATs), [njRAT](https://attack.mitre.org/software/S0385) and [NanoCore](https://attack.mitre.org/software/S0336), as well as an Android RAT, DroidJack. (Citation: Citizen Lab Group5)", "color": "#fce903", "group": 5, "header": "G0043", "name": "Group5", "width": 10}, {"_id": 638, "body": "\u003cb\u003eAliases:\u003c/b\u003e Rancor\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Rancor](https://attack.mitre.org/groups/G0075) is a threat group that has led targeted campaigns against the South East Asia region. [Rancor](https://attack.mitre.org/groups/G0075) uses politically-motivated lures to entice victims to open malicious documents. (Citation: Rancor Unit42 June 2018)", "color": "#fce903", "group": 5, "header": "G0075", "name": "Rancor", "width": 10}, {"_id": 639, "body": "[PLAINTEE](https://attack.mitre.org/software/S0254) is a malware sample that has been used by [Rancor](https://attack.mitre.org/groups/G0075) in targeted attacks in Singapore and Cambodia. (Citation: Rancor Unit42 June 2018)", "color": "#ff3232", "header": "S0254", "name": "PLAINTEE"}, {"_id": 640, "body": "[DDKONG](https://attack.mitre.org/software/S0255) is a malware sample that was part of a campaign by [Rancor](https://attack.mitre.org/groups/G0075). [DDKONG](https://attack.mitre.org/software/S0255) was first seen used in February 2017. (Citation: Rancor Unit42 June 2018)", "color": "#ff3232", "header": "S0255", "name": "DDKONG"}, {"_id": 641, "body": "\u003cb\u003eAliases:\u003c/b\u003e Dust Storm\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Dust Storm](https://attack.mitre.org/groups/G0031) is a threat group that has targeted multiple industries in Japan, South Korea, the United States, Europe, and several Southeast Asian countries. (Citation: Cylance Dust Storm)", "color": "#fce903", "group": 5, "header": "G0031", "name": "Dust Storm", "width": 10}, {"_id": 642, "body": "[S-Type](https://attack.mitre.org/software/S0085) is a backdoor that was used by [Dust Storm](https://attack.mitre.org/groups/G0031) from 2013 to 2014. (Citation: Cylance Dust Storm)", "color": "#ff3232", "header": "S0085", "name": "S-Type"}, {"_id": 643, "body": "[Misdat](https://attack.mitre.org/software/S0083) is a backdoor that was used by [Dust Storm](https://attack.mitre.org/groups/G0031) from 2010 to 2011. (Citation: Cylance Dust Storm)", "color": "#ff3232", "header": "S0083", "name": "Misdat"}, {"_id": 644, "body": "[ZLib](https://attack.mitre.org/software/S0086) is a full-featured backdoor that was used as a second-stage implant by [Dust Storm](https://attack.mitre.org/groups/G0031) from 2014 to 2015. It is malware and should not be confused with the compression library from which its name is derived. (Citation: Cylance Dust Storm)", "color": "#ff3232", "header": "S0086", "name": "ZLib"}, {"_id": 645, "body": "[Mis-Type](https://attack.mitre.org/software/S0084) is a backdoor hybrid that was used by [Dust Storm](https://attack.mitre.org/groups/G0031) in 2012. (Citation: Cylance Dust Storm)", "color": "#ff3232", "header": "S0084", "name": "Mis-Type"}, {"_id": 646, "body": "\u003cb\u003eAliases:\u003c/b\u003e BlackOasis\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [BlackOasis](https://attack.mitre.org/groups/G0063) is a Middle Eastern threat group that is believed to be a customer of Gamma Group. The group has shown interest in prominent figures in the United Nations, as well as opposition bloggers, activists, regional news correspondents, and think tanks. (Citation: Securelist BlackOasis Oct 2017) (Citation: Securelist APT Trends Q2 2017) A group known by Microsoft as [NEODYMIUM](https://attack.mitre.org/groups/G0055) is reportedly associated closely with [BlackOasis](https://attack.mitre.org/groups/G0063) operations, but evidence that the group names are aliases has not been identified. (Citation: CyberScoop BlackOasis Oct 2017)", "color": "#fce903", "group": 5, "header": "G0063", "name": "BlackOasis", "width": 10}, {"_id": 647, "body": "\u003cb\u003eAliases:\u003c/b\u003e Molerats, Operation Molerats, Gaza Cybergang\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Molerats](https://attack.mitre.org/groups/G0021) is an Arabic-speaking, politically-motivated threat group that has been operating since 2012. The group\u0027s victims have primarily been in the Middle East, Europe, and the United States.(Citation: DustySky)(Citation: DustySky2)(Citation: Kaspersky MoleRATs April 2019)(Citation: Cybereason Molerats Dec 2020)", "color": "#fce903", "group": 5, "header": "G0021", "name": "Molerats", "width": 10}, {"_id": 648, "body": "[DustySky](https://attack.mitre.org/software/S0062) is multi-stage malware written in .NET that has been used by [Molerats](https://attack.mitre.org/groups/G0021) since May 2015. (Citation: DustySky) (Citation: DustySky2)(Citation: Kaspersky MoleRATs April 2019)", "color": "#ff3232", "header": "S0062", "name": "DustySky"}, {"_id": 649, "body": "\n[Spark](https://attack.mitre.org/software/S0543) is a Windows backdoor and has been in use since as early as 2017.(Citation: Unit42 Molerat Mar 2020) ", "color": "#ff3232", "header": "S0543", "name": "Spark"}, {"_id": 650, "body": "[DropBook](https://attack.mitre.org/software/S0547) is a Python-based backdoor compiled with PyInstaller.(Citation: Cybereason Molerats Dec 2020)", "color": "#ff3232", "header": "S0547", "name": "DropBook"}, {"_id": 651, "body": "[SharpStage](https://attack.mitre.org/software/S0546) is a .NET malware with backdoor capabilities.(Citation: Cybereason Molerats Dec 2020)(Citation: BleepingComputer Molerats Dec 2020)", "color": "#ff3232", "header": "S0546", "name": "SharpStage"}, {"_id": 652, "body": "[MoleNet](https://attack.mitre.org/software/S0553) is a downloader tool with backdoor capabilities that has been observed in use since at least 2019.(Citation: Cybereason Molerats Dec 2020)", "color": "#ff3232", "header": "S0553", "name": "MoleNet"}, {"_id": 653, "body": "\u003cb\u003eAliases:\u003c/b\u003e Gamaredon Group\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Gamaredon Group](https://attack.mitre.org/groups/G0047) is a threat group that has been active since at least 2013 and has targeted individuals likely involved in the Ukrainian government. The name [Gamaredon Group](https://attack.mitre.org/groups/G0047) comes from a misspelling of the word \"Armageddon\", which was detected in the adversary\u0027s early campaigns.(Citation: Palo Alto Gamaredon Feb 2017)(Citation: TrendMicro Gamaredon April 2020)(Citation: ESET Gamaredon June 2020)", "color": "#fce903", "group": 5, "header": "G0047", "name": "Gamaredon Group", "width": 10}, {"_id": 654, "body": "[Pteranodon](https://attack.mitre.org/software/S0147) is a custom backdoor used by [Gamaredon Group](https://attack.mitre.org/groups/G0047). (Citation: Palo Alto Gamaredon Feb 2017)", "color": "#ff3232", "header": "S0147", "name": "Pteranodon"}, {"_id": 655, "body": "\u003cb\u003eTactic:\u003c/b\u003e lateral-movement\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Gamaredon Group](https://attack.mitre.org/groups/G0047) has used an Outlook VBA module on infected systems to send phishing emails with malicious attachments to other employees within the organization.(Citation: ESET Gamaredon June 2020)", "header": "T1534", "name": "Internal Spearphishing"}, {"_id": 656, "body": "\u003cb\u003eAliases:\u003c/b\u003e Turla, Group 88, Belugasturgeon, Waterbug, WhiteBear, VENOMOUS BEAR, Snake, Krypton\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Turla](https://attack.mitre.org/groups/G0010) is a Russian-based threat group that has infected victims in over 45 countries, spanning a range of industries including government, embassies, military, education, research and pharmaceutical companies since 2004. Heightened activity was seen in mid-2015. [Turla](https://attack.mitre.org/groups/G0010) is known for conducting watering hole and spearphishing campaigns and leveraging in-house tools and malware. [Turla](https://attack.mitre.org/groups/G0010)\u2019s espionage platform is mainly used against Windows machines, but has also been seen used against macOS and Linux machines.(Citation: Kaspersky Turla)(Citation: ESET Gazer Aug 2017)(Citation: CrowdStrike VENOMOUS BEAR)(Citation: ESET Turla Mosquito Jan 2018)", "color": "#fce903", "group": 5, "header": "G0010", "name": "Turla", "width": 10}, {"_id": 657, "body": "[Gazer](https://attack.mitre.org/software/S0168) is a backdoor used by [Turla](https://attack.mitre.org/groups/G0010) since at least 2016. (Citation: ESET Gazer Aug 2017)", "color": "#ff3232", "header": "S0168", "name": "Gazer"}, {"_id": 658, "body": "\u003cb\u003eTactics:\u003c/b\u003e privilege-escalation, persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Gazer](https://attack.mitre.org/software/S0168) can establish persistence through the system screensaver by configuring it to execute the malware.(Citation: ESET Gazer Aug 2017)", "header": "T1546.002", "name": "Screensaver"}, {"_id": 659, "body": "[Mosquito](https://attack.mitre.org/software/S0256) is a Win32 backdoor that has been used by [Turla](https://attack.mitre.org/groups/G0010). [Mosquito](https://attack.mitre.org/software/S0256) is made up of three parts: the installer, the launcher, and the backdoor. The main backdoor is called CommanderDLL and is launched by the loader program. (Citation: ESET Turla Mosquito Jan 2018)", "color": "#ff3232", "header": "S0256", "name": "Mosquito"}, {"_id": 660, "body": "[Epic](https://attack.mitre.org/software/S0091) is a backdoor that has been used by [Turla](https://attack.mitre.org/groups/G0010). (Citation: Kaspersky Turla)", "color": "#ff3232", "header": "S0091", "name": "Epic"}, {"_id": 661, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Epic](https://attack.mitre.org/software/S0091) has overwritten the function pointer in the extra window memory of Explorer\u0027s Shell_TrayWnd in order to execute malicious code in the context of the explorer.exe process.(Citation: ESET Recon Snake Nest)", "header": "T1055.011", "name": "Extra Window Memory Injection"}, {"_id": 662, "body": "[Uroburos](https://attack.mitre.org/software/S0022) is a rootkit used by [Turla](https://attack.mitre.org/groups/G0010). (Citation: Kaspersky Turla)", "color": "#ff3232", "header": "S0022", "name": "Uroburos"}, {"_id": 663, "body": "[nbtstat](https://attack.mitre.org/software/S0102) is a utility used to troubleshoot NetBIOS name resolution. (Citation: TechNet Nbtstat)", "color": "#ff1a8c", "header": "S0102", "name": "nbtstat"}, {"_id": 664, "body": "[Kazuar](https://attack.mitre.org/software/S0265) is a fully featured, multi-platform backdoor Trojan written using the Microsoft .NET framework. (Citation: Unit 42 Kazuar May 2017)", "color": "#ff3232", "header": "S0265", "name": "Kazuar"}, {"_id": 665, "body": "[ComRAT](https://attack.mitre.org/software/S0126) is a second stage implant suspected of being a descendant of [Agent.btz](https://attack.mitre.org/software/S0092) and used by [Turla](https://attack.mitre.org/groups/G0010). The first version of [ComRAT](https://attack.mitre.org/software/S0126) was identified in 2007, but the tool has undergone substantial development for many years since.(Citation: Symantec Waterbug)(Citation: NorthSec 2015 GData Uroburos Tools)(Citation: ESET ComRAT May 2020)", "color": "#ff3232", "header": "S0126", "name": "ComRAT"}, {"_id": 666, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[ComRAT](https://attack.mitre.org/software/S0126) has used a portable FAT16 partition image placed in %TEMP% as a hidden file system.(Citation: ESET ComRAT May 2020)", "header": "T1564.005", "name": "Hidden File System"}, {"_id": 667, "body": "[Carbon](https://attack.mitre.org/software/S0335) is a sophisticated, second-stage backdoor and framework that can be used to steal sensitive information from victims. [Carbon](https://attack.mitre.org/software/S0335) has been selectively used by [Turla](https://attack.mitre.org/groups/G0010) to target government and foreign affairs-related organizations in Central Asia.(Citation: ESET Carbon Mar 2017)(Citation: Securelist Turla Oct 2018)", "color": "#ff3232", "header": "S0335", "name": "Carbon"}, {"_id": 668, "body": "\u003cb\u003eTactics:\u003c/b\u003e privilege-escalation, persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Turla](https://attack.mitre.org/groups/G0010) has used PowerShell profiles to maintain persistence on an infected machine.(Citation: ESET Turla PowerShell May 2019)", "header": "T1546.013", "name": "PowerShell Profile"}, {"_id": 669, "body": "[PowerStallion](https://attack.mitre.org/software/S0393) is a lightweight [PowerShell](https://attack.mitre.org/techniques/T1059/001) backdoor used by [Turla](https://attack.mitre.org/groups/G0010), possibly as a recovery access tool to install other backdoors.(Citation: ESET Turla PowerShell May 2019)", "color": "#ff3232", "header": "S0393", "name": "PowerStallion"}, {"_id": 670, "body": "[LightNeuron](https://attack.mitre.org/software/S0395) is a sophisticated backdoor that has targeted Microsoft Exchange servers since at least 2014. [LightNeuron](https://attack.mitre.org/software/S0395) has been used by [Turla](https://attack.mitre.org/groups/G0010) to target diplomatic and foreign affairs-related organizations. The presence of certain strings in the malware suggests a Linux variant of [LightNeuron](https://attack.mitre.org/software/S0395) exists.(Citation: ESET LightNeuron May 2019)", "color": "#ff3232", "header": "S0395", "name": "LightNeuron"}, {"_id": 671, "body": "\u003cb\u003eTactic:\u003c/b\u003e impact\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[LightNeuron](https://attack.mitre.org/software/S0395) is capable of modifying email content, headers, and attachments during transit.(Citation: ESET LightNeuron May 2019)", "header": "T1565.002", "name": "Transmitted Data Manipulation"}, {"_id": 672, "body": "\u003cb\u003eTactic:\u003c/b\u003e persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[LightNeuron](https://attack.mitre.org/software/S0395) has used a malicious Microsoft Exchange transport agent for persistence.(Citation: ESET LightNeuron May 2019)", "header": "T1505.002", "name": "Transport Agent"}, {"_id": 673, "body": "[HyperStack](https://attack.mitre.org/software/S0537) is a RPC-based backdoor used by [Turla](https://attack.mitre.org/groups/G0010) since at least 2018. [HyperStack](https://attack.mitre.org/software/S0537) has similarities to other backdoors used by [Turla](https://attack.mitre.org/groups/G0010) including [Carbon](https://attack.mitre.org/software/S0335).(Citation: Accenture HyperStack October 2020)", "color": "#ff3232", "header": "S0537", "name": "HyperStack"}, {"_id": 674, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, persistence, privilege-escalation, initial-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[HyperStack](https://attack.mitre.org/software/S0537) can use default credentials to connect to IPC$ shares on remote machines.(Citation: Accenture HyperStack October 2020)", "header": "T1078.001", "name": "Default Accounts"}, {"_id": 675, "body": "\u003cb\u003eTactic:\u003c/b\u003e execution\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[HyperStack](https://attack.mitre.org/software/S0537) can connect to the IPC$ share on remote machines.(Citation: Accenture HyperStack October 2020)", "header": "T1559", "name": "Inter-Process Communication"}, {"_id": 676, "body": "[Crutch](https://attack.mitre.org/software/S0538) is a backdoor designed for document theft that has been used by [Turla](https://attack.mitre.org/groups/G0010) since at least 2015.(Citation: ESET Crutch December 2020)", "color": "#ff3232", "header": "S0538", "name": "Crutch"}, {"_id": 677, "body": "[IronNetInjector](https://attack.mitre.org/software/S0581) is a [Turla](https://attack.mitre.org/groups/G0010) toolchain that utilizes scripts from the open-source IronPython implementation of Python with a .NET injector to drop one or more payloads including [ComRAT](https://attack.mitre.org/software/S0126).(Citation: Unit 42 IronNetInjector February 2021 )", "color": "#ff1a8c", "header": "S0581", "name": "IronNetInjector"}, {"_id": 678, "body": "[Penquin](https://attack.mitre.org/software/S0587) is a remote access trojan (RAT) with multiple versions used by [Turla](https://attack.mitre.org/groups/G0010) to target Linux systems since at least 2014.(Citation: Kaspersky Turla Penquin December 2014)(Citation: Leonardo Turla Penquin May 2020)", "color": "#ff3232", "header": "S0587", "name": "Penquin"}, {"_id": 679, "body": "\u003cb\u003eAliases:\u003c/b\u003e admin@338\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [admin@338](https://attack.mitre.org/groups/G0018) is a China-based cyber threat group. It has previously used newsworthy events as lures to deliver malware and has primarily targeted organizations involved in financial, economic, and trade policy, typically using publicly available RATs such as [PoisonIvy](https://attack.mitre.org/software/S0012), as well as some non-public backdoors. (Citation: FireEye admin@338)", "color": "#fce903", "group": 5, "header": "G0018", "name": "admin@338", "width": 10}, {"_id": 680, "body": "[BUBBLEWRAP](https://attack.mitre.org/software/S0043) is a full-featured, second-stage backdoor used by the [admin@338](https://attack.mitre.org/groups/G0018) group. It is set to run when the system boots and includes functionality to check, upload, and register plug-ins that can further enhance its capabilities. (Citation: FireEye admin@338)", "color": "#ff3232", "header": "S0043", "name": "BUBBLEWRAP"}, {"_id": 681, "body": "[LOWBALL](https://attack.mitre.org/software/S0042) is malware used by [admin@338](https://attack.mitre.org/groups/G0018). It was used in August 2015 in email messages targeting Hong Kong-based media organizations. (Citation: FireEye admin@338)", "color": "#ff3232", "header": "S0042", "name": "LOWBALL"}, {"_id": 682, "body": "\u003cb\u003eAliases:\u003c/b\u003e Leafminer, Raspite\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Leafminer](https://attack.mitre.org/groups/G0077) is an Iranian threat group that has targeted government organizations and business entities in the Middle East since at least early 2017. (Citation: Symantec Leafminer July 2018)", "color": "#fce903", "group": 5, "header": "G0077", "name": "Leafminer", "width": 10}, {"_id": 683, "body": "MailSniper is a penetration testing tool for searching through email in a Microsoft Exchange environment for specific terms (passwords, insider intel, network architecture information, etc.). It can be used by a non-administrative user to search their own email, or by an Exchange administrator to search the mailboxes of every user in a domain.(Citation: GitHub MailSniper)", "color": "#ff1a8c", "header": "S0413", "name": "MailSniper"}, {"_id": 684, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Leafminer](https://attack.mitre.org/groups/G0077) has used [Process Doppelg\u00e4nging](https://attack.mitre.org/techniques/T1055/013) to evade security software while deploying tools on compromised systems.(Citation: Symantec Leafminer July 2018)\t", "header": "T1055.013", "name": "Process Doppelg\u00e4nging"}, {"_id": 685, "body": "\u003cb\u003eAliases:\u003c/b\u003e PLATINUM\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [PLATINUM](https://attack.mitre.org/groups/G0068) is an activity group that has targeted victims since at least 2009. The group has focused on targets associated with governments and related organizations in South and Southeast Asia. (Citation: Microsoft PLATINUM April 2016)", "color": "#fce903", "group": 5, "header": "G0068", "name": "PLATINUM", "width": 10}, {"_id": 686, "body": "[Dipsind](https://attack.mitre.org/software/S0200) is a malware family of backdoors that appear to be used exclusively by [PLATINUM](https://attack.mitre.org/groups/G0068). (Citation: Microsoft PLATINUM April 2016)", "color": "#ff3232", "header": "S0200", "name": "Dipsind"}, {"_id": 687, "body": "[JPIN](https://attack.mitre.org/software/S0201) is a custom-built backdoor family used by [PLATINUM](https://attack.mitre.org/groups/G0068). Evidence suggests developers of [JPIN](https://attack.mitre.org/software/S0201) and [Dipsind](https://attack.mitre.org/software/S0200) code bases were related in some way. (Citation: Microsoft PLATINUM April 2016)", "color": "#ff3232", "header": "S0201", "name": "JPIN"}, {"_id": 688, "body": "[adbupd](https://attack.mitre.org/software/S0202) is a backdoor used by [PLATINUM](https://attack.mitre.org/groups/G0068) that is similar to [Dipsind](https://attack.mitre.org/software/S0200). (Citation: Microsoft PLATINUM April 2016)", "color": "#ff3232", "header": "S0202", "name": "adbupd"}, {"_id": 689, "body": "\u003cb\u003eAliases:\u003c/b\u003e DragonOK\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [DragonOK](https://attack.mitre.org/groups/G0017) is a threat group that has targeted Japanese organizations with phishing emails. Due to overlapping TTPs, including similar custom tools, [DragonOK](https://attack.mitre.org/groups/G0017) is thought to have a direct or indirect relationship with the threat group [Moafee](https://attack.mitre.org/groups/G0002). (Citation: Operation Quantum Entanglement) It is known to use a variety of malware, including Sysget/HelloBridge, PlugX, PoisonIvy, FormerFirstRat, NFlog, and NewCT. (Citation: New DragonOK)", "color": "#fce903", "group": 5, "header": "G0017", "name": "DragonOK", "width": 10}, {"_id": 690, "body": "\u003cb\u003eAliases:\u003c/b\u003e TA459\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [TA459](https://attack.mitre.org/groups/G0062) is a threat group believed to operate out of China that has targeted countries including Russia, Belarus, Mongolia, and others. (Citation: Proofpoint TA459 April 2017)", "color": "#fce903", "group": 5, "header": "G0062", "name": "TA459", "width": 10}, {"_id": 691, "body": "[ZeroT](https://attack.mitre.org/software/S0230) is a Trojan used by [TA459](https://attack.mitre.org/groups/G0062), often in conjunction with [PlugX](https://attack.mitre.org/software/S0013). (Citation: Proofpoint TA459 April 2017) (Citation: Proofpoint ZeroT Feb 2017)", "color": "#ff3232", "header": "S0230", "name": "ZeroT"}, {"_id": 692, "body": "[NetTraveler](https://attack.mitre.org/software/S0033) is malware that has been used in multiple cyber espionage campaigns for basic surveillance of victims. The earliest known samples have timestamps back to 2005, and the largest number of observed samples were created between 2010 and 2013. (Citation: Kaspersky NetTraveler)", "color": "#ff3232", "header": "S0033", "name": "NetTraveler"}, {"_id": 693, "body": "\u003cb\u003eAliases:\u003c/b\u003e Suckfly\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Suckfly](https://attack.mitre.org/groups/G0039) is a China-based threat group that has been active since at least 2014. (Citation: Symantec Suckfly March 2016)", "color": "#fce903", "group": 5, "header": "G0039", "name": "Suckfly", "width": 10}, {"_id": 694, "body": "[Nidiran](https://attack.mitre.org/software/S0118) is a custom backdoor developed and used by [Suckfly](https://attack.mitre.org/groups/G0039). It has been delivered via strategic web compromise. (Citation: Symantec Suckfly March 2016)", "color": "#ff3232", "header": "S0118", "name": "Nidiran"}, {"_id": 695, "body": "\u003cb\u003eAliases:\u003c/b\u003e Sowbug\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Sowbug](https://attack.mitre.org/groups/G0054) is a threat group that has conducted targeted attacks against organizations in South America and Southeast Asia, particularly government entities, since at least 2015. (Citation: Symantec Sowbug Nov 2017)", "color": "#fce903", "group": 5, "header": "G0054", "name": "Sowbug", "width": 10}, {"_id": 696, "body": "[Starloader](https://attack.mitre.org/software/S0188) is a loader component that has been observed loading [Felismus](https://attack.mitre.org/software/S0171) and associated tools. (Citation: Symantec Sowbug Nov 2017)", "color": "#ff3232", "header": "S0188", "name": "Starloader"}, {"_id": 697, "body": "[Felismus](https://attack.mitre.org/software/S0171) is a modular backdoor that has been used by [Sowbug](https://attack.mitre.org/groups/G0054). (Citation: Symantec Sowbug Nov 2017) (Citation: Forcepoint Felismus Mar 2017)", "color": "#ff3232", "header": "S0171", "name": "Felismus"}, {"_id": 698, "body": "\u003cb\u003eAliases:\u003c/b\u003e Thrip\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Thrip](https://attack.mitre.org/groups/G0076) is an espionage group that has targeted satellite communications, telecoms, and defense contractor companies in the U.S. and Southeast Asia. The group uses custom malware as well as \"living off the land\" techniques. (Citation: Symantec Thrip June 2018)", "color": "#fce903", "group": 5, "header": "G0076", "name": "Thrip", "width": 10}, {"_id": 699, "body": "[Catchamas](https://attack.mitre.org/software/S0261) is a Windows Trojan that steals information from compromised systems. (Citation: Symantec Catchamas April 2018)", "color": "#ff3232", "header": "S0261", "name": "Catchamas"}, {"_id": 700, "body": "\u003cb\u003eAliases:\u003c/b\u003e Winnti Group, Blackfly\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Winnti Group](https://attack.mitre.org/groups/G0044) is a threat group with Chinese origins that has been active since at least 2010. The group has heavily targeted the gaming industry, but it has also expanded the scope of its targeting. (Citation: Kaspersky Winnti April 2013) (Citation: Kaspersky Winnti June 2015) (Citation: Novetta Winnti April 2015) Some reporting suggests a number of other groups, including [Axiom](https://attack.mitre.org/groups/G0001), [APT17](https://attack.mitre.org/groups/G0025), and [Ke3chang](https://attack.mitre.org/groups/G0004), are closely linked to [Winnti Group](https://attack.mitre.org/groups/G0044). (Citation: 401 TRG Winnti Umbrella May 2018)", "color": "#fce903", "group": 5, "header": "G0044", "name": "Winnti Group", "width": 10}, {"_id": 701, "body": "[Winnti for Windows](https://attack.mitre.org/software/S0141) is a Trojan that has been used by multiple groups to carry out intrusions in varied regions from at least 2010 to 2016. One of the groups using this malware is referred to by the same name, [Winnti Group](https://attack.mitre.org/groups/G0044); however, reporting indicates a second distinct group, [Axiom](https://attack.mitre.org/groups/G0001), also uses the malware. (Citation: Kaspersky Winnti April 2013) (Citation: Microsoft Winnti Jan 2017) (Citation: Novetta Winnti April 2015) The Linux variant is tracked separately under [Winnti for Linux](https://attack.mitre.org/software/S0430).(Citation: Chronicle Winnti for Linux May 2019)", "color": "#ff3232", "header": "S0141", "name": "Winnti for Windows"}, {"_id": 702, "body": "[PipeMon](https://attack.mitre.org/software/S0501) is a multi-stage modular backdoor used by [Winnti Group](https://attack.mitre.org/groups/G0044).(Citation: ESET PipeMon May 2020)", "color": "#ff3232", "header": "S0501", "name": "PipeMon"}, {"_id": 703, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eThe [PipeMon](https://attack.mitre.org/software/S0501) installer has modified the Registry key \u003ccode\u003eHKLM\\SYSTEM\\CurrentControlSet\\Control\\Print\\Environments\\Windows x64\\Print Processors\u003c/code\u003e to install [PipeMon](https://attack.mitre.org/software/S0501) as a Print Processor.(Citation: ESET PipeMon May 2020)", "header": "T1547.012", "name": "Print Processors"}, {"_id": 704, "body": "\u003cb\u003eAliases:\u003c/b\u003e FIN10\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [FIN10](https://attack.mitre.org/groups/G0051) is a financially motivated threat group that has targeted organizations in North America since at least 2013 through 2016. The group uses stolen data exfiltrated from victims to extort organizations. (Citation: FireEye FIN10 June 2017)", "color": "#fce903", "group": 5, "header": "G0051", "name": "FIN10", "width": 10}, {"_id": 705, "body": "\u003cb\u003eAliases:\u003c/b\u003e Naikon\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Naikon](https://attack.mitre.org/groups/G0019) is a threat group that has focused on targets around the South China Sea.(Citation: Baumgartner Naikon 2015) The group has been attributed to the Chinese People\u2019s Liberation Army\u2019s (PLA) Chengdu Military Region Second Technical Reconnaissance Bureau(Military Unit Cover Designator 78020).(Citation: CameraShy) While [Naikon](https://attack.mitre.org/groups/G0019) shares some characteristics with [APT30](https://attack.mitre.org/groups/G0013), the two groups do not appear to be exact matches.(Citation: Baumgartner Golovkin Naikon 2015)", "color": "#fce903", "group": 5, "header": "G0019", "name": "Naikon", "width": 10}, {"_id": 706, "body": "[Sys10](https://attack.mitre.org/software/S0060) is a backdoor that was used throughout 2013 by [Naikon](https://attack.mitre.org/groups/G0019). (Citation: Baumgartner Naikon 2015)", "color": "#ff3232", "header": "S0060", "name": "Sys10"}, {"_id": 707, "body": "[WinMM](https://attack.mitre.org/software/S0059) is a full-featured, simple backdoor used by [Naikon](https://attack.mitre.org/groups/G0019). (Citation: Baumgartner Naikon 2015)", "color": "#ff3232", "header": "S0059", "name": "WinMM"}, {"_id": 708, "body": "[RARSTONE](https://attack.mitre.org/software/S0055) is malware used by the [Naikon](https://attack.mitre.org/groups/G0019) group that has some characteristics similar to [PlugX](https://attack.mitre.org/software/S0013). (Citation: Aquino RARSTONE)", "color": "#ff3232", "header": "S0055", "name": "RARSTONE"}, {"_id": 709, "body": "[SslMM](https://attack.mitre.org/software/S0058) is a full-featured backdoor used by [Naikon](https://attack.mitre.org/groups/G0019) that has multiple variants. (Citation: Baumgartner Naikon 2015)", "color": "#ff3232", "header": "S0058", "name": "SslMM"}, {"_id": 710, "body": "[HDoor](https://attack.mitre.org/software/S0061) is malware that has been customized and used by the [Naikon](https://attack.mitre.org/groups/G0019) group. (Citation: Baumgartner Naikon 2015)", "color": "#ff3232", "header": "S0061", "name": "HDoor"}, {"_id": 711, "body": "\u003cb\u003eTactic:\u003c/b\u003e persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Naikon](https://attack.mitre.org/groups/G0019) has used the RoyalRoad exploit builder to drop a second stage loader, intel.wll, into the Word Startup folder on the compromised host.(Citation: CheckPoint Naikon May 2020)", "header": "T1137.006", "name": "Add-ins"}, {"_id": 712, "body": "[Aria-body](https://attack.mitre.org/software/S0456) is a custom backdoor that has been used by [Naikon](https://attack.mitre.org/groups/G0019).(Citation: CheckPoint Naikon May 2020)", "color": "#ff3232", "header": "S0456", "name": "Aria-body"}, {"_id": 713, "body": "\u003cb\u003eAliases:\u003c/b\u003e Strider, ProjectSauron\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Strider](https://attack.mitre.org/groups/G0041) is a threat group that has been active since at least 2011 and has targeted victims in Russia, China, Sweden, Belgium, Iran, and Rwanda.(Citation: Symantec Strider Blog)(Citation: Kaspersky ProjectSauron Blog)", "color": "#fce903", "group": 5, "header": "G0041", "name": "Strider", "width": 10}, {"_id": 714, "body": "[Remsec](https://attack.mitre.org/software/S0125) is a modular backdoor that has been used by [Strider](https://attack.mitre.org/groups/G0041) and appears to have been designed primarily for espionage purposes. Many of its modules are written in Lua. (Citation: Symantec Strider Blog)", "color": "#ff3232", "header": "S0125", "name": "Remsec"}, {"_id": 715, "body": "\u003cb\u003eTactics:\u003c/b\u003e credential-access, defense-evasion, persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Remsec](https://attack.mitre.org/software/S0125) harvests plain-text credentials as a password filter registered on domain controllers.(Citation: Kaspersky ProjectSauron Full Report)", "header": "T1556.002", "name": "Password Filter DLL"}, {"_id": 716, "body": "\u003cb\u003eTactics:\u003c/b\u003e execution, persistence, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Remsec](https://attack.mitre.org/software/S0125) schedules the execution one of its modules by creating a new scheduler task.(Citation: Kaspersky ProjectSauron Technical Analysis)", "header": "T1053", "name": "Scheduled Task/Job"}, {"_id": 717, "body": "\u003cb\u003eAliases:\u003c/b\u003e Tropic Trooper, Pirate Panda, KeyBoy\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Tropic Trooper](https://attack.mitre.org/groups/G0081) is an unaffiliated threat group that has led targeted campaigns against targets in Taiwan, the Philippines, and Hong Kong. [Tropic Trooper](https://attack.mitre.org/groups/G0081) focuses on targeting government, healthcare, transportation, and high-tech industries and has been active since 2011.(Citation: TrendMicro Tropic Trooper Mar 2018)(Citation: Unit 42 Tropic Trooper Nov 2016)(Citation: TrendMicro Tropic Trooper May 2020)", "color": "#fce903", "group": 5, "header": "G0081", "name": "Tropic Trooper", "width": 10}, {"_id": 718, "body": "[KeyBoy](https://attack.mitre.org/software/S0387) is malware that has been used in targeted campaigns against members of the Tibetan Parliament in 2016.(Citation: CitizenLab KeyBoy Nov 2016)(Citation: PWC KeyBoys Feb 2017)", "color": "#ff3232", "header": "S0387", "name": "KeyBoy"}, {"_id": 719, "body": "[YAHOYAH](https://attack.mitre.org/software/S0388) is a Trojan used by [Tropic Trooper](https://attack.mitre.org/groups/G0081) as a second-stage backdoor.(Citation: TrendMicro TropicTrooper 2015)", "color": "#ff3232", "header": "S0388", "name": "YAHOYAH"}, {"_id": 720, "body": "[USBferry](https://attack.mitre.org/software/S0452) is an information stealing malware and has been used by [Tropic Trooper](https://attack.mitre.org/groups/G0081) in targeted attacks against Taiwanese and Philippine air-gapped military environments. [USBferry](https://attack.mitre.org/software/S0452) shares an overlapping codebase with [YAHOYAH](https://attack.mitre.org/software/S0388), though it has several features which makes it a distinct piece of malware.(Citation: TrendMicro Tropic Trooper May 2020)", "color": "#ff3232", "header": "S0452", "name": "USBferry"}, {"_id": 721, "body": "\u003cb\u003eAliases:\u003c/b\u003e SilverTerrier\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [SilverTerrier](https://attack.mitre.org/groups/G0083) is a Nigerian threat group that has been seen active since 2014. [SilverTerrier](https://attack.mitre.org/groups/G0083) mainly targets organizations in high technology, higher education, and manufacturing.(Citation: Unit42 SilverTerrier 2018)(Citation: Unit42 SilverTerrier 2016)", "color": "#fce903", "group": 5, "header": "G0083", "name": "SilverTerrier", "width": 10}, {"_id": 722, "body": "[DarkComet](https://attack.mitre.org/software/S0334) is a Windows remote administration tool and backdoor.(Citation: TrendMicro DarkComet Sept 2014)(Citation: Malwarebytes DarkComet March 2018)", "color": "#ff3232", "header": "S0334", "name": "DarkComet"}, {"_id": 723, "body": "[Agent Tesla](https://attack.mitre.org/software/S0331) is a spyware Trojan written for the .NET framework that has been observed since at least 2014.(Citation: Fortinet Agent Tesla April 2018)(Citation: Bitdefender Agent Tesla April 2020)(Citation: Malwarebytes Agent Tesla April 2020)", "color": "#ff3232", "header": "S0331", "name": "Agent Tesla"}, {"_id": 724, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Agent Tesla](https://attack.mitre.org/software/S0331) has dropped RegAsm.exe onto systems for performing malicious activity.(Citation: SentinelLabs Agent Tesla Aug 2020) ", "header": "T1218.009", "name": "Regsvcs/Regasm"}, {"_id": 725, "body": "[Lokibot](https://attack.mitre.org/software/S0447) is a malware designed to collect credentials and security tokens from an infected machine. [Lokibot](https://attack.mitre.org/software/S0447) has also been used to establish backdoors in enterprise environments.(Citation: Infoblox Lokibot January 2019)(Citation: Morphisec Lokibot April 2020)", "color": "#ff3232", "header": "S0447", "name": "Lokibot"}, {"_id": 726, "body": "\u003cb\u003eAliases:\u003c/b\u003e FIN4\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [FIN4](https://attack.mitre.org/groups/G0085) is a financially-motivated threat group that has targeted confidential information related to the public financial market, particularly regarding healthcare and pharmaceutical companies, since at least 2013.(Citation: FireEye Hacking FIN4 Dec 2014)(Citation: FireEye FIN4 Stealing Insider NOV 2014) [FIN4](https://attack.mitre.org/groups/G0085) is unique in that they do not infect victims with typical persistent malware, but rather they focus on capturing credentials authorized to access email and other non-public correspondence.(Citation: FireEye Hacking FIN4 Dec 2014)(Citation: FireEye Hacking FIN4 Video Dec 2014)", "color": "#fce903", "group": 5, "header": "G0085", "name": "FIN4", "width": 10}, {"_id": 727, "body": "\u003cb\u003eTactics:\u003c/b\u003e collection, credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[FIN4](https://attack.mitre.org/groups/G0085) has presented victims with spoofed Windows Authentication prompts to collect their credentials.(Citation: FireEye Hacking FIN4 Dec 2014)(Citation: FireEye Hacking FIN4 Video Dec 2014)", "header": "T1056.002", "name": "GUI Input Capture"}, {"_id": 728, "body": "\u003cb\u003eAliases:\u003c/b\u003e APT38\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [APT38](https://attack.mitre.org/groups/G0082) is a financially-motivated threat group that is backed by the North Korean regime. The group mainly targets banks and financial institutions and has targeted more than 16 organizations in at least 13 countries since at least 2014.(Citation: FireEye APT38 Oct 2018)\n\nNorth Korean group definitions are known to have significant overlap, and the name [Lazarus Group](https://attack.mitre.org/groups/G0032) is known to encompass a broad range of activity. Some organizations use the name Lazarus Group to refer to any activity attributed to North Korea.(Citation: US-CERT HIDDEN COBRA June 2017) Some organizations track North Korean clusters or groups such as Bluenoroff,(Citation: Kaspersky Lazarus Under The Hood Blog 2017) [APT37](https://attack.mitre.org/groups/G0067), and [APT38](https://attack.mitre.org/groups/G0082) separately, while other organizations may track some activity associated with those group names by the name Lazarus Group.", "color": "#fce903", "group": 5, "header": "G0082", "name": "APT38", "width": 10}, {"_id": 729, "body": "\u003cb\u003eTactic:\u003c/b\u003e impact\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT38](https://attack.mitre.org/groups/G0082) has used DYEPACK.FOX to manipulate PDF data as it is accessed to remove traces of fraudulent SWIFT transactions from the data displayed to the end user.(Citation: FireEye APT38 Oct 2018)", "header": "T1565.003", "name": "Runtime Data Manipulation"}, {"_id": 730, "body": "\u003cb\u003eAliases:\u003c/b\u003e Gallmaker\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Gallmaker](https://attack.mitre.org/groups/G0084) is a cyberespionage group that has targeted victims in the Middle East and has been active since at least December 2017. The group has mainly targeted victims in the defense, military, and government sectors.(Citation: Symantec Gallmaker Oct 2018)", "color": "#fce903", "group": 5, "header": "G0084", "name": "Gallmaker", "width": 10}, {"_id": 731, "body": "\u003cb\u003eAliases:\u003c/b\u003e Dragonfly, TG-4192, Crouching Yeti, IRON LIBERTY, Energetic Bear\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Dragonfly](https://attack.mitre.org/groups/G0035) is a cyber espionage group that has been active since at least 2011. They initially targeted defense and aviation companies but shifted to focus to include the energy sector in early 2013. They have also targeted companies related to industrial control systems. (Citation: Symantec Dragonfly)(Citation: Secureworks IRON LIBERTY July 2019)\n\nA similar group emerged in 2015 and was identified by Symantec as [Dragonfly 2.0](https://attack.mitre.org/groups/G0074). There is debate over the extent of the overlap between [Dragonfly](https://attack.mitre.org/groups/G0035) and [Dragonfly 2.0](https://attack.mitre.org/groups/G0074), but there is sufficient evidence to lead to these being tracked as two separate groups. (Citation: Symantec Dragonfly Sept 2017)(Citation: Fortune Dragonfly 2.0 Sept 2017)(Citation: Dragos DYMALLOY )", "color": "#fce903", "group": 5, "header": "G0035", "name": "Dragonfly", "width": 10}, {"_id": 732, "body": "[Backdoor.Oldrea](https://attack.mitre.org/software/S0093) is a backdoor used by [Dragonfly](https://attack.mitre.org/groups/G0035). It appears to be custom malware authored by the group or specifically for it. (Citation: Symantec Dragonfly)", "color": "#ff3232", "header": "S0093", "name": "Backdoor.Oldrea"}, {"_id": 733, "body": "\u003cb\u003eTactic:\u003c/b\u003e initial-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Dragonfly](https://attack.mitre.org/groups/G0035) has used spearphising campaigns to gain access to victims.(Citation: Secureworks IRON LIBERTY July 2019)", "header": "T1566", "name": "Phishing"}, {"_id": 734, "body": "\u003cb\u003eAliases:\u003c/b\u003e Putter Panda, APT2, MSUpdater\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Putter Panda](https://attack.mitre.org/groups/G0024) is a Chinese threat group that has been attributed to Unit 61486 of the 12th Bureau of the PLA\u2019s 3rd General Staff Department (GSD). (Citation: CrowdStrike Putter Panda)", "color": "#fce903", "group": 5, "header": "G0024", "name": "Putter Panda", "width": 10}, {"_id": 735, "body": "[httpclient](https://attack.mitre.org/software/S0068) is malware used by [Putter Panda](https://attack.mitre.org/groups/G0024). It is a simple tool that provides a limited range of functionality, suggesting it is likely used as a second-stage or supplementary/backup tool. (Citation: CrowdStrike Putter Panda)", "color": "#ff3232", "header": "S0068", "name": "httpclient"}, {"_id": 736, "body": "[4H RAT](https://attack.mitre.org/software/S0065) is malware that has been used by [Putter Panda](https://attack.mitre.org/groups/G0024) since at least 2007. (Citation: CrowdStrike Putter Panda)", "color": "#ff3232", "header": "S0065", "name": "4H RAT"}, {"_id": 737, "body": "[pngdowner](https://attack.mitre.org/software/S0067) is malware used by [Putter Panda](https://attack.mitre.org/groups/G0024). It is a simple tool with limited functionality and no persistence mechanism, suggesting it is used only as a simple \"download-and-\nexecute\" utility. (Citation: CrowdStrike Putter Panda)", "color": "#ff3232", "header": "S0067", "name": "pngdowner"}, {"_id": 738, "body": "[3PARA RAT](https://attack.mitre.org/software/S0066) is a remote access tool (RAT) programmed in C++ that has been used by [Putter Panda](https://attack.mitre.org/groups/G0024). (Citation: CrowdStrike Putter Panda)", "color": "#ff3232", "header": "S0066", "name": "3PARA RAT"}, {"_id": 739, "body": "\u003cb\u003eAliases:\u003c/b\u003e Threat Group-1314, TG-1314\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Threat Group-1314](https://attack.mitre.org/groups/G0028) is an unattributed threat group that has used compromised credentials to log into a victim\u0027s remote access infrastructure. (Citation: Dell TG-1314)", "color": "#fce903", "group": 5, "header": "G0028", "name": "Threat Group-1314", "width": 10}, {"_id": 740, "body": "\u003cb\u003eAliases:\u003c/b\u003e Equation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Equation](https://attack.mitre.org/groups/G0020) is a sophisticated threat group that employs multiple remote access tools. The group is known to use zero-day exploits and has developed the capability to overwrite the firmware of hard disk drives. (Citation: Kaspersky Equation QA)", "color": "#fce903", "group": 5, "header": "G0020", "name": "Equation", "width": 10}, {"_id": 741, "body": "[Equation](https://attack.mitre.org/groups/G0020) is known to have the capability to overwrite the firmware on hard drives from some manufacturers.(Citation: Kaspersky Equation QA)", "header": "T1109", "name": "Component Firmware"}, {"_id": 742, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Equation](https://attack.mitre.org/groups/G0020) has been observed utilizing environmental keying in payload delivery.(Citation: Kaspersky Gauss Whitepaper)(Citation: Kaspersky Equation QA)", "header": "T1480.001", "name": "Environmental Keying"}, {"_id": 743, "body": "\u003cb\u003eAliases:\u003c/b\u003e Moafee\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Moafee](https://attack.mitre.org/groups/G0002) is a threat group that appears to operate from the Guandong Province of China. Due to overlapping TTPs, including similar custom tools, Moafee is thought to have a direct or indirect relationship with the threat group [DragonOK](https://attack.mitre.org/groups/G0017). (Citation: Haq 2014)", "color": "#fce903", "group": 5, "header": "G0002", "name": "Moafee", "width": 10}, {"_id": 744, "body": "\u003cb\u003eAliases:\u003c/b\u003e PROMETHIUM, StrongPity\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [PROMETHIUM](https://attack.mitre.org/groups/G0056) is an activity group focused on espionage that has been active since at least 2012. The group has conducted operations global
