ly with a heavy emphasis on Turkish targets. [PROMETHIUM](https://attack.mitre.org/groups/G0056) has demonstrated similarity to another activity group called [NEODYMIUM](https://attack.mitre.org/groups/G0055) due to overlapping victim and campaign characteristics.(Citation: Microsoft NEODYMIUM Dec 2016)(Citation: Microsoft SIR Vol 21)(Citation: Talos Promethium June 2020)", "color": "#fce903", "group": 5, "header": "G0056", "name": "PROMETHIUM", "width": 10}, {"_id": 745, "body": "[Truvasys](https://attack.mitre.org/software/S0178) is first-stage malware that has been used by [PROMETHIUM](https://attack.mitre.org/groups/G0056). It is a collection of modules written in the Delphi programming language. (Citation: Microsoft Win Defender Truvasys Sep 2017) (Citation: Microsoft NEODYMIUM Dec 2016) (Citation: Microsoft SIR Vol 21)", "color": "#ff3232", "header": "S0178", "name": "Truvasys"}, {"_id": 746, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, persistence, command-and-control\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[PROMETHIUM](https://attack.mitre.org/groups/G0056) has used a script that configures the knockd service and firewall to only accept C2 connections from systems that use a specified sequence of knock ports.(Citation: Bitdefender StrongPity June 2020)", "header": "T1205.001", "name": "Port Knocking"}, {"_id": 747, "body": "[StrongPity](https://attack.mitre.org/software/S0491) is an information stealing malware used by [PROMETHIUM](https://attack.mitre.org/groups/G0056).(Citation: Bitdefender StrongPity June 2020)(Citation: Talos Promethium June 2020)", "color": "#ff3232", "header": "S0491", "name": "StrongPity"}, {"_id": 748, "body": "\u003cb\u003eAliases:\u003c/b\u003e Lotus Blossom, DRAGONFISH, Spring Dragon\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Lotus Blossom](https://attack.mitre.org/groups/G0030) is a threat group that has targeted government and military organizations in Southeast Asia. (Citation: Lotus Blossom Jun 2015)", "color": "#fce903", "group": 5, "header": "G0030", "name": "Lotus Blossom", "width": 10}, {"_id": 749, "body": "[Elise](https://attack.mitre.org/software/S0081) is a custom backdoor Trojan that appears to be used exclusively by [Lotus Blossom](https://attack.mitre.org/groups/G0030). It is part of a larger group of\ntools referred to as LStudio, ST Group, and APT0LSTU. (Citation: Lotus Blossom Jun 2015)(Citation: Accenture Dragonfish Jan 2018)", "color": "#ff3232", "header": "S0081", "name": "Elise"}, {"_id": 750, "body": "[Emissary](https://attack.mitre.org/software/S0082) is a Trojan that has been used by [Lotus Blossom](https://attack.mitre.org/groups/G0030). It shares code with [Elise](https://attack.mitre.org/software/S0081), with both Trojans being part of a malware group referred to as LStudio. (Citation: Lotus Blossom Dec 2015)", "color": "#ff3232", "header": "S0082", "name": "Emissary"}, {"_id": 751, "body": "\u003cb\u003eAliases:\u003c/b\u003e NEODYMIUM\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [NEODYMIUM](https://attack.mitre.org/groups/G0055) is an activity group that conducted a campaign in May 2016 and has heavily targeted Turkish victims. The group has demonstrated similarity to another activity group called [PROMETHIUM](https://attack.mitre.org/groups/G0056) due to overlapping victim and campaign characteristics. (Citation: Microsoft NEODYMIUM Dec 2016) (Citation: Microsoft SIR Vol 21) [NEODYMIUM](https://attack.mitre.org/groups/G0055) is reportedly associated closely with [BlackOasis](https://attack.mitre.org/groups/G0063) operations, but evidence that the group names are aliases has not been identified. (Citation: CyberScoop BlackOasis Oct 2017)", "color": "#fce903", "group": 5, "header": "G0055", "name": "NEODYMIUM", "width": 10}, {"_id": 752, "body": "[Wingbird](https://attack.mitre.org/software/S0176) is a backdoor that appears to be a version of commercial software [FinFisher](https://attack.mitre.org/software/S0182). It is reportedly used to attack individual computers instead of networks. It was used by [NEODYMIUM](https://attack.mitre.org/groups/G0055) in a May 2016 campaign. (Citation: Microsoft SIR Vol 21) (Citation: Microsoft NEODYMIUM Dec 2016)", "color": "#ff3232", "header": "S0176", "name": "Wingbird"}, {"_id": 753, "body": "\u003cb\u003eAliases:\u003c/b\u003e Taidoor\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Taidoor](https://attack.mitre.org/groups/G0015) is a threat group that has operated since at least 2009 and has primarily targeted the Taiwanese government. (Citation: TrendMicro Taidoor)", "color": "#fce903", "group": 5, "header": "G0015", "name": "Taidoor", "width": 10}, {"_id": 754, "body": "\u003cb\u003eAliases:\u003c/b\u003e Sandworm Team, ELECTRUM, Telebots, IRON VIKING, BlackEnergy (Group), Quedagh, VOODOO BEAR\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Sandworm Team](https://attack.mitre.org/groups/G0034) is a destructive threat group that has been attributed to Russia\u0027s General Staff Main Intelligence Directorate (GRU) Main Center for Special Technologies (GTsST) military unit 74455.(Citation: US District Court Indictment GRU Unit 74455 October 2020)(Citation: UK NCSC Olympic Attacks October 2020) This group has been active since at least 2009.(Citation: iSIGHT Sandworm 2014)(Citation: CrowdStrike VOODOO BEAR)(Citation: USDOJ Sandworm Feb 2020)(Citation: NCSC Sandworm Feb 2020)\n\nIn October 2020, the US indicted six GRU Unit 74455 officers associated with [Sandworm Team](https://attack.mitre.org/groups/G0034) for the following cyber operations: the 2015 and 2016 attacks against Ukrainian electrical companies and government organizations, the 2017 worldwide [NotPetya](https://attack.mitre.org/software/S0368) attack, targeting of the 2017 French presidential campaign, the 2018 [Olympic Destroyer](https://attack.mitre.org/software/S0365) attack against the Winter Olympic Games, the 2018 operation against the Organisation for the Prohibition of Chemical Weapons, and attacks against the country of Georgia in 2018 and 2019.(Citation: US District Court Indictment GRU Unit 74455 October 2020)(Citation: UK NCSC Olympic Attacks October 2020) Some of these were conducted with the assistance of GRU Unit 26165, which is also referred to as [APT28](https://attack.mitre.org/groups/G0007).(Citation: US District Court Indictment GRU Oct 2018)", "color": "#fce903", "group": 5, "header": "G0034", "name": "Sandworm Team", "width": 10}, {"_id": 755, "body": "[BlackEnergy](https://attack.mitre.org/software/S0089) is a malware toolkit that has been used by both criminal and APT actors. It dates back to at least 2007 and was originally designed to create botnets for use in conducting Distributed Denial of Service (DDoS) attacks, but its use has evolved to support various plug-ins. It is well known for being used during the confrontation between Georgia and Russia in 2008, as well as in targeting Ukrainian institutions. Variants include BlackEnergy 2 and BlackEnergy 3. (Citation: F-Secure BlackEnergy 2014)", "color": "#ff3232", "header": "S0089", "name": "BlackEnergy"}, {"_id": 756, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation, defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eOne variant of [BlackEnergy](https://attack.mitre.org/software/S0089) locates existing driver services that have been disabled and drops its driver component into one of those service\u0027s paths, replacing the legitimate executable. The malware then sets the hijacked service to start automatically to establish persistence.(Citation: F-Secure BlackEnergy 2014)", "header": "T1574.010", "name": "Services File Permissions Weakness"}, {"_id": 757, "body": "[Exaramel for Windows](https://attack.mitre.org/software/S0343) is a backdoor used for targeting Windows systems. The Linux version is tracked separately under [Exaramel for Linux](https://attack.mitre.org/software/S0401).(Citation: ESET TeleBots Oct 2018)", "color": "#ff3232", "header": "S0343", "name": "Exaramel for Windows"}, {"_id": 758, "body": "[Exaramel for Linux](https://attack.mitre.org/software/S0401) is a backdoor written in the Go Programming Language and compiled as a 64-bit ELF binary. The Windows version is tracked separately under [Exaramel for Windows](https://attack.mitre.org/software/S0343).(Citation: ESET TeleBots Oct 2018)", "color": "#ff3232", "header": "S0401", "name": "Exaramel for Linux"}, {"_id": 759, "body": "\u003cb\u003eTactics:\u003c/b\u003e privilege-escalation, defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Exaramel for Linux](https://attack.mitre.org/software/S0401) can execute commands with high privileges via a specific binary with setuid functionality.(Citation: ANSSI Sandworm January 2021)", "header": "T1548.001", "name": "Setuid and Setgid"}, {"_id": 760, "body": "[Olympic Destroyer](https://attack.mitre.org/software/S0365) is malware that was used by [Sandworm Team](https://attack.mitre.org/groups/G0034) against the 2018 Winter Olympics, held in Pyeongchang, South Korea. The main purpose of the malware was to render infected computer systems inoperable. The malware leverages various native Windows utilities and API calls to carry out its destructive tasks. [Olympic Destroyer](https://attack.mitre.org/software/S0365) has worm-like features to spread itself across a computer network in order to maximize its destructive impact.(Citation: Talos Olympic Destroyer 2018)(Citation: US District Court Indictment GRU Unit 74455 October 2020) ", "color": "#ff3232", "header": "S0365", "name": "Olympic Destroyer"}, {"_id": 761, "body": "[NotPetya](https://attack.mitre.org/software/S0368) is malware that was used by [Sandworm Team](https://attack.mitre.org/groups/G0034) in a worldwide attack starting on June 27, 2017. While [NotPetya](https://attack.mitre.org/software/S0368) appears as a form of ransomware, its main purpose was to destroy data and disk structures on compromised systems; the attackers never intended to make the encrypted data recoverable. As such, [NotPetya](https://attack.mitre.org/software/S0368) may be more appropriately thought of as a form of wiper malware. [NotPetya](https://attack.mitre.org/software/S0368) contains worm-like features to spread itself across a computer network using the SMBv1 exploits EternalBlue and EternalRomance.(Citation: Talos Nyetya June 2017)(Citation: US-CERT NotPetya 2017)(Citation: ESET Telebots June 2017)(Citation: US District Court Indictment GRU Unit 74455 October 2020)", "color": "#ff3232", "header": "S0368", "name": "NotPetya"}, {"_id": 762, "body": "[Invoke-PSImage](https://attack.mitre.org/software/S0231) takes a PowerShell script and embeds the bytes of the script into the pixels of a PNG image. It generates a one liner for executing either from a file of from the web. Example of usage is embedding the PowerShell code from the Invoke-Mimikatz module and embed it into an image file. By calling the image file from a macro for example, the macro will download the picture and execute the PowerShell code, which in this case will dump the passwords. (Citation: GitHub Invoke-PSImage)", "color": "#ff1a8c", "header": "S0231", "name": "Invoke-PSImage"}, {"_id": 763, "body": "\u003cb\u003eTactic:\u003c/b\u003e reconnaissance\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Sandworm Team](https://attack.mitre.org/groups/G0034) conducted technical reconnaissance of the Parliament of Georgia\u0027s official internet domain prior to its 2019 attack.(Citation: US District Court Indictment GRU Unit 74455 October 2020)", "header": "T1590.001", "name": "Domain Properties"}, {"_id": 764, "body": "\u003cb\u003eTactic:\u003c/b\u003e impact\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Sandworm Team](https://attack.mitre.org/groups/G0034) defaced approximately 15,000 websites belonging to Georgian government, non-government, and private sector organizations in 2019.(Citation: US District Court Indictment GRU Unit 74455 October 2020)(Citation: UK NCSC Olympic Attacks October 2020)", "header": "T1491.002", "name": "External Defacement"}, {"_id": 765, "body": "\u003cb\u003eTactic:\u003c/b\u003e reconnaissance\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Sandworm Team](https://attack.mitre.org/groups/G0034) has conducted research against potential victim websites as part of its operational planning.(Citation: US District Court Indictment GRU Unit 74455 October 2020)", "header": "T1594", "name": "Search Victim-Owned Websites"}, {"_id": 766, "body": "\u003cb\u003eTactic:\u003c/b\u003e resource-development\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eIn 2017, [Sandworm Team](https://attack.mitre.org/groups/G0034) conducted technical research related to vulnerabilities associated with websites used by the Korean Sport and Olympic Committee, a Korean power company, and a Korean airport.(Citation: US District Court Indictment GRU Unit 74455 October 2020)", "header": "T1588.006", "name": "Vulnerabilities"}, {"_id": 767, "body": "\u003cb\u003eTactic:\u003c/b\u003e reconnaissance\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003eIn preparation for its attack against the 2018 Winter Olympics, [Sandworm Team](https://attack.mitre.org/groups/G0034) conducted online research of partner organizations listed on an official PyeongChang Olympics partnership site.(Citation: US District Court Indictment GRU Unit 74455 October 2020)", "header": "T1591.002", "name": "Business Relationships"}, {"_id": 768, "body": "\u003cb\u003eTactic:\u003c/b\u003e reconnaissance\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Sandworm Team](https://attack.mitre.org/groups/G0034) researched Ukraine\u0027s unique legal entity identifier (called an \"EDRPOU\" number), including running queries on the EDRPOU website, in preparation for the [NotPetya](https://attack.mitre.org/software/S0368) attack. [Sandworm Team](https://attack.mitre.org/groups/G0034) has also researched third-party websites to help it craft credible spearphishing emails.(Citation: US District Court Indictment GRU Unit 74455 October 2020)", "header": "T1593", "name": "Search Open Websites/Domains"}, {"_id": 769, "body": "\u003cb\u003eTactic:\u003c/b\u003e reconnaissance\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Sandworm Team](https://attack.mitre.org/groups/G0034) has researched software code to enable supply-chain operations, most notably for the 2017 [NotPetya](https://attack.mitre.org/software/S0368) attack. [Sandworm Team](https://attack.mitre.org/groups/G0034) also collected a list of computers using specific software as part of its targeting efforts.(Citation: US District Court Indictment GRU Unit 74455 October 2020)", "header": "T1592.002", "name": "Software"}, {"_id": 770, "body": "\u003cb\u003eTactic:\u003c/b\u003e reconnaissance\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Sandworm Team](https://attack.mitre.org/groups/G0034)\u0027s research of potential victim organizations included the identification and collection of employee information.(Citation: US District Court Indictment GRU Unit 74455 October 2020)", "header": "T1589.003", "name": "Employee Names"}, {"_id": 771, "body": "[P.A.S. Webshell](https://attack.mitre.org/software/S0598) is a publicly available multifunctional PHP webshell in use since at least 2016 that provides remote access and execution on target web servers.(Citation: ANSSI Sandworm January 2021)", "color": "#ff3232", "header": "S0598", "name": "P.A.S. Webshell"}, {"_id": 772, "body": "\u003cb\u003eAliases:\u003c/b\u003e Stolen Pencil\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Stolen Pencil](https://attack.mitre.org/groups/G0086) is a threat group likely originating from DPRK that has been active since at least May 2018. The group appears to have targeted academic institutions, but its motives remain unclear.(Citation: Netscout Stolen Pencil Dec 2018)", "color": "#fce903", "group": 5, "header": "G0086", "name": "Stolen Pencil", "width": 10}, {"_id": 773, "body": "\u003cb\u003eTactic:\u003c/b\u003e persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Stolen Pencil](https://attack.mitre.org/groups/G0086) victims are prompted to install malicious Google Chrome extensions which gave the threat actor the ability to read data from any website accessed. (Citation: Netscout Stolen Pencil Dec 2018)", "header": "T1176", "name": "Browser Extensions"}, {"_id": 774, "body": "\u003cb\u003eAliases:\u003c/b\u003e APT39, REMIX KITTEN, ITG07, Chafer\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [APT39](https://attack.mitre.org/groups/G0087) is one of several names for cyberespionage activity conducted by the Iranian Ministry of Intelligence and Security (MOIS) through the front company Rana Intelligence Computing since at least 2014. [APT39](https://attack.mitre.org/groups/G0087) has primarily targeted the travel, hospitality, academic, and telecommunications industries in Iran and across Asia, Africa, Europe, and North America to track individuals and entities considered to be a threat by the MOIS.(Citation: FireEye APT39 Jan 2019)(Citation: Symantec Chafer Dec 2015)(Citation: FBI FLASH APT39 September 2020)(Citation: Dept. of Treasury Iran Sanctions September 2020)(Citation: DOJ Iran Indictments September 2020)", "color": "#fce903", "group": 5, "header": "G0087", "name": "APT39", "width": 10}, {"_id": 775, "body": "[Remexi](https://attack.mitre.org/software/S0375) is a Windows-based Trojan that was developed in the C programming language.(Citation: Securelist Remexi Jan 2019)", "color": "#ff3232", "header": "S0375", "name": "Remexi"}, {"_id": 776, "body": "[Cadelspy](https://attack.mitre.org/software/S0454) is a backdoor that has been used by [APT39](https://attack.mitre.org/groups/G0087).(Citation: Symantec Chafer Dec 2015)", "color": "#ff3232", "header": "S0454", "name": "Cadelspy"}, {"_id": 777, "body": "[MechaFlounder](https://attack.mitre.org/software/S0459) is a python-based remote access tool (RAT) that has been used by [APT39](https://attack.mitre.org/groups/G0087). The payload uses a combination of actor developed code and code snippets freely available online in development communities.(Citation: Unit 42 MechaFlounder March 2019)", "color": "#ff3232", "header": "S0459", "name": "MechaFlounder"}, {"_id": 778, "body": "\u003cb\u003eTactics:\u003c/b\u003e collection, credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT39](https://attack.mitre.org/groups/G0087) has utilized tools to capture mouse movements.(Citation: FBI FLASH APT39 September 2020)", "header": "T1056", "name": "Input Capture"}, {"_id": 779, "body": "\u003cb\u003eTactics:\u003c/b\u003e privilege-escalation, persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT39](https://attack.mitre.org/groups/G0087) has used malware to set \u003ccode\u003eLoadAppInit_DLLs\u003c/code\u003e in the Registry key \u003ccode\u003eSOFTWARE\\Microsoft\\Windows NT\\CurrentVersion\\Windows\u003c/code\u003e in order to establish persistence.(Citation: FBI FLASH APT39 September 2020)", "header": "T1546.010", "name": "AppInit DLLs"}, {"_id": 780, "body": "\u003cb\u003eAliases:\u003c/b\u003e The White Company\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [The White Company](https://attack.mitre.org/groups/G0089) is a likely state-sponsored threat actor with advanced capabilities. From 2017 through 2018, the group led an espionage campaign called Operation Shaheen targeting government and military organizations in Pakistan.(Citation: Cylance Shaheen Nov 2018)", "color": "#fce903", "group": 5, "header": "G0089", "name": "The White Company", "width": 10}, {"_id": 781, "body": "[Revenge RAT](https://attack.mitre.org/software/S0379) is a freely available remote access tool written in .NET (C#).(Citation: Cylance Shaheen Nov 2018)(Citation: Cofense RevengeRAT Feb 2019)", "color": "#ff3232", "header": "S0379", "name": "Revenge RAT"}, {"_id": 782, "body": "\u003cb\u003eAliases:\u003c/b\u003e WIRTE\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [WIRTE](https://attack.mitre.org/groups/G0090) is a threat group that has been active since at least August 2018. The group focuses on targeting Middle East defense and diplomats.(Citation: Lab52 WIRTE Apr 2019)", "color": "#fce903", "group": 5, "header": "G0090", "name": "WIRTE", "width": 10}, {"_id": 783, "body": "\u003cb\u003eAliases:\u003c/b\u003e Silence, WHISPER SPIDER\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Silence](https://attack.mitre.org/groups/G0091) is a financially motivated threat actor targeting financial institutions in different countries. The group was first seen in June 2016. Their main targets reside in Russia, Ukraine, Belarus, Azerbaijan, Poland and Kazakhstan. They compromised various banking systems, including the Russian Central Bank\u0027s Automated Workstation Client, ATMs, and card processing.(Citation: Cyber Forensicator Silence Jan 2019)(Citation: SecureList Silence Nov 2017) ", "color": "#fce903", "group": 5, "header": "G0091", "name": "Silence", "width": 10}, {"_id": 784, "body": "\u003cb\u003eAliases:\u003c/b\u003e TA505, Hive0065\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [TA505](https://attack.mitre.org/groups/G0092) is a financially motivated threat group that has been active since at least 2014. The group is known for frequently changing malware and driving global trends in criminal malware distribution.(Citation: Proofpoint TA505 Sep 2017)(Citation: Proofpoint TA505 June 2018)(Citation: Proofpoint TA505 Jan 2019)", "color": "#fce903", "group": 5, "header": "G0092", "name": "TA505", "width": 10}, {"_id": 785, "body": "[TrickBot](https://attack.mitre.org/software/S0266) is a Trojan spyware program that has mainly been used for targeting banking sites in United States, Canada, UK, Germany, Australia, Austria, Ireland, London, Switzerland, and Scotland. TrickBot first emerged in the wild in September 2016 and appears to be a successor to [Dyre](https://attack.mitre.org/software/S0024). [TrickBot](https://attack.mitre.org/software/S0266) is developed in the C++ programming language. (Citation: S2 Grupo TrickBot June 2017) (Citation: Fidelis TrickBot Oct 2016) (Citation: IBM TrickBot Nov 2016)", "color": "#ff3232", "header": "S0266", "name": "TrickBot"}, {"_id": 786, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[TrickBot](https://attack.mitre.org/software/S0266) can steal passwords from the KeePass open source password manager.(Citation: Cyberreason Anchor December 2019)", "header": "T1555.005", "name": "Password Managers"}, {"_id": 787, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[TrickBot](https://attack.mitre.org/software/S0266) uses brute-force attack against RDP with rdpscanDll module.(Citation: ESET Trickbot Oct 2020)(Citation: Bitdefender Trickbot March 2020)", "header": "T1110.004", "name": "Credential Stuffing"}, {"_id": 788, "body": "\u003cb\u003eTactic:\u003c/b\u003e impact\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[TrickBot](https://attack.mitre.org/software/S0266) module \"Trickboot\" can write or erase the UEFI/BIOS firmware of a compromised device.(Citation: Eclypsium Trickboot December 2020)", "header": "T1495", "name": "Firmware Corruption"}, {"_id": 789, "body": "[ServHelper](https://attack.mitre.org/software/S0382) is a backdoor first observed in late 2018. The backdoor is written in Delphi and is typically delivered as a DLL file.(Citation: Proofpoint TA505 Jan 2019)", "color": "#ff3232", "header": "S0382", "name": "ServHelper"}, {"_id": 790, "body": "[FlawedGrace](https://attack.mitre.org/software/S0383) is a fully featured remote access tool (RAT) written in C++ that was first observed in late 2017.(Citation: Proofpoint TA505 Jan 2019)", "color": "#ff3232", "header": "S0383", "name": "FlawedGrace"}, {"_id": 791, "body": "[Dridex](https://attack.mitre.org/software/S0384) is a banking Trojan that has been used for financial gain. Dridex was created from the source code of the Bugat banking trojan (also known as Cridex).(Citation: Dell Dridex Oct 2015)(Citation: Kaspersky Dridex May 2017)", "color": "#ff3232", "header": "S0384", "name": "Dridex"}, {"_id": 792, "body": "[SDBbot](https://attack.mitre.org/software/S0461) is a backdoor with installer and loader components that has been used by [TA505](https://attack.mitre.org/groups/G0092) since at least 2019.(Citation: Proofpoint TA505 October 2019)(Citation: IBM TA505 April 2020)", "color": "#ff3232", "header": "S0461", "name": "SDBbot"}, {"_id": 793, "body": "[Get2](https://attack.mitre.org/software/S0460) is a downloader written in C++ that has been used by [TA505](https://attack.mitre.org/groups/G0092) to deliver [FlawedGrace](https://attack.mitre.org/software/S0383), [FlawedAmmyy](https://attack.mitre.org/software/S0381), Snatch and [SDBbot](https://attack.mitre.org/software/S0461).(Citation: Proofpoint TA505 October 2019)", "color": "#ff3232", "header": "S0460", "name": "Get2"}, {"_id": 794, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[TA505](https://attack.mitre.org/groups/G0092) has used .iso files to deploy malicious .lnk files.(Citation: TrendMicro TA505 Aug 2019)", "header": "T1553.005", "name": "Mark-of-the-Web Bypass"}, {"_id": 795, "body": "\u003cb\u003eAliases:\u003c/b\u003e GALLIUM, Operation Soft Cell\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [GALLIUM](https://attack.mitre.org/groups/G0093) is a group that has been active since at least 2012, primarily targeting high-profile telecommunications networks. [GALLIUM](https://attack.mitre.org/groups/G0093) has been identified in some reporting as likely a Chinese state-sponsored group, based in part on tools used and TTPs commonly associated with Chinese threat actors.(Citation: Cybereason Soft Cell June 2019)(Citation: Microsoft GALLIUM December 2019)", "color": "#fce903", "group": 5, "header": "G0093", "name": "GALLIUM", "width": 10}, {"_id": 796, "body": "[BlackMould](https://attack.mitre.org/software/S0564) is a web shell based on [China Chopper](https://attack.mitre.org/software/S0020) for servers running Microsoft IIS. First reported in December 2019, it has been used in malicious campaigns by [GALLIUM](https://attack.mitre.org/groups/G0093) against telecommunication providers.(Citation: Microsoft GALLIUM December 2019)", "color": "#ff3232", "header": "S0564", "name": "BlackMould"}, {"_id": 797, "body": "\u003cb\u003eAliases:\u003c/b\u003e Kimsuky, Thallium, Black Banshee, Velvet Chollima\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Kimsuky](https://attack.mitre.org/groups/G0094) is a North Korean-based threat group that has been active since at least September 2013. The group initially focused on targeting Korean think tanks and DPRK/nuclear-related targets, expanding recently to the United States, Russia, and Europe. The group was attributed as the actor behind the Korea Hydro \u0026 Nuclear Power Co. compromise.(Citation: EST Kimsuky April 2019)(Citation: BRI Kimsuky April 2019)(Citation: Cybereason Kimsuky November 2020)", "color": "#fce903", "group": 5, "header": "G0094", "name": "Kimsuky", "width": 10}, {"_id": 798, "body": "\u003cb\u003eTactics:\u003c/b\u003e privilege-escalation, persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Kimsuky](https://attack.mitre.org/groups/G0094) has a HWP document stealer module which changes the default program association in the registry to open HWP documents.(Citation: Securelist Kimsuky Sept 2013)", "header": "T1546.001", "name": "Change Default File Association"}, {"_id": 799, "body": "\u003cb\u003eTactic:\u003c/b\u003e resource-development\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Kimsuky](https://attack.mitre.org/groups/G0094) created and used a mailing toolkit to use in spearphishing attacks.(Citation: VirusBulletin Kimsuky October 2019)", "header": "T1587", "name": "Develop Capabilities"}, {"_id": 800, "body": "[BabyShark](https://attack.mitre.org/software/S0414) is a Microsoft Visual Basic (VB) script-based malware family that is believed to be associated with several North Korean campaigns. (Citation: Unit42 BabyShark Feb 2019)", "color": "#ff3232", "header": "S0414", "name": "BabyShark"}, {"_id": 801, "body": "\u003cb\u003eTactics:\u003c/b\u003e credential-access, collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Kimsuky](https://attack.mitre.org/groups/G0094) has used modified versions of PHProxy to examine web traffic between the victim and the accessed website.(Citation: CISA AA20-301A Kimsuky)", "header": "T1557", "name": "Man-in-the-Middle"}, {"_id": 802, "body": "\u003cb\u003eTactic:\u003c/b\u003e collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Kimsuky](https://attack.mitre.org/groups/G0094) has set auto-forward rules on victim\u0027s e-mail accounts.(Citation: CISA AA20-301A Kimsuky)", "header": "T1114.003", "name": "Email Forwarding Rule"}, {"_id": 803, "body": "[KGH_SPY](https://attack.mitre.org/software/S0526) is a modular suite of tools used by [Kimsuky](https://attack.mitre.org/groups/G0094) for reconnaissance, information stealing, and backdoor capabilities. [KGH_SPY](https://attack.mitre.org/software/S0526) derived its name from PDB paths and internal names found in samples containing \"KGH\".(Citation: Cybereason Kimsuky November 2020)", "color": "#ff3232", "header": "S0526", "name": "KGH_SPY"}, {"_id": 804, "body": "[NOKKI](https://attack.mitre.org/software/S0353) is a modular remote access tool. The earliest observed attack using [NOKKI](https://attack.mitre.org/software/S0353) was in January 2018. [NOKKI](https://attack.mitre.org/software/S0353) has significant code overlap with the [KONNI](https://attack.mitre.org/software/S0356) malware family. There is some evidence potentially linking [NOKKI](https://attack.mitre.org/software/S0353) to [APT37](https://attack.mitre.org/groups/G0067).(Citation: Unit 42 NOKKI Sept 2018)(Citation: Unit 42 Nokki Oct 2018)", "color": "#ff3232", "header": "S0353", "name": "NOKKI"}, {"_id": 805, "body": "[CSPY Downloader](https://attack.mitre.org/software/S0527) is a tool designed to evade analysis and download additional payloads used by [Kimsuky](https://attack.mitre.org/groups/G0094).(Citation: Cybereason Kimsuky November 2020)", "color": "#ff1a8c", "header": "S0527", "name": "CSPY Downloader"}, {"_id": 806, "body": "\u003cb\u003eAliases:\u003c/b\u003e Machete, APT-C-43, El Machete\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Machete](https://attack.mitre.org/groups/G0095) is a suspected Spanish-speaking cyber espionage group that has been active since at least 2010. It has primarily focused its operations within Latin America, with a particular emphasis on Venezuela, but also in the US, Europe, Russia, and parts of Asia. [Machete](https://attack.mitre.org/groups/G0095) generally targets high-profile organizations such as government institutions, intelligence services, and military units, as well as telecommunications and power companies.(Citation: Cylance Machete Mar 2017)(Citation: Securelist Machete Aug 2014)(Citation: ESET Machete July 2019)(Citation: 360 Machete Sep 2020)", "color": "#fce903", "group": 5, "header": "G0095", "name": "Machete", "width": 10}, {"_id": 807, "body": "\u003cb\u003eAliases:\u003c/b\u003e APT41, WICKED PANDA\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [APT41](https://attack.mitre.org/groups/G0096) is a threat group that researchers have assessed as Chinese state-sponsored espionage group that also conducts financially-motivated operations. [APT41](https://attack.mitre.org/groups/G0096) has been active since as early as 2012. The group has been observed targeting healthcare, telecom, technology, and video game industries in 14 countries.(Citation: FireEye APT41 Aug 2019)", "color": "#fce903", "group": 5, "header": "G0096", "name": "APT41", "width": 10}, {"_id": 808, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT41](https://attack.mitre.org/groups/G0096) attempted to remove evidence of some of its activity by deleting Bash histories.(Citation: FireEye APT41 Aug 2019)", "header": "T1070.003", "name": "Clear Command History"}, {"_id": 809, "body": "[ROCKBOOT](https://attack.mitre.org/software/S0112) is a [Bootkit](https://attack.mitre.org/techniques/T1542/003) that has been used by an unidentified, suspected China-based group. (Citation: FireEye Bootkits)", "color": "#ff3232", "header": "S0112", "name": "ROCKBOOT"}, {"_id": 810, "body": "[MESSAGETAP](https://attack.mitre.org/software/S0443) is a data mining malware family deployed by [APT41](https://attack.mitre.org/groups/G0096) into telecommunications networks to monitor and save SMS traffic from specific phone numbers, IMSI numbers, or that contain specific keywords. (Citation: FireEye MESSAGETAP October 2019)", "color": "#ff3232", "header": "S0443", "name": "MESSAGETAP"}, {"_id": 811, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation, defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[APT41](https://attack.mitre.org/groups/G0096) has configured payloads to load via LD_PRELOAD.(Citation: Crowdstrike GTR2020 Mar 2020)\t", "header": "T1574.006", "name": "Dynamic Linker Hijacking"}, {"_id": 812, "body": "[Winnti for Linux](https://attack.mitre.org/software/S0430) is a trojan, seen since at least 2015, designed specifically for targeting Linux systems. Reporting indicates the winnti malware family is shared across a number of actors including [Winnti Group](https://attack.mitre.org/groups/G0044). The Windows variant is tracked separately under [Winnti for Windows](https://attack.mitre.org/software/S0141).(Citation: Chronicle Winnti for Linux May 2019)", "color": "#ff3232", "header": "S0430", "name": "Winnti for Linux"}, {"_id": 813, "body": "\u003cb\u003eAliases:\u003c/b\u003e APT-C-36, Blind Eagle\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [APT-C-36](https://attack.mitre.org/groups/G0099) is a suspected South America espionage group that has been active since at least 2018. The group mainly targets Colombian government institutions as well as important corporations in the financial sector, petroleum industry, and professional manufacturing.(Citation: QiAnXin APT-C-36 Feb2019)", "color": "#fce903", "group": 5, "header": "G0099", "name": "APT-C-36", "width": 10}, {"_id": 814, "body": "[Imminent Monitor](https://attack.mitre.org/software/S0434) was a commodity remote access tool (RAT) offered for sale from 2012 until 2019, when an operation was conducted to take down the Imminent Monitor infrastructure. Various cracked versions and variations of this RAT are still in circulation.(Citation: Imminent Unit42 Dec2019)", "color": "#ff1a8c", "header": "S0434", "name": "Imminent Monitor"}, {"_id": 815, "body": "\u003cb\u003eAliases:\u003c/b\u003e BlackTech\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [BlackTech](https://attack.mitre.org/groups/G0098) is a cyber espionage group operating against targets in East Asia, particularly Taiwan, and occasionally, Japan and Hong Kong.(Citation: TrendMicro BlackTech June 2017)", "color": "#fce903", "group": 5, "header": "G0098", "name": "BlackTech", "width": 10}, {"_id": 816, "body": "[TSCookie](https://attack.mitre.org/software/S0436) is a remote access tool (RAT) that has been used by [BlackTech](https://attack.mitre.org/groups/G0098) in campaigns against Japanese targets.(Citation: JPCert TSCookie March 2018)(Citation: JPCert BlackTech Malware September 2019). [TSCookie](https://attack.mitre.org/software/S0436) has been referred to as [PLEAD](https://attack.mitre.org/software/S0435) though more recent reporting indicates a separation between the two.(Citation: JPCert PLEAD Downloader June 2018)(Citation: JPCert BlackTech Malware September 2019)", "color": "#ff3232", "header": "S0436", "name": "TSCookie"}, {"_id": 817, "body": "[PLEAD](https://attack.mitre.org/software/S0435) is a remote access tool (RAT) and downloader used by [BlackTech](https://attack.mitre.org/groups/G0098) in targeted attacks in East Asia including Taiwan, Japan, and Hong Kong.(Citation: TrendMicro BlackTech June 2017)(Citation: JPCert PLEAD Downloader June 2018) [PLEAD](https://attack.mitre.org/software/S0435) has also been referred to as [TSCookie](https://attack.mitre.org/software/S0436), though more recent reporting indicates likely separation between the two.(Citation: JPCert TSCookie March 2018)(Citation: JPCert PLEAD Downloader June 2018) ", "color": "#ff3232", "header": "S0435", "name": "PLEAD"}, {"_id": 818, "body": "[Kivars](https://attack.mitre.org/software/S0437) is a modular remote access tool (RAT), derived from the Bifrost RAT, that was used by [BlackTech](https://attack.mitre.org/groups/G0098) in a 2010 campaign.(Citation: TrendMicro BlackTech June 2017)", "color": "#ff3232", "header": "S0437", "name": "Kivars"}, {"_id": 819, "body": "\u003cb\u003eTactic:\u003c/b\u003e lateral-movement\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Kivars](https://attack.mitre.org/software/S0437) has the ability to remotely trigger keyboard input and mouse clicks. (Citation: TrendMicro BlackTech June 2017)", "header": "T1021", "name": "Remote Services"}, {"_id": 820, "body": "[Waterbear](https://attack.mitre.org/software/S0579) is modular malware attributed to [BlackTech](https://attack.mitre.org/groups/G0098) that has been used primarily for lateral movement, decrypting, and triggering payloads and is capable of hiding network behaviors.(Citation: Trend Micro Waterbear December 2019)", "color": "#ff3232", "header": "S0579", "name": "Waterbear"}, {"_id": 821, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Waterbear](https://attack.mitre.org/software/S0579) can hook the \u003ccode\u003eZwOpenProcess\u003c/code\u003e and \u003ccode\u003eGetExtendedTcpTable\u003c/code\u003e APIs called by the process of a security product to hide PIDs and TCP records from detection.(Citation: Trend Micro Waterbear December 2019)", "header": "T1562.006", "name": "Indicator Blocking"}, {"_id": 822, "body": "\u003cb\u003eAliases:\u003c/b\u003e Inception, Inception Framework, Cloud Atlas\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Inception](https://attack.mitre.org/groups/G0100) is a cyber espionage group active since at least 2014. The group has targeted multiple industries and governmental entities primarily in Russia, but has also been active in the United States and throughout Europe, Asia, Africa, and the Middle East.(Citation: Unit 42 Inception November 2018)(Citation: Symantec Inception Framework March 2018)(Citation: Kaspersky Cloud Atlas December 2014)", "color": "#fce903", "group": 5, "header": "G0100", "name": "Inception", "width": 10}, {"_id": 823, "body": "[PowerShower](https://attack.mitre.org/software/S0441) is a PowerShell backdoor used by [Inception](https://attack.mitre.org/groups/G0100) for initial reconnaissance and to download and execute second stage payloads.(Citation: Unit 42 Inception November 2018)(Citation: Kaspersky Cloud Atlas August 2019)", "color": "#ff3232", "header": "S0441", "name": "PowerShower"}, {"_id": 824, "body": "[VBShower](https://attack.mitre.org/software/S0442) is a backdoor that has been used by [Inception](https://attack.mitre.org/groups/G0100) since at least 2019. [VBShower](https://attack.mitre.org/software/S0442) has been used as a downloader for second stage payloads, including [PowerShower](https://attack.mitre.org/software/S0441).(Citation: Kaspersky Cloud Atlas August 2019)", "color": "#ff3232", "header": "S0442", "name": "VBShower"}, {"_id": 825, "body": "\u003cb\u003eAliases:\u003c/b\u003e Frankenstein\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Frankenstein](https://attack.mitre.org/groups/G0101) is a campaign carried out between January and April 2019 by unknown threat actors. The campaign name comes from the actors\u0027 ability to piece together several unrelated components.(Citation: Talos Frankenstein June 2019)  ", "color": "#fce903", "group": 5, "header": "G0101", "name": "Frankenstein", "width": 10}, {"_id": 826, "body": "\u003cb\u003eAliases:\u003c/b\u003e Wizard Spider, UNC1878, TEMP.MixMaster, Grim Spider\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Wizard Spider](https://attack.mitre.org/groups/G0102) is a financially motivated criminal group that has been conducting ransomware campaigns since at least August 2018 against a variety of organizations, ranging from major corporations to hospitals.(Citation: CrowdStrike Ryuk January 2019)(Citation: DHS/CISA Ransomware Targeting Healthcare October 2020)", "color": "#fce903", "group": 5, "header": "G0102", "name": "Wizard Spider", "width": 10}, {"_id": 827, "body": "[Emotet](https://attack.mitre.org/software/S0367) is a modular malware variant which is primarily used as a downloader for other malware variants such as [TrickBot](https://attack.mitre.org/software/S0266) and [IcedID](https://attack.mitre.org/software/S0483). Emotet first emerged in June 2014 and has been primarily used to target the banking sector. (Citation: Trend Micro Banking Malware Jan 2019)", "color": "#ff3232", "header": "S0367", "name": "Emotet"}, {"_id": 828, "body": "\u003cb\u003eTactic:\u003c/b\u003e collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Wizard Spider](https://attack.mitre.org/groups/G0102) has collected and staged credentials and network enumeration information, using  the networkdll and psfin [TrickBot](https://attack.mitre.org/software/S0266) modules.(Citation: CrowdStrike Grim Spider May 2019)", "header": "T1074", "name": "Data Staged"}, {"_id": 829, "body": "[Dyre](https://attack.mitre.org/software/S0024) is a banking Trojan that has been used for financial gain. \n (Citation: Symantec Dyre June 2015)(Citation: Malwarebytes Dyreza November 2015)", "color": "#ff3232", "header": "S0024", "name": "Dyre"}, {"_id": 830, "body": "[Nltest](https://attack.mitre.org/software/S0359) is a Windows command-line utility used to list domain controllers and enumerate domain trusts.(Citation: Nltest Manual)", "color": "#ff1a8c", "header": "S0359", "name": "Nltest"}, {"_id": 831, "body": "[BloodHound](https://attack.mitre.org/software/S0521) is an Active Directory (AD) reconnaissance tool that can reveal hidden relationships and identify attack paths within an AD environment.(Citation: GitHub Bloodhound)(Citation: CrowdStrike BloodHound April 2018)(Citation: FoxIT Wocao December 2019)", "color": "#ff1a8c", "header": "S0521", "name": "BloodHound"}, {"_id": 832, "body": "\u003cb\u003eAliases:\u003c/b\u003e Mofang\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Mofang](https://attack.mitre.org/groups/G0103) is a likely China-based cyber espionage group, named for its frequent practice of imitating a victim\u0027s infrastructure. This adversary has been observed since at least May 2012 conducting focused attacks against government and critical infrastructure in Myanmar, as well as several other countries and sectors including military, automobile, and weapons industries.(Citation: FOX-IT May 2016 Mofang)", "color": "#fce903", "group": 5, "header": "G0103", "name": "Mofang", "width": 10}, {"_id": 833, "body": "[ShimRatReporter](https://attack.mitre.org/software/S0445) is a tool used by suspected Chinese adversary [Mofang](https://attack.mitre.org/groups/G0103) to automatically conduct initial discovery. The details from this discovery are used to customize follow-on payloads (such as [ShimRat](https://attack.mitre.org/software/S0444)) as well as set up faux infrastructure which mimics the adversary\u0027s targets. [ShimRatReporter](https://attack.mitre.org/software/S0445) has been used in campaigns targeting multiple countries and sectors including government, military, critical infrastructure, automobile, and weapons development.(Citation: FOX-IT May 2016 Mofang)", "color": "#ff1a8c", "header": "S0445", "name": "ShimRatReporter"}, {"_id": 834, "body": "[ShimRat](https://attack.mitre.org/software/S0444) has been used by the suspected China-based adversary [Mofang](https://attack.mitre.org/groups/G0103) in campaigns targeting multiple countries and sectors including government, military, critical infrastructure, automobile, and weapons development. The name \"[ShimRat](https://attack.mitre.org/software/S0444)\" comes from the malware\u0027s extensive use of Windows Application Shimming to maintain persistence. (Citation: FOX-IT May 2016 Mofang)", "color": "#ff3232", "header": "S0444", "name": "ShimRat"}, {"_id": 835, "body": "\u003cb\u003eAliases:\u003c/b\u003e Sharpshooter\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e Operation [Sharpshooter](https://attack.mitre.org/groups/G0104) is the name of a cyber espionage campaign discovered in October 2018 targeting nuclear, defense, energy, and financial companies. Though overlaps between this adversary and [Lazarus Group](https://attack.mitre.org/groups/G0032) have been noted, definitive links have not been established.(Citation: McAfee Sharpshooter December 2018)", "color": "#fce903", "group": 5, "header": "G0104", "name": "Sharpshooter", "width": 10}, {"_id": 836, "body": "[Rising Sun](https://attack.mitre.org/software/S0448) is a modular backdoor malware used extensively in Operation [Sharpshooter](https://attack.mitre.org/groups/G0104). The malware has been observed targeting nuclear, defense, energy, and financial services companies across the world. [Rising Sun](https://attack.mitre.org/software/S0448) uses source code from [Lazarus Group](https://attack.mitre.org/groups/G0032)\u0027s Trojan Duuzer.(Citation: McAfee Sharpshooter December 2018)", "color": "#ff3232", "header": "S0448", "name": "Rising Sun"}, {"_id": 837, "body": "\u003cb\u003eAliases:\u003c/b\u003e DarkVishnya\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [DarkVishnya](https://attack.mitre.org/groups/G0105) is a financially motivated threat actor targeting financial institutions in Eastern Europe. In 2017-2018 the group attacked at least 8 banks in this region.(Citation: Securelist DarkVishnya Dec 2018)", "color": "#fce903", "group": 5, "header": "G0105", "name": "DarkVishnya", "width": 10}, {"_id": 838, "body": "\u003cb\u003eTactic:\u003c/b\u003e initial-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[DarkVishnya](https://attack.mitre.org/groups/G0105) used Bash Bunny, Raspberry Pi, netbooks or inexpensive laptops to connect to the company\u2019s local network.(Citation: Securelist DarkVishnya Dec 2018)", "header": "T1200", "name": "Hardware Additions"}, {"_id": 839, "body": "\u003cb\u003eAliases:\u003c/b\u003e Rocke\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Rocke](https://attack.mitre.org/groups/G0106) is an alleged Chinese-speaking adversary whose primary objective appeared to be cryptojacking, or stealing victim system resources for the purposes of mining cryptocurrency. The name [Rocke](https://attack.mitre.org/groups/G0106) comes from the email address \"rocke@live.cn\" used to create the wallet which held collected cryptocurrency. Researchers have detected overlaps between [Rocke](https://attack.mitre.org/groups/G0106) and the Iron Cybercrime Group, though this attribution has not been confirmed.(Citation: Talos Rocke August 2018)", "color": "#fce903", "group": 5, "header": "G0106", "name": "Rocke", "width": 10}, {"_id": 840, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Rocke](https://attack.mitre.org/groups/G0106) has installed an \"init.d\" startup script to maintain persistence.(Citation: Anomali Rocke March 2019)\t", "header": "T1037", "name": "Boot or Logon Initialization Scripts"}, {"_id": 841, "body": "\u003cb\u003eTactic:\u003c/b\u003e defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Rocke](https://attack.mitre.org/groups/G0106) has cleared log files within the /var/log/ folder.(Citation: Anomali Rocke March 2019)", "header": "T1070.002", "name": "Clear Linux or Mac System Logs"}, {"_id": 842, "body": "\u003cb\u003eAliases:\u003c/b\u003e Whitefly\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Whitefly](https://attack.mitre.org/groups/G0107) is a cyber espionage group that has been operating since at least 2017. The group has targeted organizations based mostly in Singapore across a wide variety of sectors, and is primarily interested in stealing large amounts of sensitive information. The group has been linked to an attack against Singapore\u2019s largest public health organization, SingHealth.(Citation: Symantec Whitefly March 2019)", "color": "#fce903", "group": 5, "header": "G0107", "name": "Whitefly", "width": 10}, {"_id": 843, "body": "\u003cb\u003eAliases:\u003c/b\u003e Blue Mockingbird\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Blue Mockingbird](https://attack.mitre.org/groups/G0108) is a cluster of observed activity involving Monero cryptocurrency-mining payloads in dynamic-link library (DLL) form on Windows systems. The earliest observed Blue Mockingbird tools were created in December 2019.(Citation: RedCanary Mockingbird May 2020)", "color": "#fce903", "group": 5, "header": "G0108", "name": "Blue Mockingbird", "width": 10}, {"_id": 844, "body": "\u003cb\u003eTactics:\u003c/b\u003e persistence, privilege-escalation, defense-evasion\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Blue Mockingbird](https://attack.mitre.org/groups/G0108) has used wmic.exe and Windows Registry modifications to set the COR_PROFILER environment variable to execute a malicious DLL whenever a process loads the .NET CLR.(Citation: RedCanary Mockingbird May 2020)", "header": "T1574.012", "name": "COR_PROFILER"}, {"_id": 845, "body": "\u003cb\u003eAliases:\u003c/b\u003e Windshift, Bahamut\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Windshift](https://attack.mitre.org/groups/G0112) is a threat group that has been active since at least 2017, targeting specific individuals for surveillance in government departments and critical infrastructure across the Middle East.(Citation: SANS Windshift August 2018)(Citation: objective-see windtail1 dec 2018)(Citation: objective-see windtail2 jan 2019)", "color": "#fce903", "group": 5, "header": "G0112", "name": "Windshift", "width": 10}, {"_id": 846, "body": "[WindTail](https://attack.mitre.org/software/S0466) is a macOS surveillance implant used by [Windshift](https://attack.mitre.org/groups/G0112). [WindTail](https://attack.mitre.org/software/S0466) shares code similarities with Hack Back aka KitM OSX.(Citation: SANS Windshift August 2018)(Citation: objective-see windtail1 dec 2018)(Citation: objective-see windtail2 jan 2019)", "color": "#ff3232", "header": "S0466", "name": "WindTail"}, {"_id": 847, "body": "\u003cb\u003eAliases:\u003c/b\u003e Chimera\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Chimera](https://attack.mitre.org/groups/G0114) is a suspected China-based threat group that has been active since at least 2018 targeting the semiconductor industry in Taiwan as well as data from the airline industry.(Citation: Cycraft Chimera April 2020)(Citation: NCC Group Chimera January 2021)", "color": "#fce903", "group": 5, "header": "G0114", "name": "Chimera", "width": 10}, {"_id": 848, "body": "\u003cb\u003eTactics:\u003c/b\u003e credential-access, defense-evasion, persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Chimera](https://attack.mitre.org/groups/G0114)\u0027s malware has altered the NTLM authentication program on domain controllers to allow [Chimera](https://attack.mitre.org/groups/G0114) to login without a valid credential.(Citation: Cycraft Chimera April 2020)\t", "header": "T1556.001", "name": "Domain Controller Authentication"}, {"_id": 849, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Chimera](https://attack.mitre.org/groups/G0114) has registered alternate phone numbers for compromised users to intercept 2FA codes sent via SMS.(Citation: NCC Group Chimera January 2021)", "header": "T1111", "name": "Two-Factor Authentication Interception"}, {"_id": 850, "body": "\u003cb\u003eAliases:\u003c/b\u003e GOLD SOUTHFIELD\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [GOLD SOUTHFIELD](https://attack.mitre.org/groups/G0115) is a financially motivated threat group active since at least 2019 that operates the [REvil](https://attack.mitre.org/software/S0496) Ransomware-as-a Service (RaaS). [GOLD SOUTHFIELD](https://attack.mitre.org/groups/G0115) provides backend infrastructure for affiliates recruited on underground forums to perpetrate high value deployments.(Citation: Secureworks REvil September 2019)(Citation: Secureworks GandCrab and REvil September 2019)(Citation: Secureworks GOLD SOUTHFIELD)", "color": "#fce903", "group": 5, "header": "G0115", "name": "GOLD SOUTHFIELD", "width": 10}, {"_id": 851, "body": "[REvil](https://attack.mitre.org/software/S0496) is a ransomware family that has been linked to the [GOLD SOUTHFIELD](https://attack.mitre.org/groups/G0115) group and operated as ransomware-as-a-service (RaaS) since at least April 2019. [REvil](https://attack.mitre.org/software/S0496) is highly configurable and shares code similarities with the GandCrab RaaS.(Citation: Secureworks REvil September 2019)(Citation: Intel 471 REvil March 2020)(Citation: Group IB Ransomware May 2020)", "color": "#ff3232", "header": "S0496", "name": "REvil"}, {"_id": 852, "body": "\u003cb\u003eAliases:\u003c/b\u003e Operation Wocao\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Operation Wocao](https://attack.mitre.org/groups/G0116) described activities carried out by a China-based cyber espionage adversary. [Operation Wocao](https://attack.mitre.org/groups/G0116) targeted entities within the government, managed service providers, energy, health care, and technology sectors across several countries, including China, France, Germany, the United Kingdom, and the United States. [Operation Wocao](https://attack.mitre.org/groups/G0116) used similar TTPs and tools to APT20, suggesting a possible overlap.(Citation: FoxIT Wocao December 2019)", "color": "#fce903", "group": 5, "header": "G0116", "name": "Operation Wocao", "width": 10}, {"_id": 853, "body": "\u003cb\u003eAliases:\u003c/b\u003e Fox Kitten, UNC757, PIONEER KITTEN, Parisite\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Fox Kitten](https://attack.mitre.org/groups/G0117) is threat actor with a suspected nexus to the Iranian government that has been active since at least 2017 against entities in the Middle East, North Africa, Europe, Australia, and North America. [Fox Kitten](https://attack.mitre.org/groups/G0117) has targeted multiple industrial verticals including oil and gas, technology, government, defense, healthcare, manufacturing, and engineering.(Citation: ClearkSky Fox Kitten February 2020)(Citation: CrowdStrike PIONEER KITTEN August 2020)(Citation: Dragos PARISITE )(Citation: ClearSky Pay2Kitten December 2020)", "color": "#fce903", "group": 5, "header": "G0117", "name": "Fox Kitten", "width": 10}, {"_id": 854, "body": "[Ngrok](https://attack.mitre.org/software/S0508) is a legitimate reverse proxy tool that can create a secure tunnel to servers located behind firewalls or on local machines that do not have a public IP. [Ngrok](https://attack.mitre.org/software/S0508) has been leveraged by threat actors in several campaigns including use for lateral movement and data exfiltration.(Citation: Zdnet Ngrok September 2018)(Citation: FireEye Maze May 2020)(Citation: Cyware Ngrok May 2019)", "color": "#ff3232", "header": "S0508", "name": "Ngrok"}, {"_id": 855, "body": "\u003cb\u003eTactic:\u003c/b\u003e collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Fox Kitten](https://attack.mitre.org/groups/G0117) has obtained files from the victim\u0027s cloud storage instances.(Citation: CISA AA20-259A Iran-Based Actor September 2020)", "header": "T1530", "name": "Data from Cloud Storage Object"}, {"_id": 856, "body": "[Pay2Key](https://attack.mitre.org/software/S0556) is a ransomware written in C++ that has been used by [Fox Kitten](https://attack.mitre.org/groups/G0117) since at least July 2020 including campaigns against Israeli companies. [Pay2Key](https://attack.mitre.org/software/S0556) has been incorporated with a leak site to display stolen sensitive information to further pressure victims into payment.(Citation: ClearkSky Fox Kitten February 2020)(Citation: Check Point Pay2Key November 2020)", "color": "#ff3232", "header": "S0556", "name": "Pay2Key"}, {"_id": 857, "body": "\u003cb\u003eAliases:\u003c/b\u003e Indrik Spider\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Indrik Spider](https://attack.mitre.org/groups/G0119) is a financially motivated threat group that has leveraged the Dridex banking trojan since at least June 2014 and delivered ransomware variants since 2017.(Citation: Crowdstrike Indrik November 2018) ", "color": "#fce903", "group": 5, "header": "G0119", "name": "Indrik Spider", "width": 10}, {"_id": 858, "body": "[BitPaymer](https://attack.mitre.org/software/S0570) is a ransomware variant first observed in August 2017 targeting hospitals in the U.K. [BitPaymer](https://attack.mitre.org/software/S0570) uses a unique encryption key, ransom note, and contact information for each operation. [BitPaymer](https://attack.mitre.org/software/S0570) has several indicators suggesting overlap with the [Dridex](https://attack.mitre.org/software/S0384) malware and is often delivered via [Dridex](https://attack.mitre.org/software/S0384).(Citation: Crowdstrike Indrik November 2018)", "color": "#ff3232", "header": "S0570", "name": "BitPaymer"}, {"_id": 859, "body": "\u003cb\u003eAliases:\u003c/b\u003e Evilnum\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Evilnum](https://attack.mitre.org/groups/G0120) is a financially motivated threat group that has been active since at least 2018.(Citation: ESET EvilNum July 2020)", "color": "#fce903", "group": 5, "header": "G0120", "name": "Evilnum", "width": 10}, {"_id": 860, "body": "\u003cb\u003eTactic:\u003c/b\u003e credential-access\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Evilnum](https://attack.mitre.org/groups/G0120) can steal cookies and session information from browsers.(Citation: ESET EvilNum July 2020)", "header": "T1539", "name": "Steal Web Session Cookie"}, {"_id": 861, "body": "[EVILNUM](https://attack.mitre.org/software/S0568) is fully capable backdoor that was first identified in 2018. [EVILNUM](https://attack.mitre.org/software/S0568) is used by the APT group [Evilnum](https://attack.mitre.org/groups/G0120) which has the same name.(Citation: ESET EvilNum July 2020)(Citation: Prevailion EvilNum May 2020)", "color": "#ff3232", "header": "S0568", "name": "EVILNUM"}, {"_id": 862, "body": "\u003cb\u003eAliases:\u003c/b\u003e Sidewinder, T-APT-04, Rattlesnake\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Sidewinder](https://attack.mitre.org/groups/G0121) is a suspected Indian threat actor group that has been active since at least 2012. They have been observed targeting government, military, and business entities throughout Asia, primarily focusing on Pakistan, China, Nepal, and Afghanistan.(Citation: ATT Sidewinder January 2021)(Citation: Securelist APT Trends April 2018)(Citation: Cyble Sidewinder September 2020)", "color": "#fce903", "group": 5, "header": "G0121", "name": "Sidewinder", "width": 10}, {"_id": 863, "body": "\u003cb\u003eAliases:\u003c/b\u003e Silent Librarian, TA407, COBALT DICKENS\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Silent Librarian](https://attack.mitre.org/groups/G0122) is a group that has targeted research and proprietary data at universities, government agencies, and private sector companies worldwide since at least 2013. Members of  [Silent Librarian](https://attack.mitre.org/groups/G0122) are known to have been affiliated with the Iran-based Mabna Institute which has conducted cyber intrusions at the behest of the government of Iran, specifically the Islamic Revolutionary Guard Corps (IRGC).(Citation: DOJ Iran Indictments March 2018)(Citation: Phish Labs Silent Librarian)(Citation: Malwarebytes Silent Librarian October 2020)", "color": "#fce903", "group": 5, "header": "G0122", "name": "Silent Librarian", "width": 10}, {"_id": 864, "body": "\u003cb\u003eTactic:\u003c/b\u003e collection\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Silent Librarian](https://attack.mitre.org/groups/G0122) has exfiltrated entire mailboxes from compromised accounts.(Citation: DOJ Iran Indictments March 2018)", "header": "T1114", "name": "Email Collection"}, {"_id": 865, "body": "\u003cb\u003eTactic:\u003c/b\u003e resource-development\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Silent Librarian](https://attack.mitre.org/groups/G0122) has cloned victim organization login pages and staged them for later use in credential harvesting campaigns. [Silent Librarian](https://attack.mitre.org/groups/G0122) has also made use of a variety of URL shorteners for these staged websites.(Citation: Secureworks COBALT DICKENS September 2019)(Citation: Malwarebytes Silent Librarian October 2020)(Citation: Proofpoint TA407 September 2019)", "header": "T1608.005", "name": "Link Target"}, {"_id": 866, "body": "\u003cb\u003eAliases:\u003c/b\u003e Volatile Cedar, Lebanese Cedar\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Volatile Cedar](https://attack.mitre.org/groups/G0123) is a Lebanese threat group that has targeted individuals, companies, and institutions worldwide. [Volatile Cedar](https://attack.mitre.org/groups/G0123) has been operating since 2012 and is motivated by political and ideological interests.(Citation: CheckPoint Volatile Cedar March 2015)(Citation: ClearSky Lebanese Cedar Jan 2021)", "color": "#fce903", "group": 5, "header": "G0123", "name": "Volatile Cedar", "width": 10}, {"_id": 867, "body": "[Explosive](https://attack.mitre.org/software/S0569) is a custom-made remote access tool used by the group [Volatile Cedar](https://attack.mitre.org/groups/G0123). It was first identified in the wild in 2015.(Citation: CheckPoint Volatile Cedar March 2015)(Citation: ClearSky Lebanese Cedar Jan 2021)  ", "color": "#ff3232", "header": "S0569", "name": "Explosive"}, {"_id": 868, "body": "[Caterpillar WebShell](https://attack.mitre.org/software/S0572) is a self-developed Web Shell tool created by the group [Volatile Cedar](https://attack.mitre.org/groups/G0123).(Citation: ClearSky Lebanese Cedar Jan 2021) ", "color": "#ff3232", "header": "S0572", "name": "Caterpillar WebShell"}, {"_id": 869, "body": "\u003cb\u003eAliases:\u003c/b\u003e Windigo\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e The [Windigo](https://attack.mitre.org/groups/G0124) group has been operating since at least 2011, compromising thousands of Linux and Unix servers using the [Ebury](https://attack.mitre.org/software/S0377) SSH backdoor to create a spam botnet. Despite law enforcement intervention against the creators, [Windigo](https://attack.mitre.org/groups/G0124) operators continued updating [Ebury](https://attack.mitre.org/software/S0377) through 2019.(Citation: ESET Windigo Mar 2014)(Citation: CERN Windigo June 2019)", "color": "#fce903", "group": 5, "header": "G0124", "name": "Windigo", "width": 10}, {"_id": 870, "body": "[Ebury](https://attack.mitre.org/software/S0377) is an SSH backdoor targeting Linux operating systems. Attackers require root-level access, which allows them to replace SSH binaries (ssh, sshd, ssh-add, etc) or modify a shared library used by OpenSSH (libkeyutils).(Citation: ESET Ebury Feb 2014)(Citation: BleepingComputer Ebury March 2017)(Citation: ESET Ebury Oct 2017)", "color": "#ff3232", "header": "S0377", "name": "Ebury"}, {"_id": 871, "body": "\u003cb\u003eTactic:\u003c/b\u003e persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Ebury](https://attack.mitre.org/software/S0377) has been embedded into modified OpenSSH binaries to gain persistent access to SSH credential information.(Citation: ESET Ebury Feb 2014)", "header": "T1554", "name": "Compromise Client Software Binary"}, {"_id": 872, "body": "\u003cb\u003eTactics:\u003c/b\u003e credential-access, defense-evasion, persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Ebury](https://attack.mitre.org/software/S0377) can intercept private keys using a trojanized \u003ccode\u003essh-add\u003c/code\u003e function.(Citation: ESET Ebury Feb 2014)", "header": "T1556", "name": "Modify Authentication Process"}, {"_id": 873, "body": "\u003cb\u003eTactics:\u003c/b\u003e credential-access, defense-evasion, persistence\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Ebury](https://attack.mitre.org/software/S0377) can deactivate PAM modules to tamper with the sshd configuration.(Citation: ESET Ebury Oct 2017)", "header": "T1556.003", "name": "Pluggable Authentication Modules"}, {"_id": 874, "body": "\u003cb\u003eAliases:\u003c/b\u003e HAFNIUM, Operation Exchange Marauder\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [HAFNIUM](https://attack.mitre.org/groups/G0125) is a likely state-sponsored cyber espionage group operating out of China that has been active since at least January 2021. [HAFNIUM](https://attack.mitre.org/groups/G0125) primarily targets entities in the US across a number of industry sectors, including infectious disease researchers, law firms, higher education institutions, defense contractors, policy think tanks, and NGOs.(Citation: Microsoft HAFNIUM March 2020)(Citation: Volexity Exchange Marauder March 2021)", "color": "#fce903", "group": 5, "header": "G0125", "name": "HAFNIUM", "width": 10}, {"_id": 875, "body": "\u003cb\u003eTactic:\u003c/b\u003e reconnaissance\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[HAFNIUM](https://attack.mitre.org/groups/G0125) has interacted with Office 365 tenants to gather details regarding target\u0027s environments.(Citation: Microsoft HAFNIUM March 2020)", "header": "T1592.004", "name": "Client Configurations"}, {"_id": 876, "body": "\u003cb\u003eTactic:\u003c/b\u003e reconnaissance\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[HAFNIUM](https://attack.mitre.org/groups/G0125) gathered the fully qualified domain names (FQDNs) for targeted Exchange servers in the victim\u0027s environment.(Citation: Volexity Exchange Marauder March 2021)", "header": "T1590", "name": "Gather Victim Network Information"}, {"_id": 877, "body": "\u003cb\u003eTactic:\u003c/b\u003e reconnaissance\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[HAFNIUM](https://attack.mitre.org/groups/G0125) has obtained IP addresses for publicly-accessible Exchange servers.(Citation: Volexity Exchange Marauder March 2021)", "header": "T1590.005", "name": "IP Addresses"}, {"_id": 878, "body": "\u003cb\u003eAliases:\u003c/b\u003e Higaisa\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Higaisa](https://attack.mitre.org/groups/G0126) is a threat group suspected to have South Korean origins. [Higaisa](https://attack.mitre.org/groups/G0126) has targeted government, public, and trade organizations in North Korea; however, they have also carried out attacks in China, Japan, Russia, Poland, and other nations. [Higaisa](https://attack.mitre.org/groups/G0126) was first disclosed in early 2019 but is assessed to have operated as early as 2009.(Citation: Malwarebytes Higaisa 2020)(Citation: Zscaler Higaisa 2020)(Citation: PTSecurity Higaisa 2020)", "color": "#fce903", "group": 5, "header": "G0126", "name": "Higaisa", "width": 10}, {"_id": 879, "body": "\u003cb\u003eAliases:\u003c/b\u003e TA551, GOLD CABIN, Shathak\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [TA551](https://attack.mitre.org/groups/G0127) is a financially-motivated threat group that has been active since at least 2018. (Citation: Secureworks GOLD CABIN) The group has primarily targeted English, German, Italian, and Japanese speakers through email-based malware distribution campaigns. (Citation: Unit 42 TA551 Jan 2021)", "color": "#fce903", "group": 5, "header": "G0127", "name": "TA551", "width": 10}, {"_id": 880, "body": "[IcedID](https://attack.mitre.org/software/S0483) is a modular banking malware designed to steal financial information that has been observed in the wild since at least 2017.  [IcedID](https://attack.mitre.org/software/S0483)  has been downloaded by [Emotet](https://attack.mitre.org/software/S0367) in multiple campaigns.(Citation: IBM IcedID November 2017)(Citation: Juniper IcedID June 2020)", "color": "#ff3232", "header": "S0483", "name": "IcedID"}, {"_id": 881, "body": "[Valak](https://attack.mitre.org/software/S0476) is a multi-stage modular malware that can function as a standalone information stealer or downloader, first observed in 2019 targeting enterprises in the US and Germany.(Citation: Cybereason Valak May 2020)(Citation: Unit 42 Valak July 2020)", "color": "#ff3232", "header": "S0476", "name": "Valak"}, {"_id": 882, "body": "[Ursnif](https://attack.mitre.org/software/S0386) is a banking trojan and variant of the Gozi malware observed being spread through various automated exploit kits, [Spearphishing Attachment](https://attack.mitre.org/techniques/T1566/001)s, and malicious links.(Citation: NJCCIC Ursnif Sept 2016)(Citation: ProofPoint Ursnif Aug 2016) [Ursnif](https://attack.mitre.org/software/S0386) is associated primarily with data theft, but variants also include components (backdoors, spyware, file injectors, etc.) capable of a wide variety of behaviors.(Citation: TrendMicro Ursnif Mar 2015)", "color": "#ff3232", "header": "S0386", "name": "Ursnif"}, {"_id": 883, "body": "\u003cb\u003eTactics:\u003c/b\u003e defense-evasion, privilege-escalation\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription: \u003c/b\u003e[Ursnif](https://attack.mitre.org/software/S0386) has injected code into target processes via thread local storage callbacks.(Citation: TrendMicro Ursnif Mar 2015)(Citation: TrendMicro PE_URSNIF.A2)(Citation: FireEye Ursnif Nov 2017)", "header": "T1055.005", "name": "Thread Local Storage"}, {"_id": 884, "body": "\u003cb\u003eAliases:\u003c/b\u003e ZIRCONIUM, APT31\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [ZIRCONIUM](https://attack.mitre.org/groups/G0128) is a threat group operating out of China, active since at least 2017, that has targeted individuals associated with the 2020 US presidential election and prominent leaders in the international affairs community.(Citation: Microsoft Targeting Elections September 2020)(Citation: Check Point APT31 February 2021)", "color": "#fce903", "group": 5, "header": "G0128", "name": "ZIRCONIUM", "width": 10}, {"_id": 885, "body": "\u003cb\u003eAliases:\u003c/b\u003e Mustang Panda, TA416, RedDelta, BRONZE PRESIDENT\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Mustang Panda](https://attack.mitre.org/groups/G0129) is a China-based cyber espionage threat actor that was first observed in 2017 but may have been conducting operations since at least 2014. [Mustang Panda](https://attack.mitre.org/groups/G0129) has targeted government entities, nonprofits, religious, and other non-governmental organizations in the U.S., Germany, Mongolia, Myanmar, Pakistan, and Vietnam, among others.(Citation: Crowdstrike MUSTANG PANDA June 2018)(Citation: Anomali MUSTANG PANDA October 2019)(Citation: Secureworks BRONZE PRESIDENT December 2019) ", "color": "#fce903", "group": 5, "header": "G0129", "name": "Mustang Panda", "width": 10}, {"_id": 886, "body": "\u003cb\u003eAliases:\u003c/b\u003e Ajax Security Team, Operation Woolen-Goldfish, AjaxTM, Rocket Kitten, Flying Kitten, Operation Saffron Rose\u003cbr\u003e\u003chr\u003e\u003cb\u003eDescription:\u003c/b\u003e [Ajax Security Team](https://attack.mitre.org/groups/G0130) is a group that has been active since at least 2010 and believed to be operating out of Iran. By 2014 [Ajax Security Team](https://attack.mitre.org/groups/G0130) transitioned from website defacement operations to malware-based cyber espionage campaigns targeting the US defense industrial base and Iranian users of anti-censorship technologies.(Citation: FireEye Operation Saffron Rose 2013)", "color": "#fce903", "group": 5, "header": "G0130", "name": "Ajax Security Team", "width": 10}, {"_id": 887, "body": "[sqlmap](https://attack.mitre.org/software/S0225) is an open source penetration testing tool th
